(43, 30, 1732555886, 1732555583, 0, 0, 0, 0, NULL, 0x7b2273686f77696e70726576696577223a22222c22616c7465726e6174697665223a22222c226465736372697074696f6e223a22222c226c696e6b223a22222c227469746c65223a22222c2263726f70223a22222c227569645f6c6f63616c223a22222c2268696464656e223a22222c227379735f6c616e67756167655f756964223a22227d, 0, 0, 0, 0, 39, NULL, NULL, 5, 'tx_news_domain_model_news', 'fal_media', 1, '', 'Am Samstag waren für den TSV Ladbergen Laura Herter, Hanna Busiek und Marlene Salinga im Einsatz, unterstützt wurden sie von der Nachwuchturnering Lena Knüfer. Ersatzgeschwächt reisten die Mädels nach Beckum an. Die Ausgangslage aus der Hinunde - Platz 8 von 13 - schien nicht wiederholbar zu sein. Aber nach dem Motto \"Es gibt nix zu verlieren\"  waren die Turnerinnen motiviert und hatten im Training an einigen Geräten höhere P-Stufen trainiert. Los ging es dann am Sprung. Hier konnte Hanna einen schönen Hanstandüberschlag zeigen und bekam dafür 14,65 Punkte. Damit konnte man gut zufrieden sein und die Riege wechselte zum Barren. Hier zeigten alle vier Turnerinnen sauber durchgeturnte P6-Übungen. Für den Balken hatte sich Laura sogar eine P8 vorgenommen und konnte diese sehr schwierige Übung ohne Sturz durchturnen. Zudem haben Hanna und Lena zum ersten Mal im Wettkampf ein Rad auf dem Balken geturnt! Dieser Erfahrung wird ihnen bei den nächsten Wettkämpfen mehr Selbstvertrauen geben. Auch am Boden hatten Lena und Laura schon die P8 trainiert und haben diese auch den Kampfrichterinnen präsentiert! Der Wettkampf war durchgeturnt und die Turnerinnen konnten voll und ganz mit sich  zufrieden sein! Nun kam das Warten auf die Ergebnisbekanntgabe.....Trotz der sehr engen Personalsituation hatten die Mädels in der Rückrunde den 9. Platz belegt und im Gesamtergebnis konnten der 8. Platz gehalten werden. Die Trainerinnen waren mit dem Einsatz der jungen Damen und dem Ergebnis sehr zufrieden.', '{\"default\":{\"cropArea\":{\"x\":7.744645604077505e-5,\"y\":0.04952076677316293,\"width\":0.9988451070879184,\"height\":0.8977635782747604},\"selectedRatio\":\"Quer\",\"focusArea\":null},\"header\":{\"cropArea\":{\"x\":0,\"y\":0.05059920106524634,\"width\":1,\"height\":0.8988015978695073},\"selectedRatio\":\"16:9\",\"focusArea\":null},\"menu\":{\"cropArea\":{\"x\":0.18708333333333332,\"y\":0,\"width\":0.6258333333333334,\"height\":1},\"selectedRatio\":\"1:1\",\"focusArea\":null}}', 0, 1),
(44, 30, 1732555886, 1732555583, 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 0, 0, 0, 0, 40, NULL, NULL, 5, 'tx_news_domain_model_news', 'fal_media', 2, '', 'Am Sonntag war dann die Kür-Riege im Einsatz. Auch hier waren statt der geplanten 6 Turnerinnen nur noch 4 im Beckum am Start. Einserseits nahm das den Traninerinnen die Entscheidung ab, wer an welchen Gerät turnen sollte (denn pro Gerät dürfen immer nur 4 Starterinnen turnen). Allerdings wäre es für das Abschneiden schon gut gewesen, wenn man Alternativen im Gepäck gehabt hätte. Denn die vergangenen Wettkämpfe hatten gezeigt, dass häufig noch in Verlauf des Wettkampfes die Geräteverteilung geändert werden musste. Im Hinkampf hatte die Riege den 5. Platz in einem 12er Teilnehmerfeld belegt. Da es bei der Bezirksliga nur darum geht den 1. oder 2. Platz zu belegen, um sich für die Relegation zur Münsterlandliga zu qualifizieren, hatten Enie Schlichter, Sarah Maneke, Daria Eberhardt und Svea Behling keinen zu großen Druck. Am ersten Gerät - dem Zitterbalken - lief es noch nicht ganz rund und die Riege musste 2 Stürze verbuchen, dennnoch gelang Daria eine schöne Übung, die mit 11,5 Punkten belohnt wurde. Das gibt Daria die nötige Sicherheit, um beim nächsten Wettkampf etwas überzeugter zu turnen. Den Boden mögen unsere Mädels besonders gerne und das konnten die Kampfrichterinnen auch sehen. Hier schafften die Turnerinnen den Tageshöchstwert aller Riegen! Besonders Svea Behling zeigte eine schwere Übung, die mit der Top-Wertung des Tages beohnt wurde - 13,2 Punkte -. Anschließend ging es an den Sprung, der nur mäßig erfolgreich war. Am letzten Gerät, dem Barren, hatten die Turnerinnen des TSV in den vergangenen Wettkämpfen immer ihr Probleme, aber das war in Beckum ganz anders. Der Trainingseinsatz hatte sich gelohnt! Alle vier TSVerinnen schafften alle Teile und turnten flüssig durch! Bei der Bekanntgabe der Ergebnisse war die Freude dann groß, denn man hatte  sich ohne große Erwartungen einen Platz nach vorne geschoben auf Platz 4! Auch in der Gesamtwerturn nach Hin- und Rückrunde schafften die Turnerinnen des TSV es auf den 4. Platz.', '{\"default\":{\"cropArea\":{\"x\":0.001,\"y\":0.09479166666666666,\"width\":0.997,\"height\":0.74775},\"selectedRatio\":\"Quer\",\"focusArea\":null},\"header\":{\"cropArea\":{\"x\":0,\"y\":0.125,\"width\":1,\"height\":0.75},\"selectedRatio\":\"16:9\",\"focusArea\":null},\"menu\":{\"cropArea\":{\"x\":0.125,\"y\":0,\"width\":0.75,\"height\":1},\"selectedRatio\":\"1:1\",\"focusArea\":null}}', 0, 1),
(45, 30, 1733826108, 1732557465, 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 0, 0, 0, 0, 41, NULL, NULL, 6, 'tx_news_domain_model_news', 'fal_media', 1, '', 'Los ging es morgens mit dem Wettkampf der 10-jährigen Mädchen. Hier hatte der TSV gleich 3 Starterinnen gemeldet. Geturnt wurden die Übungen der P6 und P7! Los ging es am Boden. Hier waren die Ladbergerinnen die ersten Turnerinnen, die von den Kampfrichterinnen gewertet wurden! Sowohl Lucy Berghaus, Arina Matyusha als auch Lena Knüfer zeigten sehr sauber ausgeturnte Übungen! Somit war der Wettkampfstart gelungen! Danach ging es an den Sprungtisch. Hier konnte besonders Lena mit einem top Überschlag strahlen und auf dem Wertungszettel standen am Ende 16,2 Punkte.  Auch am Barren zeigten die Mädels keine Schwäche und turnten die Übungen flüssig durch. Als letztes Gerät stand dann noch der Schwebebalken auf dem Programm. Alle drei kamen ohne Sturz durch ihre Übung und so konnte man der Siegerehrung gelassen entgegensehen. Das Ergebnis war überragend! So konnte Lena mit insgesamt 60,80 erturnten Punkten ihren Bezirksmeisterinnen-Titel vom letzten Jahr verteidigen! Der jubel der mitgereisten Eltern war riesig! Aber auch Lucy erreichte ihre erste Brozemedaille als Einzelstarterin. Und auch Arina erreichte den 5 Platz von insgesamt 25 Turnerinnen. Ein wirklich toller Wettkampf von allen! ', '{\"default\":{\"cropArea\":{\"x\":0,\"y\":0.09482375592417061,\"width\":0.999,\"height\":0.6658027251184834},\"selectedRatio\":\"Quer\",\"focusArea\":null},\"header\":{\"cropArea\":{\"x\":0,\"y\":0.1667654028436019,\"width\":1,\"height\":0.6664691943127962},\"selectedRatio\":\"16:9\",\"focusArea\":null},\"menu\":{\"cropArea\":{\"x\":0.078,\"y\":0,\"width\":0.844,\"height\":1},\"selectedRatio\":\"1:1\",\"focusArea\":null}}', 0, 1),
