(55, 30, 1734262896, 1734072865, 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 0, 0, 0, 0, 51, NULL, NULL, 7, 'tx_news_domain_model_news', 'fal_media', 2, '', 'Morgens starteten die jüngeren Turnerinnen – Jahrgänge 2016 – 2019 -. Im jüngsten Wettkampf (5-jährige) war das Starterinnenfeld noch überschaubar. Für den TSV waren hier Lina Austermann (5. Platz) und Lotte Haase (6. Platz) im Einsatz. Für beide Nachwuchsstars war es der erste Wettkampf und da war die Aufregung natürlich ries ig groß. Trotzdem haben die beiden tolle Übungen gezeigt und man konnte oft in strahlende Augen sehen. ', '{\"default\":{\"cropArea\":{\"x\":6.260288420793835e-17,\"y\":0.04145220588235294,\"width\":0.9977973568281937,\"height\":0.7494485294117647},\"selectedRatio\":\"Quer\",\"focusArea\":null},\"header\":{\"cropArea\":{\"x\":0,\"y\":0.12444852941176471,\"width\":1,\"height\":0.7511029411764706},\"selectedRatio\":\"16:9\",\"focusArea\":null},\"menu\":{\"cropArea\":{\"x\":0.12555066079295155,\"y\":0,\"width\":0.748898678414097,\"height\":1},\"selectedRatio\":\"1:1\",\"focusArea\":null}}', 0, 0),
