(75, 1730228361, 1, 'BE', 1, 0, 3, 'tt_content', '{\"CType\":\"text\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"small\",\"colPos\":\"1\",\"date\":0,\"header_layout\":\"3\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"0\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":\"1\",\"hidden\":\"0\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"pid\":14,\"sorting\":256,\"header\":\"Datenschutz\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<p>Verantwortliche Stelle im Sinne der Datenschutzgesetze, insbesondere der EU-Datenschutzgrundverordnung (DSGVO), ist:<\\/p>\\r\\n<p>TSV Ladbergen 1921 e.V.&nbsp;<br \\/>Heidkampstra\\u00dfe 36<br \\/>49549 Ladbergen<\\/p>\\r\\n\\r\\n<p><strong>Ihre Betroffenenrechte<\\/strong><\\/p>\\r\\n<p>Unter den angegebenen Kontaktdaten k\\u00f6nnen Sie jederzeit folgende Rechte aus\\u00fcben:<\\/p>\\r\\n<ul><li>Auskunft \\u00fcber Ihre bei uns gespeicherten Daten und deren Verarbeitung,<\\/li><li>Berichtigung unrichtiger personenbezogener Daten,<\\/li><li>L\\u00f6schung Ihrer bei uns gespeicherten Daten,<\\/li><li>Einschr\\u00e4nkung der Datenverarbeitung, sofern wir Ihre Daten aufgrund gesetzlicher Pflichten noch nicht l\\u00f6schen d\\u00fcrfen,<\\/li><li>Widerspruch gegen die Verarbeitung Ihrer Daten bei uns und<\\/li><li>Daten\\u00fcbertragbarkeit, sofern Sie in die Datenverarbeitung eingewilligt haben oder einen Vertrag mit uns abgeschlossen haben.<\\/li><\\/ul>\\r\\n<p>Sofern Sie uns eine Einwilligung erteilt haben, k\\u00f6nnen Sie diese jederzeit mit Wirkung f\\u00fcr die Zukunft widerrufen.<\\/p>\\r\\n<p>Sie k\\u00f6nnen sich jederzeit mit einer Beschwerde an die f\\u00fcr Sie zust\\u00e4ndige Aufsichtsbeh\\u00f6rde wenden. Ihre zust\\u00e4ndige Aufsichtsbeh\\u00f6rde richtet sich nach dem Bundesland Ihres Wohnsitzes, Ihrer Arbeit oder der mutma\\u00dflichen Verletzung. Eine Liste der Aufsichtsbeh\\u00f6rden (f\\u00fcr den nicht\\u00f6ffentlichen Bereich) mit Anschrift finden Sie unter:&nbsp;<a href=\\\"https:\\/\\/www.bfdi.bund.de\\/DE\\/Infothek\\/Anschriften_Links\\/anschriften_links-node.html\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">https:\\/\\/www.bfdi.bund.de\\/DE\\/Infothek\\/Anschriften_Links\\/anschriften_links-node.html<\\/a>.<\\/p>\\r\\n\\r\\n<p><strong>Zwecke der Datenverarbeitung durch die verantwortliche Stelle und Dritte<\\/strong><\\/p>\\r\\n<p>Wir verarbeiten Ihre personenbezogenen Daten nur zu den in dieser Datenschutzerkl\\u00e4rung genannten Zwecken. Eine \\u00dcbermittlung Ihrer pers\\u00f6nlichen Daten an Dritte zu anderen als den genannten Zwecken findet nicht statt. Wir geben Ihre pers\\u00f6nlichen Daten nur an Dritte weiter, wenn:<\\/p>\\r\\n<ul><li>Sie Ihre ausdr\\u00fcckliche Einwilligung dazu erteilt haben,<\\/li><li>die Verarbeitung zur Abwicklung eines Vertrags mit Ihnen erforderlich ist,<\\/li><li>die Verarbeitung zur Erf\\u00fcllung einer rechtlichen Verpflichtung erforderlich ist,<\\/li><\\/ul>\\r\\n<p>die Verarbeitung zur Wahrung berechtigter Interessen erforderlich ist und kein Grund zur Annahme besteht, dass Sie ein \\u00fcberwiegendes schutzw\\u00fcrdiges Interesse an der Nichtweitergabe Ihrer Daten haben.<\\/p>\\r\\n\\r\\n<p><strong>L\\u00f6schung bzw. Sperrung der Daten<\\/strong><\\/p>\\r\\n<p>Wir halten uns an die Grunds\\u00e4tze der Datenvermeidung und Datensparsamkeit. Wir speichern Ihre personenbezogenen Daten daher nur so lange, wie dies zur Erreichung der hier genannten Zwecke erforderlich ist oder wie es die vom Gesetzgeber vorgesehenen vielf\\u00e4ltigen Speicherfristen vorsehen. Nach Fortfall des jeweiligen Zweckes bzw. Ablauf dieser Fristen werden die entsprechenden Daten routinem\\u00e4\\u00dfig und entsprechend den gesetzlichen Vorschriften gesperrt oder gel\\u00f6scht.<\\/p>\\r\\n\\r\\n<p><strong>Erfassung allgemeiner Informationen beim Besuch unserer Website<\\/strong><\\/p>\\r\\n<p>Wenn Sie auf unsere Website zugreifen, werden automatisch mittels eines Cookies Informationen allgemeiner Natur erfasst. Diese Informationen (Server-Logfiles) beinhalten etwa die Art des Webbrowsers, das verwendete Betriebssystem, den Domainnamen Ihres Internet-Service-Providers und \\u00e4hnliches. Hierbei handelt es sich ausschlie\\u00dflich um Informationen, welche keine R\\u00fcckschl\\u00fcsse auf Ihre Person zulassen.<\\/p>\\r\\n<p>Diese Informationen sind technisch notwendig, um von Ihnen angeforderte Inhalte von Webseiten korrekt auszuliefern und fallen bei Nutzung des Internets zwingend an. Sie werden insbesondere zu folgenden Zwecken verarbeitet:<\\/p>\\r\\n<ul><li>Sicherstellung eines problemlosen Verbindungsaufbaus der Website,<\\/li><li>Sicherstellung einer reibungslosen Nutzung unserer Website,<\\/li><li>Auswertung der Systemsicherheit und -stabilit\\u00e4t sowie<\\/li><li>zu weiteren administrativen Zwecken.<\\/li><\\/ul>\\r\\n<p>Die Verarbeitung Ihrer personenbezogenen Daten basiert auf unserem berechtigten Interesse aus den vorgenannten Zwecken zur Datenerhebung. Wir verwenden Ihre Daten nicht, um R\\u00fcckschl\\u00fcsse auf Ihre Person zu ziehen. Empf\\u00e4nger der Daten sind nur die verantwortliche Stelle und ggf. Auftragsverarbeiter.<\\/p>\\r\\n<p>Anonyme Informationen dieser Art werden von uns ggfs. statistisch ausgewertet, um unseren Internetauftritt und die dahinterstehende Technik zu optimieren.<\\/p>\\r\\n\\r\\n<p><strong>Cookies<\\/strong><\\/p>\\r\\n<p>Wie viele andere Webseiten verwenden wir auch so genannte \\u201eCookies\\u201c. Cookies sind kleine Textdateien, die von einem Websiteserver auf Ihre Festplatte \\u00fcbertragen werden. Hierdurch erhalten wir automatisch bestimmte Daten wie z. B. IP-Adresse, verwendeter Browser, Betriebssystem und Ihre Verbindung zum Internet.<\\/p>\\r\\n<p>Cookies k\\u00f6nnen nicht verwendet werden, um Programme zu starten oder Viren auf einen Computer zu \\u00fcbertragen. Anhand der in Cookies enthaltenen Informationen k\\u00f6nnen wir Ihnen die Navigation erleichtern und die korrekte Anzeige unserer Webseiten erm\\u00f6glichen.<\\/p>\\r\\n<p>In keinem Fall werden die von uns erfassten Daten an Dritte weitergegeben oder ohne Ihre Einwilligung eine Verkn\\u00fcpfung mit personenbezogenen Daten hergestellt.<\\/p>\\r\\n<p>Nat\\u00fcrlich k\\u00f6nnen Sie unsere Website grunds\\u00e4tzlich auch ohne Cookies betrachten. Internet-Browser sind regelm\\u00e4\\u00dfig so eingestellt, dass sie Cookies akzeptieren. Im Allgemeinen k\\u00f6nnen Sie die Verwendung von Cookies jederzeit \\u00fcber die Einstellungen Ihres Browsers deaktivieren. Bitte verwenden Sie die Hilfefunktionen Ihres Internetbrowsers, um zu erfahren, wie Sie diese Einstellungen \\u00e4ndern k\\u00f6nnen. Bitte beachten Sie, dass einzelne Funktionen unserer Website m\\u00f6glicherweise nicht funktionieren, wenn Sie die Verwendung von Cookies deaktiviert haben.<\\/p>\\r\\n\\r\\n<p><strong>SSL-Verschl\\u00fcsselung<\\/strong><\\/p>\\r\\n<p>Um die Sicherheit Ihrer Daten bei der \\u00dcbertragung zu sch\\u00fctzen, verwenden wir dem aktuellen Stand der Technik entsprechende Verschl\\u00fcsselungsverfahren (z. B. SSL) \\u00fcber HTTPS.<\\/p>\\r\\n\\r\\n<p><strong>Kontaktformular<\\/strong><\\/p>\\r\\n<p>Treten Sie bzgl. Fragen jeglicher Art per E-Mail oder Kontaktformular mit uns in Kontakt, erteilen Sie uns zum Zwecke der Kontaktaufnahme Ihre freiwillige Einwilligung. Hierf\\u00fcr ist die Angabe einer validen E-Mail-Adresse erforderlich. Diese dient der Zuordnung der Anfrage und der anschlie\\u00dfenden Beantwortung derselben. Die Angabe weiterer Daten ist optional. Die von Ihnen gemachten Angaben werden zum Zwecke der Bearbeitung der Anfrage sowie f\\u00fcr m\\u00f6gliche Anschlussfragen gespeichert. Nach Erledigung der von Ihnen gestellten Anfrage werden personenbezogene Daten automatisch gel\\u00f6scht.<\\/p>\\r\\n\\r\\n<p><strong>\\u00c4nderung unserer Datenschutzbestimmungen<\\/strong><\\/p>\\r\\n<p>Wir behalten uns vor, diese Datenschutzerkl\\u00e4rung anzupassen, damit sie stets den aktuellen rechtlichen Anforderungen entspricht oder um \\u00c4nderungen unserer Leistungen in der Datenschutzerkl\\u00e4rung umzusetzen, z.B. bei der Einf\\u00fchrung neuer Services. F\\u00fcr Ihren erneuten Besuch gilt dann die neue Datenschutzerkl\\u00e4rung.<\\/p>\\r\\n\\r\\n<p><i>Die Datenschutzerkl\\u00e4rung wurde mit dem&nbsp;<\\/i><a href=\\\"https:\\/\\/www.activemind.de\\/datenschutz\\/datenschutzhinweis-generator\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"><i>Datenschutzerkl\\u00e4rungs-Generator der activeMind AG erstellt<\\/i><\\/a><i>.<\\/i><\\/p>\",\"linkToTop\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1730228361,\"t3ver_stage\":0,\"tstamp\":1730228361,\"uid\":3}', 0, '0400$ebc6418b3f7dfaa9d49476bba5b82f94:b92300cfb5d1d3645c9cb212a7f56c1f');
