(98, 1730229862, 1, 'BE', 1, 0, 12, 'tt_content', '{\"CType\":\"text\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"small\",\"colPos\":\"1\",\"date\":0,\"header_layout\":\"3\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"0\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":\"1\",\"hidden\":\"0\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"pid\":7,\"sorting\":256,\"header\":\"Badminton\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<p>Badminton bietet der TSV ab Mitte 2021 an. Momentan besteht die Gruppe aus ca. 10 Frauen, M\\u00e4nnern und Jugendlichen, so dass Zuwachs durchaus gut w\\u00e4re. Es geht um reinen Hobbysport, Bewegung, Auspowern und wer mag ein gem\\u00fctliches Getr\\u00e4nk danach.<\\/p>\\r\\n<p>Es stehen vier Doppelfelder in der Jahnsporthalle zur Verf\\u00fcgung.&nbsp;<br \\/>Gespielt wird momentan mittwochs von 20 Uhr bis 21.30 Uhr.<\\/p>\\r\\n<p>Weitere Zeiten, z.B. am Wochenende k\\u00f6nnen individuell vergeben werden.<\\/p>\\r\\n<p>Reinschnuppern ohne Anmeldung oder Vereinsmitgliedschaft ist jederzeit m\\u00f6glich.<\\/p>\",\"linkToTop\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1730229862,\"t3ver_stage\":0,\"tstamp\":1730229862,\"uid\":12}', 0, '0400$486b678857524e3e2b1069f4d84672cd:b13bbccfb8e2fc277be02db62485ced6'),
