(105, 1730230153, 1, 'BE', 1, 0, 15, 'tt_content', '{\"CType\":\"text\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"small\",\"colPos\":\"1\",\"date\":0,\"header_layout\":\"3\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"0\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":\"1\",\"hidden\":\"0\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"pid\":6,\"sorting\":256,\"header\":\"Wir haben Bogensport in Ladbergen!\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<p>Kurz zur Geschichte und wie es dazu kam.<\\/p>\\r\\n<p>Am 11.06.2022 hat der TSV Ladbergen sein 100 J\\u00e4hriges Bestehen gefeiert. Das ganze fand auf der Tennisanlage vom TSV in Ladbergen statt. Durch meine Aktive Beteiligung an der Einrichtung einer Badminton Gruppe hatte ich gute Kontakte zum Vorstand und war eingeladen dabei zu sein.<\\/p>\\r\\n<p>Ich war mit meiner Lebensgef\\u00e4hrtin Tina Demond vor Ort. Die wiederum hat w\\u00e4hrend ihrer Ausbildung vor vielen Jahren den B\\u00fcrgermeister Thorsten Buller in der Berufsschule kennengelernt. Wie das Leben dann so spielt haben irgend Udo Kaiser vom TSV der B\\u00fcrgermeister meine Lebensgef\\u00e4hrtin und ich an einem Tisch gestanden und zusammen ein Bier getrunken. Ich habe dann irgendwann mal von meinen Problemen einen Platz zum Bogenschie\\u00dfen zu finden erz\\u00e4hlt und erw\\u00e4hnt das Bogensport in Ladbergen doch eigentlich eine tolle Idee w\\u00e4re. Das fanden der B\\u00fcrgermeister und der Vorstand auch. Nach einer kurzen Diskussion wurde mir dann vom B\\u00fcrgermeister ein Termin am folgenden Montag im Rathaus angeboten, mit dem Ziel eine Fl\\u00e4che zu finden auf der wir die Idee realisieren k\\u00f6nnen. Wir waren uns dann mit dem VFL einig das wir die Freiluftsportanlage an der K\\u00f6nigsbr\\u00fccke mit benutzen k\\u00f6nnten.&nbsp;<\\/p>\\r\\n<p>Danach bin ich in die Planung eingestiegen wir haben etwas Werbung gemacht \\u00fcber Mundpropaganda und Facebook. Am 01.09.2022 war der Plan dann reif und wir haben mit den Menschen die Interesse hatten eine WhatsApp Gruppe er\\u00f6ffnet und einen Termin f\\u00fcr ein erstes Treffen gemacht. Am 25.08.2022 viel dann der Start Schuss. Um 18:00 Uhr hat sich ein bunter Mix an Menschen auf dem Sportplatz getroffen. Ich hatte eine kleine Scheibe und einen Bogen dabei. Wir haben viel geredet und ein wenig geschossen und es hat sich schnell eine kleine Gruppe von Menschen gefunden die voll Bock auf das Thema hatten. &nbsp;<\\/p>\\r\\n<p>Kurz nach dem Treffen waren die ersten schon los sich mit B\\u00f6gen und Pfeilen ausstatten. Wir haben vom Verein zwei einfach Scheiben mit einfachem St\\u00e4nder besorgt. Von da an wurde bis lang jeden Sonntag von 10.00 Uhr bis 12:00 Uhr dort geschossen. Das sind jetzt immerhin schon 2 Jahre.<\\/p>\\r\\n<p>Die Gruppe ist extrem Entspannt. Wir bauen seid dem unsere Scheibenst\\u00e4nder selber. Aktuell sind wir bei 5 Scheiben angekommen und wir sind ca. 18 Aktive Sch\\u00fctzen\\/Sch\\u00fctzinnen. Bei uns ist jeder Willkommen der es mal versuchen m\\u00f6chte. Kinder ab 10 Jahre bis 14 Jahre aber nur in Begleitung eines Erziehungsberechtigten. Das hat die Erfahrung gezeigt.<\\/p>\",\"linkToTop\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1730230153,\"t3ver_stage\":0,\"tstamp\":1730230153,\"uid\":15}', 0, '0400$554eca88656b6082a6df9b0cac112d80:cb118fde3da18e67b21a92b60bb8cbda');
