(139, 1730231309, 1, 'BE', 1, 0, 23, 'tt_content', '{\"CType\":\"textpic\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"small\",\"colPos\":\"1\",\"date\":0,\"header_layout\":\"3\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"0\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":\"1\",\"hidden\":\"0\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"pid\":22,\"sorting\":256,\"header\":\"Nat\\u00fcrlich bietet die Tennisabteilung auch Trainingsstunden an\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<p>F\\u00fcr Kinder und Jugendliche besteht sowohl die M\\u00f6glichkeit \\u00fcber Schnuppertraining in den Tennissport einzublicken, zudem kann in festen Trainingsgruppen das ganze Jahr \\u00fcber bei ausgebildeten Trainern trainiert werden. Das Training wird hierbei alter- und leistungsgerecht an die Kinder und Jugendlichen angepasst.<\\/p>\\r\\n\\r\\n<p><strong>Ab welchem Alter mit Tennisspielen begonnen werden sollte?<\\/strong><\\/p>\\r\\n<p>Ein richtiges oder falsches Einstiegsalter gibt es nicht. Viele Kinder fangen bereits im Alter von 5-6 Jahren an und da unser Training altersgerecht angepasst wird, ist dies auch kein Problem. Generell gilt: Je j\\u00fcnger man mit Tennis anf\\u00e4ngt, desto einfacher ist es, den Sport zu erlernen.<\\/p>\\r\\n\\r\\n<p><strong>Doch:<\\/strong> Tennis ist ein Sport f\\u00fcr jedes Alter. Nicht nur Kinder, sondern auch junge Erwachsene und Senioren k\\u00f6nnen an Tennis herangef\\u00fchrt werden.<\\/p>\\r\\n\\r\\n<p><strong>Daher bieten wir sowohl Schnuppertraining f\\u00fcr Erwachsene an, wie auch Trainerstunden f\\u00fcr Hobbyspieler, die noch etwas an ihrer Schlagtechnik verbessern m\\u00f6chten!<\\/strong><\\/p>\\r\\n\\r\\n<p><strong>Haben Sie Fragen zum Tennistraining?<\\/strong><\\/p>\\r\\n<p>Gerne helfen wir Ihnen weiter und informieren Sie.<\\/p>\",\"imageborder\":\"0\",\"image_zoom\":\"0\",\"linkToTop\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1730231309,\"t3ver_stage\":0,\"tstamp\":1730231309,\"uid\":23}', 0, '0400$7eb86b39ba1e677918d3e3897f44c0e5:0cf00ee1adffc41f8b3231c0de35256e'),
