(182, 1730233265, 1, 'BE', 1, 0, 28, 'tt_content', '{\"CType\":\"textpic\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"small\",\"colPos\":\"1\",\"date\":0,\"header_layout\":\"3\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"0\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":\"1\",\"hidden\":\"0\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"pid\":26,\"sorting\":256,\"header\":\"TSV Ladbergen II ist auf Wiedergutmachung aus\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<p><strong>Nach der zweiw\\u00f6chigen Osterpause geht es f\\u00fcr die Handballer der TSV-Reserve am<\\/strong><br \\/><strong>Samstag mit einem Heimspiel weiter. Zu Gast in der Rott-Sporthalle ist dann Adler<\\/strong><br \\/><strong>M\\u00fcnster.<\\/strong><\\/p>\\r\\n<p>Auf dem Papier eine ziemlich klare Angelegenheit. Die M\\u00fcnsteraner bekleiden mit<br \\/>8:30 Punkten derzeit Platz 12 und haben nur noch theoretische Chancen auf den<br \\/>Klassenerhalt in der M\\u00fcnsterlandklasse. Die Ladberger hingegen haben mit zuletzt<br \\/>f\\u00fcnf Siegen in Serie einen gesicherten Mittelfeldplatz fest im Visier. Nur eine Sache<br \\/>gie\\u00dft dabei doch \\u00d6l ins Feuer, denn die Ladberger erlitten im Hinspiel eine herbe<br \\/>30:23-Schlappe in M\\u00fcnster. Das Team von Trainergespann Stork\\/Friese ist also<br \\/>entsprechend gewarnt fokussiert an die Sache zu gehen. \\u201eBei Adler M\\u00fcnster wei\\u00df<br \\/>man nie was einen so wirklich erwartet. Es liegt immer ganz daran welches Personal<br \\/>den G\\u00e4sten zur Verf\\u00fcgung steht. In der Hinrunde haben wir gesehen was passieren<br \\/>kann, wenn M\\u00fcnster gut drauf ist. Aber wir wollen in eigener Halle den sechsten Sieg<br \\/>in Serie holen und uns f\\u00fcr den Saisonendspurt positionieren\\u201c, so Trainer Thorsten<br \\/>Stork.<br \\/><br \\/>Personell m\\u00fcssen die Ladberger am Wochenende auf die R\\u00fcckraumspieler Jan<br \\/>Hakmann und Dominik Walter verzichten, sowie auf Bernd Stiepermann und Tobias<br \\/>Kipp. Der Rest des Kaders ist einsatzbereit.<br \\/>Anwurf der Partie ist Samstag, 18 Uhr in der Rott-Sporthalle Ladbergen<\\/p>\",\"imageborder\":\"0\",\"image_zoom\":\"0\",\"linkToTop\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1730233265,\"t3ver_stage\":0,\"tstamp\":1730233265,\"uid\":28}', 0, '0400$a7276ab251e27543896013d79505617f:b5d015227f2b36f7786e2ff963ca9d51'),
