(202, 1730276014, 2, 'BE', 1, 0, 11, 'tt_content', '{\"oldRecord\":{\"header\":\"Einleitung Tennis\",\"subheader\":\"(folgt noch)\",\"bodytext\":\"<p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet.<\\/p>\",\"l18n_diffsource\":\"\"},\"newRecord\":{\"header\":\"Wir sind die Tennis-Abteilung\",\"subheader\":\"\",\"bodytext\":\"<p>Zur Zeit haben wir ca. 220 Mitglieder, in allen Altersklassen von 4 Jahren bis 80 Jahren. Wir spielen auf sechs gepflegten Sandpl\\u00e4tzen von April bis November. Auf unserer Anlage befindet sich ein modernes Clubhaus mit einer gro\\u00dfen Terrasse, die f\\u00fcr Vereinsveranstaltungen, sowie f\\u00fcr private Feiern der Vereinsmitgliedern genutzt wird. F\\u00fcr Zuschauer befindet sich eine weitere Terrasse direkt an den Spielfeldern.<\\/p>\\r\\n<p>Unser Verein ist von vielen Angeboten und Veranstaltungen f\\u00fcr jung und alt gepr\\u00e4gt.<\\/p>\\r\\n<p>F\\u00fcr Kinder und Jugendliche bieten wir Ballschulen, Kleinfeld- Tennistraining und Tennistraining \\u00fcber das ganze Jahr an. F\\u00fcr Erwachsene bieten wir Einzel,- oder auch Gruppentraining an. Das Training wird von professionellen Trainern durchgef\\u00fchrt.<\\/p>\\r\\n<p>F\\u00fcr alle, die noch nicht wissen, ob der Tennissport das richtige f\\u00fcr ihn ist, gibt es die M\\u00f6glichkeit an einem Schnuppertraining teilzunehmen, auch ohne Mitgliedschaft im TSV. Ebenfalls werden f\\u00fcr Erwachsene, Mixedturniere zum Saisonstart, zu Pfingsten, zum Neujahr gespielt. Hier sind auch neue Mitglieder und auch Anf\\u00e4nger herzlich willkommen.<\\/p>\\r\\n<p>In den Sommermonaten werden vereinsintern Meisterschaften im Jugend-, Damen- und Herrenbereich als Einzel und Doppel ausgetragen, was nach den Endspielen auch geb\\u00fchrend gefeiert wird. Nat\\u00fcrlich sind wir auch im Leistungsbereich mit Kindern und Erwachsenen dabei und nehmen an WTV Meisterschaftsspielen teil.<\\/p>\\r\\n<p>Der pers\\u00f6nliche Kontakt zu unseren Mitgliedern ist uns wichtig. Unser Vorstandsteam ist jederzeit f\\u00fcr Mitglieder und Interessierte ansprechbar und beantwortet gerne Fragen zum Verein und unseren Angeboten.<\\/p>\\r\\n<p>Willst du Teil unserer Tennisabteilung werden? Wir freuen uns auf Dich.<\\/p>\\r\\n\\r\\n<p>TSV- Tennisabteilung<br \\/>1. Vorsitzender<br \\/>Rainer Jendroska<\\/p>\\r\\n\\r\\n\\r\\n\",\"l18n_diffsource\":\"{\\\"CType\\\":\\\"\\\",\\\"colPos\\\":\\\"\\\",\\\"header\\\":\\\"\\\",\\\"header_layout\\\":\\\"\\\",\\\"header_position\\\":\\\"\\\",\\\"date\\\":\\\"\\\",\\\"header_link\\\":\\\"\\\",\\\"subheader\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"image\\\":\\\"\\\",\\\"imagewidth\\\":\\\"\\\",\\\"imageheight\\\":\\\"\\\",\\\"imageborder\\\":\\\"\\\",\\\"imageorient\\\":\\\"\\\",\\\"imagecols\\\":\\\"\\\",\\\"image_zoom\\\":\\\"\\\",\\\"layout\\\":\\\"\\\",\\\"frame_class\\\":\\\"\\\",\\\"space_before_class\\\":\\\"\\\",\\\"space_after_class\\\":\\\"\\\",\\\"sectionIndex\\\":\\\"\\\",\\\"linkToTop\\\":\\\"\\\",\\\"categories\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"editlock\\\":\\\"\\\",\\\"rowDescription\\\":\\\"\\\"}\"}}', 0, '0400$eea4984341383396300dd99c6c421288:7a14c618500ae24604910dfdd2f8ff12'),
