"pi_flexform\\\":\\\"\\\",\\\"layout\\\":\\\"\\\",\\\"frame_class\\\":\\\"\\\",\\\"space_before_class\\\":\\\"\\\",\\\"space_after_class\\\":\\\"\\\",\\\"sectionIndex\\\":\\\"\\\",\\\"linkToTop\\\":\\\"\\\",\\\"categories\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"editlock\\\":\\\"\\\",\\\"rowDescription\\\":\\\"\\\"}\"}}', 0, '0400$d153aee611b8abaf7ec7516ace1c8870:6fdd460ee24b22c6f60683a1eee4989a'),
(345, 1730792716, 1, 'BE', 1, 0, 1, 'tx_news_domain_model_news', '{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"hidden\":\"0\",\"istopnews\":\"0\",\"editlock\":\"0\",\"path_segment\":\"kuerriege-des-tsv-ladbergen-ueberzeugt-in-gievenbeck\",\"sitemap_priority\":\"0.5\",\"pid\":30,\"type\":\"0\",\"title\":\"K\\u00fcrriege des TSV Ladbergen \\u00fcberzeugt in Gievenbeck\",\"teaser\":\"Mit dem Hinrunden Wettkampf in M\\u00fcnster-Gievenbeck, starteten auch die Wettkampfklassen IV und V ( K\\u00fcrbereich ) am letzten Sonntag in die diesj\\u00e4hrige Bezirksliga.\",\"datetime\":1715928240,\"archive\":0,\"bodytext\":\"<p>In der Wettkampfklasse IV, gingen am Sonntag insgesamt 13 Mannschaften in zwei Durchg\\u00e4ngen in der Sporthalle des Freiherr vom Stein Gymnasium an den Start. Dabei war der Start am Boden durchaus gelungen, wobei hier viel ausprobiert wurde, was die M\\u00e4dels im Training erarbeitet hatten. Weiter ging es f\\u00fcr die TSV-Riege am Sprung. Hier gelang Hanna Busiek ein besonders sch\\u00f6n gestreckter \\u00dcberschlag. Am dritten Ger\\u00e4t, dem Reck, blieben die TSV Turnerinnen im Rahmen ihrer M\\u00f6glichkeiten, aber leider auch hinter der Konkurrenz zur\\u00fcck. Zum Abschluss, ging es dann noch an den Balken. Dabei blieb die komplette Mannschaft ohne Sturz und Lea-Marie Keller zeigte eine richtig gute P8-\\u00dcbung, die aber leider nicht mit vielen Punkten belohnt wurde! Mit insgesamt 172,50 Punkten, belegte die TSV Mannschaft mit Hanna Busiek, Laura Herta, Lea-Marie Keller, Marlene Salinga und Finnia Herta am Ende den 8.Platz und kassierte somit auch 6 Platzierungspunkte. Bei der R\\u00fcckrunde, die am 28.\\/29.September in Beckum ausgetragen wird, m\\u00f6chte sich die Riege noch den einen oder anderen Platz nach vorne arbeiten.<\\/p>\\r\\n<p>Einen \\u00fcberzeugenden Start in die diesj\\u00e4hrige Bezirksliga, legte am Sonntag die neu zusammengestellte K\\u00fcrriege des TSV in M\\u00fcnster-Gievenbeck hin. Auch hier, waren insgesamt 13 Mannschaften in zwei Durchg\\u00e4ngen am Start. Der Start der Mannschaft, erfolgte am Lieblingsger\\u00e4t dem Boden. Hier m\\u00f6chten immer alle M\\u00e4dels der Riege turnen, was die Nominierung f\\u00fcr die Trainerinnen immer sehr schwierig macht. Svea Behling sorgte hier f\\u00fcr einen top Start, als sie mit einer 13,50 Wertung die zweith\\u00f6chste Tageswertung erzielte. Zudem turnten alle TSV M\\u00e4dchen hier sehr ausdrucksstark. Am Sprung, agierten die TSV M\\u00e4dchen solide, wobei hier einige schwierigere Spr\\u00fcnge im Wettkampf ausprobiert wurden. Die Leistungen am Barren k\\u00f6nnen bis zur R\\u00fcckrunde noch verbessert werden. Hier war die Konkurrenz deutlich st\\u00e4rker. Am Zitterger\\u00e4t dem Balken lief es dann wie geschmiert. Keine Turnerin musste das Ger\\u00e4t verlassen. Lediglich einige \\u201eWackler\\u201c hatten sich in die \\u00dcbungen geschlichen. Besonders Sarah Maneke zeigte eine souver\\u00e4ne Leistung und wurde mit 12,40 Punkten belohnt. Dabei kamen nur die M\\u00e4dchen des Siegerteams zu h\\u00f6heren Wertungen. Mit insgesamt 143,60 Punkten, belegte die K\\u00fcrriege in der Endrunde am Ende einen guten 5.Platz und kassierte dabei 9 Platzierungspunkte ein. \\u201eBeide Riegen haben einen tollen Zusammenhalt und sind total motiviert f\\u00fcr die R\\u00fcckrunde noch etwas drauf zu packen\\u201c, so das TSV Trainerteam nach dem Wettkampf.<\\/p>\",\"categories\":\"0\",\"related\":\"0\",\"tags\":\"0\",\"author\":\"\",\"author_email\":\"\",\"keywords\":\"\",\"description\":\"\",\"alternative_title\":\"\",\"sitemap_changefreq\":\"\",\"sys_language_uid\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"notes\":\"\",\"crdate\":1730792716,\"t3ver_stage\":0,\"tstamp\":1730792716,\"uid\":1}', 0, '0400$4ea3f87e809f40783ad52663f5d32ad0:fccd16ea3664ec003726b2a72ea38f4b'),
