(435, 1731006294, 1, 'BE', 1, 0, 2, 'tx_news_domain_model_news', '{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"hidden\":\"0\",\"istopnews\":\"0\",\"editlock\":\"0\",\"path_segment\":\"tennis-ballschule-geht-in-die-dritte-runde\",\"sitemap_priority\":\"0.5\",\"pid\":30,\"type\":\"0\",\"title\":\"Tennis Ballschule geht in die dritte Runde! \",\"teaser\":\"\",\"datetime\":1731006265,\"archive\":0,\"bodytext\":\"<p>Schon im vergangenen Jahr konnten wir viele Kinder mit dem sportlichen Angebot der \\\"Tennis-Ballschule\\\" begeistern. Samstags von 09:30 Uhr bis 10:30 Uhr k\\u00f6nnen Kids von 5 bis 8 Jahren gemeinsam Sport machen, Tennis spielen und F\\u00e4higkeiten und Interessen austesten. Viele nehmen auch schon das dritte Mal infolge an der Aktion teil. Weitere Termine finden w\\u00f6chentlich bis zu den Osterferien in der Sporthalle Jahnstra\\u00dfe statt. Neuanmeldungen sind immer herzlich willkommen!<\\/p>\",\"categories\":\"0\",\"related\":\"0\",\"tags\":\"0\",\"author\":\"\",\"author_email\":\"\",\"keywords\":\"\",\"description\":\"\",\"alternative_title\":\"\",\"sitemap_changefreq\":\"\",\"sys_language_uid\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"notes\":\"\",\"crdate\":1731006294,\"t3ver_stage\":0,\"tstamp\":1731006294,\"uid\":2}', 0, '0400$3e272a5ac8183b26dc3fa3c6100e601a:640f28e5c1a5ec2efb19c26699b464a5'),
