(439, 1731006385, 1, 'BE', 1, 0, 3, 'tx_news_domain_model_news', '{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"hidden\":\"0\",\"istopnews\":\"0\",\"editlock\":\"0\",\"path_segment\":\"jahresauftakt-in-der-tsv-tennisabteilung\",\"sitemap_priority\":\"0.5\",\"pid\":30,\"type\":\"0\",\"title\":\"Jahresauftakt in der TSV Tennisabteilung\",\"teaser\":\"Fokus 2024 sind Jugendarbeit und ein bunter Eventkalender \",\"datetime\":1731006356,\"archive\":0,\"bodytext\":\"<p>Vergangenen Freitag fand die Jahreshauptversammlung der TSV Tennisabteilung statt. Neben dem Jahresr\\u00fcckblick 2023 und der Aussprache \\u00fcber die Kassenlage, standen vor allem die Jugendarbeit und die Angebote f\\u00fcr das aktuelle Jahr auf der Agenda.<\\/p>\\r\\n<p>Besonders erfreulich war die Aktion Ballschule im letzten Fr\\u00fchjahr und im Herbst, bei der Kinder ab f\\u00fcnf Jahren in den Tennissport schnuppern konnten. \\u201eNeben dem normalen Trainingsangebot wollen wir dauerhaftes Schnupper-Tennis f\\u00fcr Kinder erm\\u00f6glichen und sie so das gesamte Jahr mit einem Angebot begleiten\\u201c, erkl\\u00e4rt Rainer Jendroska, 1. Vorsitzender der Abteilung. \\u201eDie Ballschule findet auch aktuell wieder statt und soll langfristig in unser Vereinsprogramm aufgenommen werden\\u201c. Auch Aktionen wie das Oster-Camp und das Sommer-Camp sind wieder in Planung. Der 1. Vorsitzende spricht noch einen besonderen Dank an die Sponsoren wie die Kreissparkasse Steinfurt und die Familienstiftung Ladbergen aus, die durch ihre F\\u00f6rderung die Jugendarbeit in dieser Form erst erm\\u00f6glicht haben.<\\/p>\\r\\n<p>Neben der Jugendarbeit wird auch der Erwachsenen-Bereich mit einem breiten Angebot an vereinsinternen Turnieren und leistungsorientierten Liga-Mannschaften gef\\u00f6rdert. \\u201eSchon im letzten Jahr hatten wir eine gro\\u00dfe Beteiligung bei den Erwachsenen. Durch den Zuwachs aus dem Kattenvenner Verein haben wir jetzt viel mehr M\\u00f6glichkeiten, auch unterschiedliche Mannschaften nach Leistungen und Spielinteressen zu melden\\u201c, so Jens Tiemann, Sportwart der TA. \\u201eNeben der regul\\u00e4ren Damen 40 Mannschaft wird es erstmals eine reine Doppelmannschaft geben\\u201c.<\\/p>\\r\\n<p>Die Besetzung des Vorstandes blieb fast unver\\u00e4ndert. Nach \\u00fcber 10 Jahren Vereinsarbeit hat sich nur Katja Br\\u00fcnemeyer aus ihrer Position als Trainingskoordinatorin verabschiedet. Lina K\\u00f6tterheinrich wurde als Nachfolgerin gew\\u00e4hlt.<\\/p>\\r\\n<p>Der offizielle Startschuss f\\u00fcr die kommende Sommersaison ist wieder das traditionelle Familienosterfeuer am Ostersonntag. Hier sind alle Vereinsmitglieder, Familien und Freunde herzlich eingeladen. Sportlich geht es dann ab April los mit dem internen Mixed-Doppel-Turnier.<\\/p>\",\"categories\":\"0\",\"related\":\"0\",\"tags\":\"0\",\"author\":\"\",\"author_email\":\"\",\"keywords\":\"\",\"description\":\"\",\"alternative_title\":\"\",\"sitemap_changefreq\":\"\",\"sys_language_uid\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"notes\":\"\",\"crdate\":1731006385,\"t3ver_stage\":0,\"tstamp\":1731006385,\"uid\":3}', 0, '0400$51cdf0eae10f4d834ae27c4511f88d19:1152fda277b2623b0152b5765fcb6b28'),
(440, 1731006416, 2, 'BE', 1, 0, 3, 'tx_news_domain_model_news', '{\"oldRecord\":{\"datetime\":1731006356,\"l10n_diffsource\":\"\"},\"newRecord\":{\"datetime\":1720461900,\"l10n_diffsource\":\"{\\\"type\\\":\\\"\\\",\\\"istopnews\\\":\\\"\\\",\\\"title\\\":\\\"\\\",\\\"path_segment\\\":\\\"\\\",\\\"teaser\\\":\\\"\\\",\\\"datetime\\\":\\\"\\\",\\\"archive\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"content_elements\\\":\\\"\\\",\\\"fal_media\\\":\\\"\\\",\\\"fal_related_files\\\":\\\"\\\",\\\"categories\\\":\\\"\\\",\\\"related\\\":\\\"\\\",\\\"related_links\\\":\\\"\\\",\\\"tags\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"author_email\\\":\\\"\\\",\\\"keywords\\\":\\\"\\\",\\\"description\\\":\\\"\\\",\\\"alternative_title\\\":\\\"\\\",\\\"sitemap_changefreq\\\":\\\"\\\",\\\"sitemap_priority\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"editlock\\\":\\\"\\\",\\\"notes\\\":\\\"\\\"}\"}}', 0, '0400$564789ff5171e0a23a3aa23f018c9723:1152fda277b2623b0152b5765fcb6b28');
