(470, 1731054782, 2, 'BE', 1, 0, 12, 'tt_content', '{\"oldRecord\":{\"header\":\"Badminton\",\"bodytext\":\"<p>Badminton bietet der TSV ab Mitte 2021 an. Momentan besteht die Gruppe aus ca. 10 Frauen, M\\u00e4nnern und Jugendlichen, so dass Zuwachs durchaus gut w\\u00e4re. Es geht um reinen Hobbysport, Bewegung, Auspowern und wer mag ein gem\\u00fctliches Getr\\u00e4nk danach.<\\/p>\\r\\n<p>Es stehen vier Doppelfelder in der Jahnsporthalle zur Verf\\u00fcgung.&nbsp;<br \\/>Gespielt wird momentan mittwochs von 20 Uhr bis 21.30 Uhr.<\\/p>\\r\\n<p>Weitere Zeiten, z.B. am Wochenende k\\u00f6nnen individuell vergeben werden.<\\/p>\\r\\n<p>Reinschnuppern ohne Anmeldung oder Vereinsmitgliedschaft ist jederzeit m\\u00f6glich.<\\/p>\",\"l18n_diffsource\":\"\"},\"newRecord\":{\"header\":\"Bewegung, Auspowern und Hobbysport\",\"bodytext\":\"<p>Badminton bietet der TSV seit Mitte 2021 an. Momentan besteht die Gruppe aus ca. 10 Frauen, M\\u00e4nnern und Jugendlichen, so dass Zuwachs durchaus gut w\\u00e4re. Es geht um reinen Hobbysport, Bewegung, Auspowern und wer mag ein gem\\u00fctliches Getr\\u00e4nk danach.<\\/p>\\r\\n<p>Es stehen vier Doppelfelder in der Jahnsporthalle zur Verf\\u00fcgung.<br \\/>Gespielt wird momentan mittwochs von 20 Uhr bis 21.30 Uhr.<\\/p>\\r\\n<p>Weitere Zeiten, z.B. am Wochenende k\\u00f6nnen individuell vergeben werden.<\\/p>\\r\\n<p>Reinschnuppern ohne Anmeldung oder Vereinsmitgliedschaft ist jederzeit m\\u00f6glich.<\\/p>\",\"l18n_diffsource\":\"{\\\"CType\\\":\\\"\\\",\\\"colPos\\\":\\\"\\\",\\\"header\\\":\\\"\\\",\\\"header_layout\\\":\\\"\\\",\\\"header_position\\\":\\\"\\\",\\\"date\\\":\\\"\\\",\\\"header_link\\\":\\\"\\\",\\\"subheader\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"layout\\\":\\\"\\\",\\\"frame_class\\\":\\\"\\\",\\\"space_before_class\\\":\\\"\\\",\\\"space_after_class\\\":\\\"\\\",\\\"sectionIndex\\\":\\\"\\\",\\\"linkToTop\\\":\\\"\\\",\\\"categories\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"editlock\\\":\\\"\\\",\\\"rowDescription\\\":\\\"\\\"}\"}}', 0, '0400$71395b3bb3b3c122f46a4ef8d0181e46:b13bbccfb8e2fc277be02db62485ced6'),
(471, 1731072356, 1, 'BE', 1, 0, 44, 'tt_content', '{\"CType\":\"text\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"small\",\"colPos\":\"1\",\"date\":0,\"header_layout\":\"3\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"0\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":\"1\",\"hidden\":\"0\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"pid\":8,\"sorting\":128,\"header\":\"Herzlich willkommen im Handballbereich unseres Sportvereins!\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<p>Hier dreht sich alles um Teamgeist, Leidenschaft und den unerm\\u00fcdlichen Einsatz f\\u00fcr den Handballsport. Egal, ob du ein erfahrener Spieler, ein Neuling oder einfach nur ein begeisterter Fan bist \\u2013 bei uns findest du die perfekte Plattform, um deine F\\u00e4higkeiten zu entwickeln, neue Freundschaften zu schlie\\u00dfen und Teil einer lebendigen Gemeinschaft zu werden.<\\/p>\\r\\n<p>Unser engagiertes Trainerteam f\\u00f6rdert nicht nur die sportliche Leistung, sondern legt auch gro\\u00dfen Wert auf Fairness, Respekt und Spa\\u00df am Spiel. Von den J\\u00fcngsten in der Jugendabteilung bis hin zu unseren ambitionierten Erwachsenenmannschaften \\u2013 wir bieten f\\u00fcr jedes Alter und jedes Leistungsniveau die passende Trainingsm\\u00f6glichkeit.<\\/p>\\r\\n<p>Schau dich um, informiere dich \\u00fcber unsere Teams, Trainingszeiten und bevorstehenden Veranstaltungen. Wir freuen uns darauf, dich bald in der Halle willkommen zu hei\\u00dfen! Gemeinsam bringen wir den Handball zum Bl\\u00fchen!<\\/p>\",\"linkToTop\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1731072356,\"t3ver_stage\":0,\"tstamp\":1731072356,\"uid\":44}', 0, '0400$1a62509658bf2c34a11f323ba585ee3b:3b272544b7c1a9f5690a42a5b760dca9'),
(472, 1731072566, 2, 'BE', 1, 0, 25, 'tt_content', '{\"oldRecord\":{\"header\":\"Einleitung Turnen\",\"bodytext\":\"<p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet.<\\/p>\"},\"newRecord\":{\"header\":\"Herzlich willkommen im Turnbereich\",\"bodytext\":\"<p>Bei uns geht es um Spa\\u00df, Bewegung und die F\\u00f6rderung der motorischen F\\u00e4higkeiten unserer kleinen Turnerinnen und Turner im Alter von 4 bis 8 Jahren. In einer sicheren und freundlichen Umgebung bieten wir abwechslungsreiche Trainingsstunden an, die nicht nur die k\\u00f6rperliche Fitness st\\u00e4rken, sondern auch das Selbstbewusstsein und den Teamgeist f\\u00f6rdern. Unsere erfahrenen Trainerinnen und Trainer begleiten die Kinder spielerisch auf ihrem Weg, neue Bewegungsformen zu entdecken und ihre Talente zu entfalten. Ob beim Purzelbaum schlagen, Balancieren oder beim Erlernen von einfachen Turnelementen \\u2013 hier steht das gemeinsame Erlebnis im Vordergrund! Schaut euch um und lasst eure Kinder Teil unserer fr\\u00f6hlichen Turngemeinschaft werden!<\\/p>\"}}', 0, '0400$22662681ee099d36356c995faf7a019f:581bf77acde559fe457e0d401d2ada7b'),
