(474, 1731072605, 2, 'BE', 1, 0, 25, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p>Bei uns geht es um Spa\\u00df, Bewegung und die F\\u00f6rderung der motorischen F\\u00e4higkeiten unserer kleinen Turnerinnen und Turner im Alter von 4 bis 8 Jahren. In einer sicheren und freundlichen Umgebung bieten wir abwechslungsreiche Trainingsstunden an, die nicht nur die k\\u00f6rperliche Fitness st\\u00e4rken, sondern auch das Selbstbewusstsein und den Teamgeist f\\u00f6rdern. Unsere erfahrenen Trainerinnen und Trainer begleiten die Kinder spielerisch auf ihrem Weg, neue Bewegungsformen zu entdecken und ihre Talente zu entfalten. Ob beim Purzelbaum schlagen, Balancieren oder beim Erlernen von einfachen Turnelementen \\u2013 hier steht das gemeinsame Erlebnis im Vordergrund! Schaut euch um und lasst eure Kinder Teil unserer fr\\u00f6hlichen Turngemeinschaft werden!<\\/p>\"},\"newRecord\":{\"bodytext\":\"<p>Bei uns geht es um Spa\\u00df, Bewegung und die F\\u00f6rderung der motorischen F\\u00e4higkeiten unserer kleinen Turnerinnen und Turner im Alter von 4 bis 8 Jahren.&nbsp;<\\/p>\\r\\n<p>In einer sicheren und freundlichen Umgebung bieten wir abwechslungsreiche Trainingsstunden an, die nicht nur die k\\u00f6rperliche Fitness st\\u00e4rken, sondern auch das Selbstbewusstsein und den Teamgeist f\\u00f6rdern.&nbsp;<\\/p>\\r\\n<p>Unsere erfahrenen Trainerinnen und Trainer begleiten die Kinder spielerisch auf ihrem Weg, neue Bewegungsformen zu entdecken und ihre Talente zu entfalten. Ob beim Purzelbaum schlagen, Balancieren oder beim Erlernen von einfachen Turnelementen \\u2013 hier steht das gemeinsame Erlebnis im Vordergrund! Schaut euch um und lasst eure Kinder Teil unserer fr\\u00f6hlichen Turngemeinschaft werden!<\\/p>\"}}', 0, '0400$23533d011a395420abe58adebaf75b8c:581bf77acde559fe457e0d401d2ada7b'),
