(511, 1732554543, 1, 'BE', 1, 0, 4, 'tx_news_domain_model_news', '{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"hidden\":\"0\",\"istopnews\":\"0\",\"editlock\":\"0\",\"path_segment\":\"tsv-turnerinnen-verteidigen-podiumsplaetze\",\"sitemap_priority\":\"0.5\",\"pid\":30,\"type\":\"0\",\"title\":\"TSV-Turnerinnen verteidigen Podiumspl\\u00e4tze\",\"teaser\":\"Kurz nach den Sommerferien stand mit der R\\u00fcckrunde in den Wettkampfklassen 1 und 2 f\\u00fcr die Turnerinnen des TSV Ladbergen schon der erste Wettkampf an. Dabei galt es in Ibbenb\\u00fcren die in der Hinrunde erreichten zweiten Pl\\u00e4tze zu verteidigen. Zur gro\\u00dfen Freude der mitgereisten Fans gelang es beiden Mannschaften einen Platz auf dem Treppchen zu erreichen!\",\"datetime\":1732554499,\"archive\":0,\"bodytext\":\"<p>In der Wettkampfklasse 1 (Jahrgang 2015 und j\\u00fcnger) ging die Mannschaft mit Clara Haase, Greta Austermann, Ella Kolzow, Hannah Kimmina, Maya Labban und Zoe Lautenschl\\u00e4ger in bew\\u00e4hrter Besetzung an den Start. Die M\\u00e4dchen zeigten an ihrem Startger\\u00e4t Sprung (55,0 Punkte), am Reck (56,1) sowie am Schlussger\\u00e4t Boden (55,3) gute Leistungen und konnten ihre Trainingsleistungen abrufen. Herausragend war die Leistung von Zoe Lautenschl\\u00e4ger am Reck. Ihr gelang eine perfekte \\u00dcbung, die zurecht mit der vollen Punktzahl (15,0 Punkte) belohnt wurde \\u2013 mehr ist in dieser Wettkampfklasse nicht m\\u00f6glich! Am Schwebebalken lief es f\\u00fcr die TSV-Turnerinnen jedoch nicht wie gew\\u00fcnscht. Mehrere ungeplante Abg\\u00e4nge f\\u00fchrten zu niedrigen Wertungen (52,1) und lie\\u00dfen die Spannung vor der Siegerehrung noch einmal steigen. In der Gesamtwertung der Hin- und R\\u00fcckrunde lagen schlie\\u00dflich die Mannschaften aus Ladbergen und aus Nienberge mit jeweils 19 Platzpunkten gleichauf, sodass die erturnten Punkte den Ausschlag \\u00fcber Platz 2 und 3 geben mussten. Hier landeten die TSV-Turnerinnen mit 438,3 Punkten mit einem hauchd\\u00fcnnen R\\u00fcckstand von 0,15 Punkten auf dem Bronzerang. Ein toller Erfolg in einem sehr starken Teilnehmerfeld von 14 Mannschaften.<\\/p>\\r\\n<p>Die Mannschaft in der Wettkampfklasse 2 (Jahrgang 2013 und j\\u00fcnger) musste verletzungsbedingt auf Melina Herte verzichten, wurde jedoch durch die Nachwuchsturnerin Alysha Ates verst\\u00e4rkt. So ging es f\\u00fcr Klara Vietmeier, Lena Kn\\u00fcfer, Arina Matyusha und Lucy Berghaus ebenfalls darum, die Leistungen aus der Hinrunde zu best\\u00e4tigen. Die Turnerinnen starteten mit guten Leistungen am Sprung in den Wettkampf (58,5 Punkt). Nach einem schwachen Einturnen am Reck gelang jedoch allen M\\u00e4dchen im Wettkampf sehr gute und fl\\u00fcssige \\u00dcbungen (60,95). Lena Kn\\u00fcfer gelang hier mit 15,85 Punkten gar die Tagesh\\u00f6chstwertung in dieser Wettkampfklasse. Am Schwebebalken (57,5) zeigten die TSV-Turnerinnen dann ungewohnte Nerven und leisteten sich einige Patzer, die nur zu Rang 8 in der Ger\\u00e4tewertung f\\u00fchrten. Die verlorenen Punkte galt es nun am Abschlussger\\u00e4t Boden wieder gutzumachen. Mit stark verbesserten \\u00dcbungen im Vergleich zur Hinrunde und einer konzentrierten Leistung erreichte die Mannschaft hier starke 61,4 Punkte. Bei der Siegerehrung kam es zur gleichen Situation wie schon im Wettkampf 1: Die Mannschaften aus Ladbergen und aus Warendorf hatten nach Hin- und R\\u00fcckrunde jeweils 19 Platzpunkte erreicht. Doch dieses Mal hatten die TSV Turnerinnen die Nase vorn. Mit 472,05 Punkten und 1,55 Punkten Vorsprung konnten sie sich den zweiten Platz unter 12 Mannschaften sichern und verdient die Silbermedaille entgegennehmen.<\\/p>\\r\\n<p>Das Trainerteam zeigte sich mit den gezeigten Leistungen und den erreichten Top-Platzierungen mehr als zufrieden. Dass beide Mannschaften einen Treppchenrang erreichen, war vor der Saison nicht absehbar und ist eine Best\\u00e4tigung f\\u00fcr den gro\\u00dfen Einsatz beim Training. Zum Abschluss der Ligasaison steht nun Ende September noch die R\\u00fcckrunde f\\u00fcr die Mannschaften in den Wettkampfklassen 4 und 5 an.<\\/p>\\r\\n\\r\\n\\r\\n<p>Foto:<\\/p>\\r\\n<p>Hintere Reihe (v.l.): Clara Haase, Hannah Kimmina, Maya Labban, Zoe Lautenschl\\u00e4ger, Greta Austermann, Ella Kolzow<\\/p>\\r\\n<p>Vordere Reihe (v.l.): Lucy Berghaus, Arina Matyusha, Alysha Ates, Melina Herte, Lena Kn\\u00fcfer, Klara Vietmeier<\\/p>\",\"categories\":\"0\",\"related\":\"0\",\"tags\":\"0\",\"author\":\"\",\"author_email\":\"\",\"keywords\":\"\",\"description\":\"\",\"alternative_title\":\"\",\"sitemap_changefreq\":\"\",\"sys_language_uid\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"notes\":\"\",\"crdate\":1732554543,\"t3ver_stage\":0,\"tstamp\":1732554543,\"uid\":4}', 0, '0400$a1059cfefa8917958ae630150c1ae04e:f3f39c24ca39d00c02ecd29ec2ad4225'),
(512, 1732554552, 2, 'BE', 1, 0, 4, 'tx_news_domain_model_news', '{\"oldRecord\":{\"categories\":\"\",\"l10n_diffsource\":\"\"},\"newRecord\":{\"categories\":\"2\",\"l10n_diffsource\":\"{\\\"type\\\":\\\"\\\",\\\"istopnews\\\":\\\"\\\",\\\"title\\\":\\\"\\\",\\\"path_segment\\\":\\\"\\\",\\\"teaser\\\":\\\"\\\",\\\"datetime\\\":\\\"\\\",\\\"archive\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"content_elements\\\":\\\"\\\",\\\"fal_media\\\":\\\"\\\",\\\"fal_related_files\\\":\\\"\\\",\\\"categories\\\":\\\"\\\",\\\"related\\\":\\\"\\\",\\\"related_links\\\":\\\"\\\",\\\"tags\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"author_email\\\":\\\"\\\",\\\"keywords\\\":\\\"\\\",\\\"description\\\":\\\"\\\",\\\"alternative_title\\\":\\\"\\\",\\\"sitemap_changefreq\\\":\\\"\\\",\\\"sitemap_priority\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"editlock\\\":\\\"\\\",\\\"notes\\\":\\\"\\\"}\"}}', 0, '0400$0b8093b8007e593a46379d3cb4528bfd:f3f39c24ca39d00c02ecd29ec2ad4225'),
