(521, 1732555536, 1, 'BE', 1, 0, 5, 'tx_news_domain_model_news', '{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"hidden\":\"0\",\"istopnews\":\"0\",\"editlock\":\"0\",\"path_segment\":\"tsv-turnerinnen-liefern-in-beckum-ab\",\"sitemap_priority\":\"0.5\",\"pid\":30,\"type\":\"0\",\"title\":\"TSV Turnerinnen liefern in Beckum ab\",\"teaser\":\"Am vorletzten Wochenende fand die R\\u00fcckrunde zur Bezirksliga f\\u00fcr die \\u00e4lteren Turnerinnen statt.\",\"datetime\":1732555324,\"archive\":0,\"bodytext\":\"<p>Am Samstag waren f\\u00fcr den TSV Ladbergen Laura Herter, Hanna Busiek und Marlene Salinga im Einsatz, unterst\\u00fctzt wurden sie von der Nachwuchturnering Lena Kn\\u00fcfer. Ersatzgeschw\\u00e4cht reisten die M\\u00e4dels nach Beckum an. Die Ausgangslage aus der Hinunde - Platz 8 von 13 - schien nicht wiederholbar zu sein. Aber nach dem Motto \\\"Es gibt nix zu verlieren\\\" &nbsp;waren die Turnerinnen motiviert und hatten im Training an einigen Ger\\u00e4ten h\\u00f6here P-Stufen trainiert. Los ging es dann am Sprung. Hier konnte Hanna einen sch\\u00f6nen Hanstand\\u00fcberschlag zeigen und bekam daf\\u00fcr 14,65 Punkte. Damit konnte man gut zufrieden sein und die Riege wechselte zum Barren. Hier zeigten alle vier Turnerinnen sauber durchgeturnte P6-\\u00dcbungen. F\\u00fcr den Balken hatte sich Laura sogar eine P8 vorgenommen und konnte diese sehr schwierige \\u00dcbung ohne Sturz durchturnen. Zudem haben Hanna und Lena zum ersten Mal im Wettkampf ein Rad auf dem Balken geturnt! Dieser Erfahrung wird ihnen bei den n\\u00e4chsten Wettk\\u00e4mpfen mehr Selbstvertrauen geben. Auch am Boden hatten Lena und Laura schon die P8 trainiert und haben diese auch den Kampfrichterinnen pr\\u00e4sentiert! Der Wettkampf war durchgeturnt und die Turnerinnen konnten voll und ganz mit sich &nbsp;zufrieden sein! Nun kam das Warten auf die Ergebnisbekanntgabe.....Trotz der sehr engen Personalsituation hatten die M\\u00e4dels in der R\\u00fcckrunde den 9. Platz belegt und im Gesamtergebnis konnten der 8. Platz gehalten werden. Die Trainerinnen waren mit dem Einsatz der jungen Damen und dem Ergebnis sehr zufrieden.<\\/p>\\r\\n<p>Am Sonntag war dann die K\\u00fcr-Riege im Einsatz. Auch hier waren statt der geplanten 6 Turnerinnen nur noch 4 im Beckum am Start. Einserseits nahm das den Traninerinnen die Entscheidung ab, wer an welchen Ger\\u00e4t turnen sollte (denn pro Ger\\u00e4t d\\u00fcrfen immer nur 4 Starterinnen turnen). Allerdings w\\u00e4re es f\\u00fcr das Abschneiden schon gut gewesen, wenn man Alternativen im Gep\\u00e4ck gehabt h\\u00e4tte. Denn die vergangenen Wettk\\u00e4mpfe hatten gezeigt, dass h\\u00e4ufig noch in Verlauf des Wettkampfes die Ger\\u00e4teverteilung ge\\u00e4ndert werden musste. Im Hinkampf hatte die Riege den 5. Platz in einem 12er Teilnehmerfeld belegt. Da es bei der Bezirksliga nur darum geht den 1. oder 2. Platz zu belegen, um sich f\\u00fcr die Relegation zur M\\u00fcnsterlandliga zu qualifizieren, hatten Enie Schlichter, Sarah Maneke, Daria Eberhardt und Svea Behling keinen zu gro\\u00dfen Druck. Am ersten Ger\\u00e4t - dem Zitterbalken - lief es noch nicht ganz rund und die Riege musste 2 St\\u00fcrze verbuchen, dennnoch gelang Daria eine sch\\u00f6ne \\u00dcbung, die mit 11,5 Punkten belohnt wurde. Das gibt Daria die n\\u00f6tige Sicherheit, um beim n\\u00e4chsten Wettkampf etwas \\u00fcberzeugter zu turnen. Den Boden m\\u00f6gen unsere M\\u00e4dels besonders gerne und das konnten die Kampfrichterinnen auch sehen. Hier schafften die Turnerinnen den Tagesh\\u00f6chstwert aller Riegen! Besonders Svea Behling zeigte eine schwere \\u00dcbung, die mit der Top-Wertung des Tages beohnt wurde - 13,2 Punkte -. Anschlie\\u00dfend ging es an den Sprung, der nur m\\u00e4\\u00dfig erfolgreich war. Am letzten Ger\\u00e4t, dem Barren, hatten die Turnerinnen des TSV in den vergangenen Wettk\\u00e4mpfen immer ihr Probleme, aber das war in Beckum ganz anders. Der Trainingseinsatz hatte sich gelohnt! Alle vier TSVerinnen schafften alle Teile und turnten fl\\u00fcssig durch! Bei der Bekanntgabe der Ergebnisse war die Freude dann gro\\u00df, denn man hatte &nbsp;sich ohne gro\\u00dfe Erwartungen einen Platz nach vorne geschoben auf Platz 4! Auch in der Gesamtwerturn nach Hin- und R\\u00fcckrunde schafften die Turnerinnen des TSV es auf den 4. Platz.<\\/p>\\r\\n<p>Als n\\u00e4chsetes stehen die Bezirks-Einzelmeisterschaften am Samstag, 09.11. auf dem Programm.<\\/p>\",\"categories\":\"1\",\"related\":\"0\",\"tags\":\"0\",\"author\":\"\",\"author_email\":\"\",\"keywords\":\"\",\"description\":\"\",\"alternative_title\":\"\",\"sitemap_changefreq\":\"\",\"sys_language_uid\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"notes\":\"\",\"crdate\":1732555536,\"t3ver_stage\":0,\"tstamp\":1732555536,\"uid\":5}', 0, '0400$813c185fa9d8180f8160ad21e8fdf4bc:bc83755a03cca2ca5c8daa03e9d6e32e'),
