(555, 1733205968, 2, 'BE', 1, 0, 46, 'sys_file_reference', '{\"oldRecord\":{\"description\":null,\"crop\":\"{\\\"default\\\":{\\\"cropArea\\\":{\\\"height\\\":0.5863267670915412,\\\"width\\\":0.9988888888888889,\\\"x\\\":0,\\\"y\\\":0.13789107763615296},\\\"selectedRatio\\\":\\\"Quer\\\",\\\"focusArea\\\":null},\\\"header\\\":{\\\"cropArea\\\":{\\\"x\\\":0,\\\"y\\\":0.2066917728852839,\\\"width\\\":1,\\\"height\\\":0.5866164542294322},\\\"selectedRatio\\\":\\\"16:9\\\",\\\"focusArea\\\":null},\\\"menu\\\":{\\\"cropArea\\\":{\\\"x\\\":0.020555555555555556,\\\"y\\\":0,\\\"width\\\":0.9588888888888889,\\\"height\\\":1},\\\"selectedRatio\\\":\\\"1:1\\\",\\\"focusArea\\\":null}}\",\"l10n_diffsource\":\"{\\\"hidden\\\":\\\"\\\"}\"},\"newRecord\":{\"description\":\"Nachmittags standen dann noch die K\\u00fcr-Wettk\\u00e4mpfe auf dem Programm. Bei den j\\u00fcngeren Turnerinnen Altersklasse 14 und j\\u00fcnger startete Daria Eberhardt. Enie Schlichter und Svea Behling mussten sich mit den \\u00e4lteren Turnerinnen messen. Als erstes Ger\\u00e4t stand hier der Boden auf dem Programm. Am Boden turnen die M\\u00e4dels immer sehr gerne, hat man doch hier seine eigene Musik, die man mit einer ganz pers\\u00f6nlichen Choreographie gestaltet hat. Alle drei zeigten viele h\\u00f6herklassige Teile, f\\u00fcr die man einen Punktebonus erh\\u00e4lt. So konnte man top motviert zum Sprung wechseln. Enie und Daria zeigten hier solide Handstand\\u00fcberschl\\u00e4ge, Svea versuchte sich an einem Yamshita, der aber punkte m\\u00e4\\u00dfig nicht belohnt wurde. Weiter ging es zum Barren. Daria startete und zog ihre \\u00dcbung ohne Pause und Zwischenschwund durch. Auch bei Enie lief es wie geschmiert und sie gab den Kampfrichterinnen nur wenige M\\u00f6glichkeiten ein paar P\\u00fcnktchen abzuziehen. Beide wurden mit gerechten Wertungen belohnt. Lediglich Svea musste hier einen Sturz hinnehmen. Am letzten Wettkampfger\\u00e4t dem Schwebebalken musste auch Daria leider unfreiwillig vom Ger\\u00e4t absteigen. Enie hingegen hatte einen richtigen Lauf und zeigte keine Schw\\u00e4che. Leider kam auch Svea am Schwebebalken nicht ohne Sturz durch. F\\u00fcr die Siegerehrung hatten wir uns eigentlich gar nicht viel ausgerechnet, doch wir wurden positiv \\u00fcberrascht. Daria belegte in ihrer Wettkampfklasse den 3. Platz! Das ist umso bemerkenswerter, da es ihr erster Einzelwettkampf im K\\u00fcrbereich war. Aber auch Enie konnte ihren nahezu perfekten Wettkampf mit dem 3. Platz belohnen. Ein sehr sch\\u00f6ner Erfolg. Svea platzierte sich am Ende auf Platz 5.\",\"crop\":\"{\\\"default\\\":{\\\"cropArea\\\":{\\\"x\\\":0,\\\"y\\\":0.13807213209733493,\\\"width\\\":0.9988888888888889,\\\"height\\\":0.5859646581691773},\\\"selectedRatio\\\":\\\"Quer\\\",\\\"focusArea\\\":null},\\\"header\\\":{\\\"cropArea\\\":{\\\"x\\\":0,\\\"y\\\":0.2066917728852839,\\\"width\\\":1,\\\"height\\\":0.5866164542294322},\\\"selectedRatio\\\":\\\"16:9\\\",\\\"focusArea\\\":null},\\\"menu\\\":{\\\"cropArea\\\":{\\\"x\\\":0.020555555555555556,\\\"y\\\":0,\\\"width\\\":0.9588888888888889,\\\"height\\\":1},\\\"selectedRatio\\\":\\\"1:1\\\",\\\"focusArea\\\":null}}\",\"l10n_diffsource\":\"{\\\"showinpreview\\\":\\\"\\\",\\\"alternative\\\":\\\"\\\",\\\"description\\\":\\\"\\\",\\\"link\\\":\\\"\\\",\\\"title\\\":\\\"\\\",\\\"crop\\\":\\\"\\\",\\\"uid_local\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\"}\"}}', 0, '0400$cf4ab4cda071a60a0032a8c345d0f763:a82fe300f8818691e26d3b3c2d4b5fa0'),
(556, 1733206100, 2, 'BE', 1, 0, 6, 'tx_news_domain_model_news', '{\"oldRecord\":{\"bodytext\":\"\\r\\n\\r\\n<p>Das war ein super erfolgreicher Wettkampftag f\\u00fcr die Turnerinnen aus Ladbergen. Die 16 Starterinnen konnten insgesamt einen Pokal f\\u00fcr die Bezirksmeisterin und 5 Bronzemedaillen mit nach Hause nehmen. &nbsp;<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\"},\"newRecord\":{\"bodytext\":\"<p>Das war ein super erfolgreicher Wettkampftag f\\u00fcr die Turnerinnen aus Ladbergen. Die 16 Starterinnen konnten insgesamt einen Pokal f\\u00fcr die Bezirksmeisterin und 5 Bronzemedaillen mit nach Hause nehmen. &nbsp;<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\"}}', 0, '0400$32a7d35e586594a2f0805ab3af754537:7e4fc5d3ec5edd1f76b0a3820eb3fb47'),
(557, 1733206100, 2, 'BE', 1, 0, 45, 'sys_file_reference', '{\"oldRecord\":{\"l10n_diffsource\":\"{\\\"showinpreview\\\":\\\"\\\",\\\"alternative\\\":\\\"\\\",\\\"description\\\":\\\"\\\",\\\"link\\\":\\\"\\\",\\\"title\\\":\\\"\\\",\\\"crop\\\":\\\"\\\",\\\"uid_local\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\"}\"},\"newRecord\":{\"l10n_diffsource\":\"{\\\"hidden\\\":\\\"\\\"}\"}}', 0, '0400$32a7d35e586594a2f0805ab3af754537:f59c54abe9804a9ad756ea862d4d98dd'),
(558, 1733206357, 2, 'BE', 1, 0, 45, 'sys_file_reference', '{\"oldRecord\":{\"description\":\"Los ging es morgens mit dem Wettkampf der 10-j\\u00e4hrigen M\\u00e4dchen. Hier hatte der TSV gleich 3 Starterinnen gemeldet. Geturnt wurden die \\u00dcbungen der P6 und P7! Los ging es am Boden. Hier waren die Ladbergerinnen die ersten Turnerinnen, die von den Kampfrichterinnen gewertet wurden! Sowohl Lucy Berghaus, Arina Matyusha als auch Lena Kn\\u00fcfer zeigten sehr sauber ausgeturnte \\u00dcbungen! Somit war der Wettkampfstart gelungen! Danach ging es an den Sprungtisch. Hier konnte besonders Lena mit einem top \\u00dcberschlag strahlen und auf dem Wertungszettel standen am Ende 16,2 Punkte.  Auch am Barren zeigten die M\\u00e4dels keine Schw\\u00e4che und turnten die \\u00dcbungen fl\\u00fcssig durch. Als letztes Ger\\u00e4t stand dann noch der Schwebebalken auf dem Programm. Alle drei kamen ohne Sturz durch ihre \\u00dcbung und so konnte man der Siegerehrung gelassen entgegensehen. Das Ergebnis war \\u00fcberragend! So konnte Lena mit insgesamt 60,80 erturnten Punkten ihren Bezirksmeisterinnen-Titel vom letzten Jahr verteidigen! Der jubel der mitgereisten Eltern war riesig! Aber auch Lucy erreichte ihre erste Brozemedaille als Einzelstarterin. Und auch Arina erreichte den 5 Platz von insgesamt 25 Turnerinnen. Ein wirklich toller Wettkampf von allen!\\u00a0\\r\\nEbenfalls im ersten Durchgang starteten in der Altersklasse 13 Jahre und \\u00e4lter Hanna Busiek und Laura Herter. Auch dieser Wettkampf begann am Boden. Hier zeigten beide Turnerinnen alles, was sie in den letzten Trainingseinheiten ge\\u00fcbt hatten. Weiter ging es dann am Sprung! Beide M\\u00e4dels zeigten sch\\u00f6ne \\u00dcberschl\\u00e4ge, die mit guten Punkten belohnt wurden. Am Barren konnte besonders Hanna punkten. F\\u00fcr ihre \\u00dcbung ohne Zwischenschwung wurde sie mit 14,80 Punkten belohnt. Bis hierher lief alles noch nach Plan, aber dann kam der Zitterbalken und machte seinem Namen alle Ehre. Leider mussten Laura, als auch Hanna ungewollt absteigen. Dennoch k\\u00f6nnen beide Stolz auf ihre Leistung sein, denn \\\"wer nicht wagt, der nicht gewinnt\\\". Am Ende platzierte sich Laura auf Platz 13 und Hanna auf Platz 16 von insgesamt 23 Turnerinnen.\\r\\n\\r\\nF\\u00fcr den zweiten Durchgang reisten dann die n\\u00e4chsten Turnerinnen an. Die Wettkampfklasse der 8 -j\\u00e4hrigen  war mit 23 Teilnehmerinnen stark besetzt. Unser Trio Greta Austermann, Clara Haase, Alysha Ates startete am Schwebebalken. Alle M\\u00e4dels hatten sich die P6 vorgenommen und alles schafften die \\u00dcbung ohne Sturz. Am Boden lief alles rund. Auch die Streckspr\\u00fcnge mit einer ganzen Drehung klappten. Danach ging es zum Sprung. Am Mattenberg musste ein \\u00dcberschlag in die R\\u00fcckenlage gezeigt werden. Hier belohnten die Kampfrichterinnen die Spr\\u00fcnge mit guten Wertungsnoten. Am Ende stand noch das Reck auf dem Programm. Hier zeigte Alysha eine sch\\u00f6ne P6 und erhielt daf\\u00fcr 14,4 Punkte. Clara schaffte zum ersten mal im Wettkampf eine Felge am Reck und erhielt daf\\u00fcr 13,9 Punkte. Aber auch Greta erhielt f\\u00fcr ihre P5 die gleiche Punktzahl (13,9) und daran kann man erkennen, dass viele Wege zum gleichen Ziel f\\u00fchren! Bei der Siegerehrung wurde dann Greta und Clara mit der exakt gleichen Punktzahl f\\u00fcr den 10 Platz ausgezeichnet. Alysha belegte den guten 13. Platz!\\r\\nDer Wettkampf der 9-j\\u00e4hrigen M\\u00e4dchen begann ebenfalls am Schwebebalken. Hier traten f\\u00fcr den TSV Ella Kolzow, Zoe Lautenschl\\u00e4ger, Maya Labban und Hannah Kimmina an. Auf dem Wettkampfprogramm standen die \\u00dcbungen im Schwierigkeitsgrad P5 und \\/ oder P6. Den Wettkampf am Schwebebalken zu beginnen ist immer etwas schwierig, denn wenn die Nervosit\\u00e4t noch in den Beinen steckt, ist es besonders schwierig immer in der Balance zu bleiben. Aber die TSVerinnen profitierten hier von ihrer Wettkampferfahrung und konnten ohne Absteiger bleiben. Anschlie\\u00dfend ging es an den Boden, den die M\\u00e4dchen immer gerne turnen. Es wurden alle \\u00dcbungen sauber druchgeturnt und somit konnten gute Punkte einkassiert werden. Am Sprung hatten sich Zoe und Maya ihre ersten \\u00dcberschl\\u00e4ge \\u00fcber den Sprungtisch vorgenommen. Zoe konnte sich hier die h\\u00f6chste Wertung in ihrer Konkurrenz sichern (14,25 Punkte). Aber auch Maya nimmt ganz wichtige Erfahrungen mit nach Hause. Abschlie\\u00dfend wartete noch das Reck. Hanna, Ella und Maya turnten ihre \\u00dcbungen sauber durch, doch Zoe hatte direkt zu Beginn der \\u00dcbung einen kleinen Wackler in der \\u00dcbung, der sie so aus dem Konzept brachte, dass sie die sonst so sichere Felge nicht schaffte.  Bei der Siegerehrung wurden insgesamt 33 Turnerinnen ausgezeichnet. Ella belegte in einer sehr starken Konkurrenz Platz 22, Hannah konnte sich Platz 14 sichern und Maya erturnte sich Platz 13. F\\u00fcr die \\u00dcberraschung sorgte Zoe. Sie durfte mit insgesamt 58,25 auf das Treppchen f\\u00fcr den 3. Platz steigen. Das ist bei so einer gro\\u00dfen Teilnehmerzahl ein phantastisches Ergebnis!\\r\\nIn der Wettkampfklasse der 11-j\\u00e4hrigen M\\u00e4dchen hatte der TSV nur eine Starterin gemeldet. Klara Vietmeier begann ihren Wettkampf ebenfalls am Schwebebalken und turnte ihre P7 super-sauber durch. Zur Belohnung erhielt sie daf\\u00fcr 15,0 Punkte. Das war in ihrer Altersklasse die h\\u00f6chste Punktzahl! Weiter ging es am Boden. Hier wurde die \\u00dcbung von Klara recht streng bewertet, aber das schm\\u00e4lerte die Motivation \\u00fcberhaupt nicht. Anschlie\\u00dfend ging es zum Sprung und abschlie\\u00dfend noch zum Barren. Eine fl\\u00fcssig durchgeturnte \\u00dcbung brachte noch gute Punkte ein. Am Ende gelang es auch Klara einen der begehrten Treppchenpl\\u00e4tze zu belegen. Mit 58,3 Punkte wurde sie mit der Bronzemedaille pr\\u00e4miert! Ein ganz toller Erfolg f\\u00fcr die Turnabteilung des TSV!\",\"l10n_diffsource\":\"{\\\"hidden\\\":\\\"\\\"}\"},\"newRecord\":{\"description\":\"Los ging es morgens mit dem Wettkampf der 10-j\\u00e4hrigen M\\u00e4dchen. Hier hatte der TSV gleich 3 Starterinnen gemeldet. Geturnt wurden die \\u00dcbungen der P6 und P7! Los ging es am Boden. Hier waren die Ladbergerinnen die ersten Turnerinnen, die von den Kampfrichterinnen gewertet wurden! Sowohl Lucy Berghaus, Arina Matyusha als auch Lena Kn\\u00fcfer zeigten sehr sauber ausgeturnte \\u00dcbungen! Somit war der Wettkampfstart gelungen! Danach ging es an den Sprungtisch. Hier konnte besonders Lena mit einem top \\u00dcberschlag strahlen und auf dem Wertungszettel standen am Ende 16,2 Punkte.  Auch am Barren zeigten die M\\u00e4dels keine Schw\\u00e4che und turnten die \\u00dcbungen fl\\u00fcssig durch. Als letztes Ger\\u00e4t stand dann noch der Schwebebalken auf dem Programm. Alle drei kamen ohne Sturz durch ihre \\u00dcbung und so konnte man der Siegerehrung gelassen entgegensehen. Das Ergebnis war \\u00fcberragend! So konnte Lena mit insgesamt 60,80 erturnten Punkten ihren Bezirksmeisterinnen-Titel vom letzten Jahr verteidigen! Der jubel der mitgereisten Eltern war riesig! Aber auch Lucy erreichte ihre erste Brozemedaille als Einzelstarterin. Und auch Arina erreichte den 5 Platz von insgesamt 25 Turnerinnen. Ein wirklich toller Wettkampf von allen!\\u00a0\\r\\n\\r\\nEbenfalls im ersten Durchgang starteten in der Altersklasse 13 Jahre und \\u00e4lter Hanna Busiek und Laura Herter. Auch dieser Wettkampf begann am Boden. Hier zeigten beide Turnerinnen alles, was sie in den letzten Trainingseinheiten ge\\u00fcbt hatten. Weiter ging es dann am Sprung! Beide M\\u00e4dels zeigten sch\\u00f6ne \\u00dcberschl\\u00e4ge, die mit guten Punkten belohnt wurden. Am Barren konnte besonders Hanna punkten. F\\u00fcr ihre \\u00dcbung ohne Zwischenschwung wurde sie mit 14,80 Punkten belohnt. Bis hierher lief alles noch nach Plan, aber dann kam der Zitterbalken und machte seinem Namen alle Ehre. Leider mussten Laura, als auch Hanna ungewollt absteigen. Dennoch k\\u00f6nnen beide Stolz auf ihre Leistung sein, denn \\\"wer nicht wagt, der nicht gewinnt\\\". Am Ende platzierte sich Laura auf Platz 13 und Hanna auf Platz 16 von insgesamt 23 Turnerinnen.\\r\\n\\r\\nF\\u00fcr den zweiten Durchgang reisten dann die n\\u00e4chsten Turnerinnen an. Die Wettkampfklasse der 8 -j\\u00e4hrigen  war mit 23 Teilnehmerinnen stark besetzt. Unser Trio Greta Austermann, Clara Haase, Alysha Ates startete am Schwebebalken. Alle M\\u00e4dels hatten sich die P6 vorgenommen und alles schafften die \\u00dcbung ohne Sturz. Am Boden lief alles rund. Auch die Streckspr\\u00fcnge mit einer ganzen Drehung klappten. Danach ging es zum Sprung. Am Mattenberg musste ein \\u00dcberschlag in die R\\u00fcckenlage gezeigt werden. Hier belohnten die Kampfrichterinnen die Spr\\u00fcnge mit guten Wertungsnoten. Am Ende stand noch das Reck auf dem Programm. Hier zeigte Alysha eine sch\\u00f6ne P6 und erhielt daf\\u00fcr 14,4 Punkte. Clara schaffte zum ersten mal im Wettkampf eine Felge am Reck und erhielt daf\\u00fcr 13,9 Punkte. Aber auch Greta erhielt f\\u00fcr ihre P5 die gleiche Punktzahl (13,9) und daran kann man erkennen, dass viele Wege zum gleichen Ziel f\\u00fchren! Bei der Siegerehrung wurde dann Greta und Clara mit der exakt gleichen Punktzahl f\\u00fcr den 10 Platz ausgezeichnet. Alysha belegte den guten 13. Platz!\\r\\nDer Wettkampf der 9-j\\u00e4hrigen M\\u00e4dchen begann ebenfalls am Schwebebalken. Hier traten f\\u00fcr den TSV Ella Kolzow, Zoe Lautenschl\\u00e4ger, Maya Labban und Hannah Kimmina an. Auf dem Wettkampfprogramm standen die \\u00dcbungen im Schwierigkeitsgrad P5 und \\/ oder P6. Den Wettkampf am Schwebebalken zu beginnen ist immer etwas schwierig, denn wenn die Nervosit\\u00e4t noch in den Beinen steckt, ist es besonders schwierig immer in der Balance zu bleiben. Aber die TSVerinnen profitierten hier von ihrer Wettkampferfahrung und konnten ohne Absteiger bleiben. Anschlie\\u00dfend ging es an den Boden, de