(571, 1733825608, 2, 'BE', 1, 0, 1, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p>Wir bieten wir eine breite Palette an Aktivit\\u00e4ten f\\u00fcr Jung und Alt. Unsere engagierten Trainer und einladenden Gemeinschaften f\\u00f6rdern nicht nur sportliche F\\u00e4higkeiten, sondern auch Teamgeist und Freundschaften.<\\/p>\"},\"newRecord\":{\"bodytext\":\"<p>Wir bieten dir eine breite Palette an Aktivit\\u00e4ten f\\u00fcr Jung und Alt. Unsere engagierten Trainer und einladenden Gemeinschaften f\\u00f6rdern nicht nur sportliche F\\u00e4higkeiten, sondern auch Teamgeist und Freundschaften.<\\/p>\"}}', 0, '0400$ac0ffc72f1d221aa2aef9895f6fac7c1:7fa2c035f26826fe83eeecaaeddc4d40');
