gerechnet, doch wir wurden positiv \\u00fcberrascht. Daria belegte in ihrer Wettkampfklasse den 3. Platz! Das ist umso bemerkenswerter, da es ihr erster Einzelwettkampf im K\\u00fcrbereich war. Aber auch Enie konnte ihren nahezu perfekten Wettkampf mit dem 3. Platz belohnen. Ein sehr sch\\u00f6ner Erfolg. Svea platzierte sich am Ende auf Platz 5.<\\/p>\\r\\n<p>Das war ein super erfolgreicher Wettkampftag f\\u00fcr die Turnerinnen aus Ladbergen. Die 16 Starterinnen konnten insgesamt einen Pokal f\\u00fcr die Bezirksmeisterin und 5 Bronzemedaillen mit nach Hause nehmen. &nbsp;<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\"}}', 0, '0400$6331fc9e78a7ebe892d0b1244150bced:7e4fc5d3ec5edd1f76b0a3820eb3fb47'),
