(578, 1733826108, 2, 'BE', 1, 0, 46, 'sys_file_reference', '{\"oldRecord\":{\"description\":\"Ebenfalls im ersten Durchgang starteten in der Altersklasse 13 Jahre und \\u00e4lter Hanna Busiek und Laura Herter. Auch dieser Wettkampf begann am Boden. Hier zeigten beide Turnerinnen alles, was sie in den letzten Trainingseinheiten ge\\u00fcbt hatten. Weiter ging es dann am Sprung! Beide M\\u00e4dels zeigten sch\\u00f6ne \\u00dcberschl\\u00e4ge, die mit guten Punkten belohnt wurden. Am Barren konnte besonders Hanna punkten. F\\u00fcr ihre \\u00dcbung ohne Zwischenschwung wurde sie mit 14,80 Punkten belohnt. Bis hierher lief alles noch nach Plan, aber dann kam der Zitterbalken und machte seinem Namen alle Ehre. Leider mussten Laura, als auch Hanna ungewollt absteigen. Dennoch k\\u00f6nnen beide Stolz auf ihre Leistung sein, denn \\\"wer nicht wagt, der nicht gewinnt\\\". Am Ende platzierte sich Laura auf Platz 13 und Hanna auf Platz 16 von insgesamt 23 Turnerinnen.\"},\"newRecord\":{\"description\":null}}', 0, '0400$6331fc9e78a7ebe892d0b1244150bced:a82fe300f8818691e26d3b3c2d4b5fa0'),
