(595, 1733900746, 2, 'BE', 1, 0, 15, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p><span style=\\\"color:rgb(34,34,34);\\\">Kurz zur Geschichte und wie es dazu kam.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Am 11.06.2022 hat der TSV Ladbergen sein 100-j\\u00e4hriges Bestehen an der Tennisanlage in Ladbergen gefeiert. Durch meine aktive Beteiligung an der Einrichtung einer Badminton Gruppe hatte ich gute Kontakte zum Vorstand und war eingeladen dabei zu sein.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Durch Kn\\u00fcpfung von neuen Kontakten, z. B. auch mit dem B\\u00fcrgermeister Torsten Buller kam dann das Gespr\\u00e4ch auf, dass es sch\\u00f6n w\\u00e4re, einen Platz f\\u00fcr Bogenschie\\u00dfen zu finden und dass es doch toll w\\u00e4re, wenn Ladbergen auch dieses anbieten k\\u00f6nnte. Das fanden der B\\u00fcrgermeister und der Vorstand auch. Am darauffolgenden Montag hatte ich auch schon einen Termin im Rathaus angeboten bekommen, mit dem Ziel eine Fl\\u00e4che zu finden auf der wir die Idee realisieren k\\u00f6nnen. Wir waren uns dann mit dem VFL einig das wir die Freiluftsportanlage an der K\\u00f6nigsbr\\u00fccke mitbenutzen k\\u00f6nnten.&nbsp;<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Danach bin ich in die Planung eingestiegen wir haben etwas Werbung gemacht \\u00fcber Mundpropaganda und Facebook.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Am 01.09.2022 war der Plan dann reif und wir haben mit den Menschen, die Interesse hatten eine WhatsApp Gruppe er\\u00f6ffnet und einen Termin f\\u00fcr ein erstes Treffen gemacht.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Am 25.08.2022 viel dann der Start Schuss. Um 18:00 Uhr hat sich ein bunter Mix an Menschen aus verschiedenen Altersklassen auf dem Sportplatz getroffen. Ich hatte eine kleine Scheibe und einen Bogen dabei. Wir haben viel geredet und ein wenig geschossen und es hat sich schnell eine kleine Gruppe von Menschen gefunden, die gro\\u00dfe Lust hatten, sich mit dem Thema Bogenschie\\u00dfen auseinanderzusetzen.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Kurz nach dem Treffen waren die ersten Interessierten schon los sich mit B\\u00f6gen und Pfeilen ausstatten. Der TSV Ladbergen hat anschlie\\u00dfend zwei einfache Scheiben mit einfachem St\\u00e4nder besorgt. Von da an wurde bislang jeden Sonntag von 10.00 Uhr bis 12:00 Uhr dort geschossen. Das sind jetzt immerhin schon 2 Jahre.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Die Gruppe ist extrem entspannt. Wir bauen seit dem unsere Scheibenst\\u00e4nder selber. Aktuell sind wir bei 5 Scheiben angekommen und wir sind ca. 18 aktive Sch\\u00fctzen\\/Sch\\u00fctzinnen.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Bei uns ist jeder Willkommen der es mal versuchen m\\u00f6chte. Kinder ab 10 Jahre bis 14 Jahre aber nur in Begleitung eines Erziehungsberechtigten.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Das hat die Erfahrung gezeigt.<\\/span><\\/p>\"},\"newRecord\":{\"bodytext\":\"<p><span style=\\\"color:rgb(34,34,34);\\\">Kurz zur Geschichte und wie es dazu kam.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Am 11.06.2022 hat der TSV Ladbergen sein 100-j\\u00e4hriges Bestehen an der Tennisanlage in Ladbergen gefeiert. Durch meine aktive Beteiligung an der Einrichtung einer Badminton Gruppe hatte ich gute Kontakte zum Vorstand und war eingeladen dabei zu sein.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Durch Kn\\u00fcpfung von neuen Kontakten, z. B. auch mit dem B\\u00fcrgermeister Torsten Buller kam dann das Gespr\\u00e4ch auf, dass es sch\\u00f6n w\\u00e4re, einen Platz f\\u00fcr Bogenschie\\u00dfen zu finden und dass es doch toll w\\u00e4re, wenn Ladbergen auch dieses anbieten k\\u00f6nnte. Das fanden der B\\u00fcrgermeister und der Vorstand auch. Am darauffolgenden Montag hatte ich auch schon einen Termin im Rathaus angeboten bekommen, mit dem Ziel eine Fl\\u00e4che zu finden auf der wir die Idee realisieren k\\u00f6nnen. Wir waren uns dann mit dem VFL einig das wir die Freiluftsportanlage an der K\\u00f6nigsbr\\u00fccke mitbenutzen k\\u00f6nnten.&nbsp;<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Danach bin ich in die Planung eingestiegen wir haben etwas Werbung gemacht \\u00fcber Mundpropaganda und Facebook.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Am 01.09.2022 war der Plan dann reif und wir haben mit den Menschen, die Interesse hatten eine WhatsApp Gruppe er\\u00f6ffnet und einen Termin f\\u00fcr ein erstes Treffen gemacht.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Am 25.08.2022 viel dann der Start Schuss. Um 18:00 Uhr hat sich ein bunter Mix an Menschen aus verschiedenen Altersklassen auf dem Sportplatz getroffen. Ich hatte eine kleine Scheibe und einen Bogen dabei. Wir haben viel geredet und ein wenig geschossen und es hat sich schnell eine kleine Gruppe von Menschen gefunden, die gro\\u00dfe Lust hatten, sich mit dem Thema Bogenschie\\u00dfen auseinanderzusetzen.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Kurz nach dem Treffen waren die ersten Interessierten schon los sich mit B\\u00f6gen und Pfeilen ausstatten. Der TSV Ladbergen hat anschlie\\u00dfend zwei einfache Scheiben mit einfachem St\\u00e4nder besorgt. Von da an wurde bislang jeden Sonntag von 10.00 Uhr bis 12:00 Uhr dort geschossen. Das sind jetzt immerhin schon 2 Jahre.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Die Gruppe ist extrem entspannt. Wir bauen seit dem unsere Scheibenst\\u00e4nder selber. Aktuell sind wir bei 5 Scheiben angekommen und wir sind ca. 18 aktive Sch\\u00fctzen\\/Sch\\u00fctzinnen.<\\/span><\\/p>\\r\\n<p><span style=\\\"color:rgb(34,34,34);\\\">Bei uns ist jeder Willkommen der es mal versuchen m\\u00f6chte. Kinder ab 10 Jahre bis 14 Jahre aber nur in Begleitung eines Erziehungsberechtigten (das hat die Erfahrung gezeigt).<\\/span><\\/p>\"}}', 0, '0400$defc3e2b86f456ac04b93711b9688b60:cb118fde3da18e67b21a92b60bb8cbda'),
