(632, 1734261737, 2, 'BE', 1, 0, 7, 'tx_news_domain_model_news', '{\"oldRecord\":{\"bodytext\":\"\\r\\n<p>Der Nikolauswettkampf erfreut sich seit vielen Jahren gro\\u00dfer Beliebtheit. In diesem Jahr wurden insgesamt 430 M\\u00e4dchen aus 20 Vereinen aus dem gesamten M\\u00fcnsterland angemeldet. Damit hatte in den Reihen der Organisatorinnen niemand gerechnet. Aus den Erfahrungen der letzten Jahre, wird der Wettkampfablauf f\\u00fcr 400 Teilnehmerinnen geplant! Nun musst dieser aber noch etwas angepasst werden. Aber f\\u00fcr das erfahrene Orga-Team stellte das keine gro\\u00dfen Probleme dar. Der Start wurde kurzerhand um eine halbe Stunde nach vorne gezogen und noch ein paar Medaillen und Kuscheltiere nachbestellt.<\\/p>\\r\\n<p>Nachdem am Freitagabend der Aufbau \\u2013 Dank vieler, starker Helfer \\u2013 in Rekordzeit erfolgt war, konnte es am Samstagmorgen direkt losgehen. Allerdings war relativ fr\\u00fch klar, dass es richtig eng auf der Trib\\u00fcne werden sollte! So konnten leider nicht alle Fans einen Sitzplatz ergattern, aber die Stimmung war auch so phantastisch!<\\/p>\\r\\n<p>Im Wettkampf der 6-j\\u00e4hrigen Starterinnen waren 3 M\\u00e4dchen vom TSV am Start. Sophie Labban sammelte insgesamt 44,6 Punkte und belegte hier den 36. Platz. Auch Aylin Omari (46. Platz) und Leni Augustin (Platz 48.) konnten erste Wettkampfluft schnuppern und einige tolle Erfahrungen mitnehmen.<\\/p>\\r\\n<p>Im Wettkampf Nr. 3 waren insgesamt 93 M\\u00e4dchen am Start. Diese sehr gro\\u00dfe Wettkampfklasse stellte die Kampfrichter vor eine besondere Aufgabe, mussten sie doch gerecht, aber dennoch flott alle \\u00dcbungen bewerten. Ella Winterfeldt zeigte eine sehr sch\\u00f6ne \\u00dcbung am Boden und konnte damit viele Punkte einsammeln. Sie erreichte den 59. Platz. Auch Anni Jahn sammelte flei\\u00dfig Punkte, wobei ihr eine besonders sch\\u00f6ne Gr\\u00e4tsche \\u00fcber den Bock gelang. Am Ende belegte sie Platz 73. LouAnn Hesse (79. Platz), Matilda Kuhn (84. Platz), Jette Karwinkel, Hannah Uennigmann und Hani Omari lie\\u00dfen sich von den zahlreichen Fans feiern.<\\/p>\\r\\n<p>Auch im Wettkampf 4 \\u2013 Jahrgang 2016 -&nbsp; war die Anzahl der Teilnehmerinnen riesig. 97 Turnerinnen zeigten hier, was sie in den letzten Wochen gelernt hatten. Anni Hertog vom TSV startete gut in den Wettkampf und konnte im Verlauf mit guter Haltung am Boden \\u00fcberzeugen. Insgesamt konnte sie 50,75&nbsp; Punkte einsammeln und belegte damit Platz 31. Charlotte Spieker turnte an ihrem ersten Wettkampf schon recht routiniert und sammelte viele Punkte am Reck ein. Am Ende stand ein 39. Platz! Bereits einige Wettkampferfahrung kann Daria Matyusha vorweisen, sie gl\\u00e4nzte am Sprung und erreichte im Gesamtergebnis Platz 46. Katharina Andreae turnt erst seit kurzer Zeit beim TSV und durfte ihre erste Wettkampfluft schnuppern. F\\u00fcr den ersten Wettkampf legte sie eine solide Vorstellung hin \\u2013 Platz 77! Auch Paulina Rehbaum und Pia Hempel zeigten an allen vier Ger\\u00e4ten, was sie im Training gelernt hatten.<\\/p>\\r\\n<p>Als alle \\u00dcbungen im ersten Durchgang absolviert waren, alle Kampfrichterinnen die Wertungen ausgerechnet hatten und unser super-schnelles Auswertungsteam alles zusammengerechnet hatte, konnte die Siegerehrung stattfinden. Als das Licht ausging, war pl\\u00f6tzlich alle Still und die Freude war gro\\u00df, als der echte Nikolaus die Treppe herunterkam. Er attestierte allen Kindern gute Leistungen und w\\u00fcnschte weiterhin viel Spa\\u00df am Turnen. Alle Turnerinnen erhielten zur Belohnung der hervorragenden Leistungen eine Medaille und ein Kuscheltier!&nbsp;<\\/p>\"},\"newRecord\":{\"bodytext\":\"\\r\\n<p>Der Nikolauswettkampf erfreut sich seit vielen Jahren gro\\u00dfer Beliebtheit. In diesem Jahr wurden insgesamt 430 M\\u00e4dchen aus 20 Vereinen aus dem gesamten M\\u00fcnsterland angemeldet. Damit hatte in den Reihen der Organisatorinnen niemand gerechnet. Aus den Erfahrungen der letzten Jahre, wird der Wettkampfablauf f\\u00fcr 400 Teilnehmerinnen geplant! Nun musst dieser aber noch etwas angepasst werden. Aber f\\u00fcr das erfahrene Orga-Team stellte das keine gro\\u00dfen Probleme dar. Der Start wurde kurzerhand um eine halbe Stunde nach vorne gezogen und noch ein paar Medaillen und Kuscheltiere nachbestellt.<\\/p>\\r\\n<p>Nachdem am Freitagabend der Aufbau \\u2013 Dank vieler, starker Helfer \\u2013 in Rekordzeit erfolgt war, konnte es am Samstagmorgen direkt losgehen. Allerdings war relativ fr\\u00fch klar, dass es richtig eng auf der Trib\\u00fcne werden sollte! So konnten leider nicht alle Fans einen Sitzplatz ergattern, aber die Stimmung war auch so phantastisch!<\\/p>\\r\\n<p>Im Wettkampf der 6-j\\u00e4hrigen Starterinnen waren 3 M\\u00e4dchen vom TSV am Start. Sophie Labban sammelte insgesamt 44,6 Punkte und belegte hier den 36. Platz. Auch Aylin Omari (46. Platz) und Leni Augustin (Platz 48.) konnten erste Wettkampfluft schnuppern und einige tolle Erfahrungen mitnehmen.<\\/p>\\r\\n<p>Im Wettkampf Nr. 3 waren insgesamt 93 M\\u00e4dchen am Start. Diese sehr gro\\u00dfe Wettkampfklasse stellte die Kampfrichter vor eine besondere Aufgabe, mussten sie doch gerecht, aber dennoch flott alle \\u00dcbungen bewerten. Ella Winterfeldt zeigte eine sehr sch\\u00f6ne \\u00dcbung am Boden und konnte damit viele Punkte einsammeln. Sie erreichte den 59. Platz. Auch Anni Jahn sammelte flei\\u00dfig Punkte, wobei ihr eine besonders sch\\u00f6ne Gr\\u00e4tsche \\u00fcber den Bock gelang. Am Ende belegte sie Platz 73. LouAnn Hesse (79. Platz), Matilda Kuhn (84. Platz), Jette Karwinkel, Hannah Uennigmann und Hani Omari lie\\u00dfen sich von den zahlreichen Fans feiern.<\\/p>\\r\\n<p>Auch im Wettkampf 4 \\u2013 Jahrgang 2016 -&nbsp; war die Anzahl der Teilnehmerinnen riesig. 97 Turnerinnen zeigten hier, was sie in den letzten Wochen gelernt hatten. Anni Hertog vom TSV startete gut in den Wettkampf und konnte im Verlauf mit guter Haltung am Boden \\u00fcberzeugen. Insgesamt konnte sie 50,75&nbsp; Punkte einsammeln und belegte damit Platz 31. Charlotte Spieker turnte an ihrem ersten Wettkampf schon recht routiniert und sammelte viele Punkte am Reck ein. Am Ende stand ein 39. Platz! Bereits einige Wettkampferfahrung kann Daria Matyusha vorweisen, sie gl\\u00e4nzte am Sprung und erreichte im Gesamtergebnis Platz 46. Katharina Andreae turnt erst seit kurzer Zeit beim TSV und durfte ihre erste Wettkampfluft schnuppern. F\\u00fcr den ersten Wettkampf legte sie eine solide Vorstellung hin \\u2013 Platz 77! Auch Paulina Rehbaum und Pia Hempel zeigten an allen vier Ger\\u00e4ten, was sie im Training gelernt hatten.<\\/p>\\r\\n<p>Als alle \\u00dcbungen im ersten Durchgang absolviert waren, alle Kampfrichterinnen die Wertungen ausgerechnet hatten und unser super-schnelles Auswertungsteam alles zusammengerechnet hatte, konnte die Siegerehrung stattfinden. Als das Licht ausging, war pl\\u00f6tzlich alle Still und die Freude war gro\\u00df, als der echte Nikolaus die Treppe herunterkam. Er attestierte allen Kindern gute Leistungen und w\\u00fcnschte weiterhin viel Spa\\u00df am Turnen. Alle Turnerinnen erhielten zur Belohnung der hervorragenden Leistungen eine Medaille und ein Kuscheltier!&nbsp;<\\/p>\\r\\n<p>Nach einer kurzen Pause ging es dann mit den \\u201e\\u00e4lteren\\u201c Turnerinnen weiter. In den Wettkampfklassen 5 \\u2013 8 (Jahrg\\u00e4nge 2015,2014,2013,2012\\/11) waren weitere TSV-Starterinnen vertreten. Marlene Leuker zeigt ihre \\u00dcbungen in der Altersklasse der 9-J\\u00e4hrigen. Sie absolvierte alle vier Ger\\u00e4te ohne Sturz!<\\/p>\\r\\n<p>Bei den 10-j\\u00e4hrigen Turnerinnen waren insgesamt 42 Turnerinnen am Start. Lena Harmann startete gut in den Wettkampf und konnte viele Punkte am Boden und Schwebebalen einsammeln. Nach vier geturnten Ger\\u00e4ten landete Lena auf Platz 23. F\\u00fcr Laura Hempel war es auch der erste Wettkampf. Eine besonders gelungene \\u00dcbung konnte sie am Reck zeigen. Tamara Lott hatte einen guten Wettkampftag erwischt und konnte eine fehlerfreie \\u00dcbung am Schwebebalken pr\\u00e4sentieren.<\\/p>\\r\\n<p>Auch am Ende dieses Durchgangs fand selbstverst\\u00e4ndlich eine Siegerehrung statt. Besonders sch\\u00f6n war es zu sehen, dass viele Turnerinnen sich sehr \\u00fcber ihre Platzierungen freuten.<\\/p>\\r\\n<p>Am Ende des Wettkampftages galt es noch DANKE zu sagen!!!! Einen besonderen Applaus bekamen die Helfer*innen an der Cafeteria, denn hier waren viele Kannen Kaffee zu kochen, Br\\u00f6tchen zu schmieren und Waffeln zu backen. Aber auch dem flei\\u00dfigen Auf- und Abbauteam, dem Team des DRK und allen Trainerinnen wurde f\\u00fcr die Unterst\\u00fctzung gedankt.<\\/p>\"}}', 0, '0400$e75e3055aac1ac97c8e2dff6680a7a15:31860b4bf14b13d2dc895987af663784'),
