ber auch dem flei\\u00dfigen Auf- und Abbauteam, dem Team des DRK und allen Trainerinnen wurde f\\u00fcr die Unterst\\u00fctzung gedankt.<\\/p>\"}}', 0, '0400$e8b2412273c8bcdbe5404f615cc27444:31860b4bf14b13d2dc895987af663784'),
