(723, 1735046377, 2, 'BE', 1, 0, 6, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"\\r\\n<figure class=\\\"table\\\"><table><tbody><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">Erwachsene<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">86 \\u20ac<\\/td><\\/tr><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">Paare<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">140 \\u20ac<\\/td><\\/tr><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">Familienbeitrag<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">165 \\u20ac<\\/td><\\/tr><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">Sch\\u00fcler \\/ Studenten \\/ Rentner<br>Azubis \\/ Wehrpflichtige<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">66 \\u20ac<\\/td><\\/tr><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">1. Kind<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">48 \\u20ac<\\/td><\\/tr><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">2. Kind<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">48 \\u20ac<\\/td><\\/tr><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">3. Kind und weitere<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">frei<\\/td><\\/tr><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">Mitglieder ab dem 75. Lebensjahr<br>zahlen einen Kostenbeitrag von<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">10 \\u20ac<\\/td><\\/tr><\\/tbody><\\/table><\\/figure>\\r\\n<h4><strong>Zusatzbeitrag Tennis<\\/strong><\\/h4>\\r\\n<figure class=\\\"table\\\"><table><tbody><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">Einzelpersonen<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">108 \\u20ac<\\/td><\\/tr><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">Kinder, Jugendliche, Schu\\u0308ler, Studenten, Auszubildende bis 25 Jahre<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">36 \\u20ac<\\/td><\\/tr><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">Fo\\u0308rderndes Mitglied<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">24 \\u20ac<\\/td><\\/tr><\\/tbody><\\/table><\\/figure>\\r\\n<p>Jedes Mitglied ab 16 Jahren bis zum vollendeten 65. Lebensjahr leistet j\\u00e4hrlich 5 Arbeitsstunden. Diese Verpflichtung beginnt im 2. Mitgliedsjahr. F\\u00fcr jede <strong>nicht geleistete Arbeitsstunde <\\/strong>werden 15 \\u20ac in Rechnung gestellt.<\\/p>\\r\\n<p>Die Arbeitsumlage wird im Wege des Abbuchungsverfahrens jeweils Mitte April des laufenden Jahres im Voraus erhoben; f\\u00fcr geleistete Arbeitsstunden erfolgt eine R\\u00fcckerstattung. Die Beitr\\u00e4ge f\\u00fcr die Tennisabteilung werden halbj\\u00e4hrlich im Voraus (April und Oktober) durch Einzugserm\\u00e4chtigung erhoben.<\\/p>\\r\\n<p>Abmeldungen-aus der Tennisabteilung k\\u00f6nnen schriftlich zum 30.06 bzw. 31.12. eines Jahres bei einer K\\u00fcndigungsfrist von jeweils 6 Wochen gegen\\u00fcber dem Vorstand der Tennisabteilung erfolgen.<\\/p>\\r\\n\\r\\n<p>Stand: September 2021<\\/p>\\r\\n<p>Sollte es euch aus pers\\u00f6nlichen Gr\\u00fcnden nicht m\\u00f6glich sein, am Vereinssport teilzunehmen, ist der 1. Vorsitzende jederzeit ansprechbar, um eine L\\u00f6sung zu finden!<\\/p>\"},\"newRecord\":{\"bodytext\":\"\\r\\n<figure class=\\\"table\\\"><table><tbody><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">Erwachsene<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">86 \\u20ac<\\/td><\\/tr><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">Paare<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">140 \\u20ac<\\/td><\\/tr><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">Familienbeitrag<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">165 \\u20ac<\\/td><\\/tr><tr><td style=\\\"padding:0px 30px 0px 0px;\\\">Sch\\u00fcler \\/ Studenten \\/ Rentner<br>Azubis \\/ Wehrpflichtige<\\/td><td style=\\\"padding:0px 30px 0px 0px;text-align:right;\\\">66 \\u20ac<\\/td><\\/tr><tr><td style=\\\"padding:0px 3