(800, 1740467990, 2, 'BE', 1, 0, 25, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p>Bei uns geht es um Spa\\u00df, Bewegung und die F\\u00f6rderung der motorischen F\\u00e4higkeiten unserer kleinen Turnerinnen und Turner im Alter von 4 bis 8 Jahren.&nbsp;<\\/p>\\r\\n<p>In einer sicheren und freundlichen Umgebung bieten wir abwechslungsreiche Trainingsstunden an, die nicht nur die k\\u00f6rperliche Fitness st\\u00e4rken, sondern auch das Selbstbewusstsein und den Teamgeist f\\u00f6rdern.&nbsp;<\\/p>\\r\\n<p>Unsere erfahrenen Trainerinnen und Trainer begleiten die Kinder spielerisch auf ihrem Weg, neue Bewegungsformen zu entdecken und ihre Talente zu entfalten. Ob beim Purzelbaum schlagen, Balancieren oder beim Erlernen von einfachen Turnelementen \\u2013 hier steht das gemeinsame Erlebnis im Vordergrund! Schaut euch um und lasst eure Kinder Teil unserer fr\\u00f6hlichen Turngemeinschaft werden!<\\/p>\"},\"newRecord\":{\"bodytext\":\"<p><span style=\\\"background-color:rgb(255,255,255);\\\">Das Kinderger\\u00e4tturnen ist eine Weiterentwicklung des allgemeine Kinderturnens und konzentriert sich auf das Erlernen turnerischer Grundelemente an den verschiedenen Ger\\u00e4ten, wie z. B. Reck, Boden und Balken. Es f\\u00f6rdert Kraft, Koordination, Beweglichkeit und K\\u00f6rperspannung auf spielerische Weise und bildet eine gute Grundlage f\\u00fcr viele andere Sportarten.<\\/span><\\/p>\\r\\n<p><span style=\\\"background-color:rgb(255,255,255);\\\">Kinderger\\u00e4tturnen st\\u00e4rkt nicht nur die k\\u00f6rperlichen F\\u00e4higkeiten, sondern auch Selbstvertrauen, Disziplin und Teamgeist!<\\/span><\\/p>\"}}', 0, '0400$ffa74d515837bbe06e3bb9a8b1e5d07e:581bf77acde559fe457e0d401d2ada7b'),
(801, 1740468044, 2, 'BE', 1, 0, 25, 'tt_content', '{\"oldRecord\":{\"header\":\"Herzlich willkommen im Turnbereich\"},\"newRecord\":{\"header\":\"Kinderger\\u00e4teturnen (5 bis 9 Jahre)\"}}', 0, '0400$16e0acbec837e6ec20e4b3191cdbad86:581bf77acde559fe457e0d401d2ada7b'),
