(813, 1742467215, 2, 'BE', 1, 0, 30, 'tt_content', '{\"oldRecord\":{\"header\":\"Ab 2025 neu bei uns!\",\"bodytext\":\"\",\"l18n_diffsource\":\"\"},\"newRecord\":{\"header\":\"Willkommen in unserer Judo-Abteilung!\",\"bodytext\":\"<p>Judo ist mehr als nur ein Sport \\u2013 es ist eine faszinierende Kampfkunst, die Kraft, Technik und Respekt vereint. In unserem Verein bieten wir Training f\\u00fcr alle Altersklassen und Leistungsstufen, vom Anf\\u00e4nger bis zum erfahrenen Judoka. Unser engagiertes Trainerteam vermittelt nicht nur die Techniken des Judo, sondern auch wichtige Werte wie Fairness, Disziplin und Teamgeist.<\\/p>\\r\\n<p>Egal, ob du Judo als Wettkampfsport betreiben oder einfach deine Fitness und Selbstverteidigungsf\\u00e4higkeiten verbessern m\\u00f6chtest \\u2013 bei uns bist du genau richtig! Komm vorbei und erlebe die Dynamik und Gemeinschaft unseres Judo-Teams.<\\/p>\\r\\n<p>Wir freuen uns auf dich!<\\/p>\",\"l18n_diffsource\":\"{\\\"CType\\\":\\\"\\\",\\\"colPos\\\":\\\"\\\",\\\"header\\\":\\\"\\\",\\\"header_layout\\\":\\\"\\\",\\\"header_position\\\":\\\"\\\",\\\"date\\\":\\\"\\\",\\\"header_link\\\":\\\"\\\",\\\"subheader\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"layout\\\":\\\"\\\",\\\"frame_class\\\":\\\"\\\",\\\"space_before_class\\\":\\\"\\\",\\\"space_after_class\\\":\\\"\\\",\\\"sectionIndex\\\":\\\"\\\",\\\"linkToTop\\\":\\\"\\\",\\\"categories\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"editlock\\\":\\\"\\\",\\\"rowDescription\\\":\\\"\\\"}\"}}', 0, '0400$1b79d1256bee5fdf0725d514c7f7e814:f6d670f6f6a9a0aecc0bb542c370acdf'),
(814, 1742467343, 1, 'BE', 1, 0, 60, 'tt_content', '{\"CType\":\"text\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"small\",\"colPos\":\"1\",\"date\":0,\"header_layout\":\"3\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"0\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":\"1\",\"hidden\":\"0\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"pid\":10,\"sorting\":128,\"header\":\"Willkommen in unserer Gymnastik-Abteilung!\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<p>Beweglichkeit, Kraft und Spa\\u00df an der Bewegung \\u2013 das ist Gymnastik in unserem Verein! Egal ob jung oder alt, Einsteiger oder Fortgeschrittene, wir bieten abwechslungsreiche Kurse f\\u00fcr alle, die ihre Fitness verbessern und sich in angenehmer Atmosph\\u00e4re bewegen m\\u00f6chten. Von klassischer Gymnastik \\u00fcber funktionelles Training bis hin zu entspannenden Einheiten \\u2013 bei uns steht die Freude an der Bewegung im Mittelpunkt.<\\/p>\\r\\n<p>Komm vorbei, bleib aktiv und erlebe die positive Wirkung von Gymnastik auf K\\u00f6rper und Geist! Wir freuen uns auf dich.<\\/p>\",\"linkToTop\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1742467343,\"t3ver_stage\":0,\"tstamp\":1742467343,\"uid\":60}', 0, '0400$9cebd9169c05f277d99e5383061bcab2:99c81512fd5f93497eccea8855ca3278'),
