(856, 1743687428, 1, 'BE', 1, 0, 8, 'tx_news_domain_model_news', '{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"hidden\":\"0\",\"istopnews\":\"0\",\"editlock\":\"0\",\"path_segment\":\"erfolgreiche-bezirksmeisterschaften-der-tsv-turnerinnen\",\"sitemap_priority\":\"0.5\",\"pid\":30,\"type\":\"0\",\"title\":\"Erfolgreiche Bezirksmeisterschaften der TSV-Turnerinnen\",\"teaser\":\"Volles Haus herrschte am Sonntag bei den Bezirksmeisterschaften der P-Turnerinnen in Ladbergen. In insgesamt sechs Wettkampfklassen traten jeweils neun qualifizierte Mannschaften an, um sich einen der begehrten Treppchenpl\\u00e4tze zu sichern und damit die Qualifikation f\\u00fcr die n\\u00e4chste Ebene zu erreichen. Der TSV Ladbergen hatte sich dabei auf Kreisebene mit allen angetretenen Mannschaften f\\u00fcr diese Ebene qualifiziert und war somit in vier Wettkampfklassen vertreten.\",\"datetime\":1743687330,\"archive\":0,\"bodytext\":\"<p>In der Wettkampfklasse 2 (Jahrgang 2012 und j\\u00fcnger) schickte der TSV mit Melina Herte, Klara Vietmeier, Lucy Berghaus, Arina Matyusha und Lena Kn\\u00fcfer dasselbe Quintett an den Start, das sich im vergangenen Jahr sehr erfolgreich in diesem Wettkampf geschlagen hatte. Diesen Erfolg wollten die Turnerinnen wiederholen \\u2013 allerdings nun in einer h\\u00f6heren Wettkampfklasse mit schwierigeren \\u00dcbungen. Entsprechend gro\\u00df war die Anspannung unter den Turnerinnen. Doch die M\\u00e4dchen behielten die Nerven und zeigten ihre Wettkampf- und Teamst\\u00e4rke. Am Sprung turnten alle sehr gute Handstand\\u00fcberschl\\u00e4ge und erzielten insgesamt 58,4 Punkte, was den souver\\u00e4nen Sieg an diesem Ger\\u00e4t bedeutete. Auch an den anderen Ger\\u00e4ten (Boden: 59,4 Punkte, 2. Platz\\/ Stufenbarren: 58,5 Punkte, 2. Platz\\/ Schwebebalken: 59,0 Punkte, 3. Platz) zeigte die Mannschaft gute Leistungen und k\\u00e4mpfte um jedes Zehntel. Bei der Siegerehrung war der Jubel dann riesengro\\u00df, als die TSV-Turnerinnen abermals die Silbermedaille in Empfang nehmen durften und damit die Qualifikation f\\u00fcr die Gaumeisterschaften in eigener Halle gesichert war. In der inoffiziellen Einzelwertung stachen dabei Lena Kn\\u00fcfer mit Platz 2 und Lucy Berghaus mit Platz 6 heraus.<\\/p>\\r\\n<p>Auch in der Wettkampfklasse 3 (Jahrgang 2014 und j\\u00fcnger) schickte der TSV ein aussichtsreiches Team an den Start. Maya Labban, Hannah Kimmina, Ella Kolzow, Clara Haase und Greta Austermann hatten bei den Kreismeisterschaften durch unn\\u00f6tige Fehler noch einige Punkte liegengelassen und wollten dies nun \\u00e4ndern \\u2013 mit Erfolg! An allen vier Ger\\u00e4ten zeigten sich die M\\u00e4dchen stark verbessert. Am Sprung belegte die Mannschaft mit 57,65 Punkten sogar den 1. Platz in der Ger\\u00e4tewertung. Auch am Reck (57,7 Punkte, 3. Platz), Schwebebalken (54,8 Punkte, 5. Platz) und Boden (55,5 Punkte, 5. Platz) konnten die Turnerinnen ihre Trainingsleistung abrufen und zeigten gute \\u00dcbungen. Hannah Kimmina (Platz 8) und Maya Labban (Platz 10) konnten mit durchgehend starken Leistungen \\u00fcberzeugen und turnten sich in der Einzelwertung unter die Top Ten. In der Mannschaftsgesamtwertung landeten die TSV-Turnerinnen schlie\\u00dflich auf dem undankbaren 4. Platz. Entsprechend gro\\u00df war die Entt\\u00e4uschung unter den M\\u00e4dchen. Doch das Trainerteam zeigte sich rundum zufrieden: \\u201eDie M\\u00e4dels haben sich enorm gesteigert und k\\u00f6nnen sich nichts vorwerfen lassen. Die anderen Mannschaften waren heute einfach einen Tick st\\u00e4rker.\\u201c<\\/p>\\r\\n<p>Im Wettkampf 1 (offener Jahrgang) schickte der TSV eine kurzfristig zusammengestellte Mannschaft an den Start, bei der es darum ging weitere Wettkampfpraxis zu sammeln. Bei den Kreismeisterschaften waren Laura Herter und Hanna Busiek noch als Duo an den Start gegangen, wurden aber jetzt spontan von Alysha Ates und Lena Harmann verst\\u00e4rkt. Die Turnerinnen konnten h\\u00f6here \\u00dcbungen unter Wettkampfbedingungen ausprobieren. Dies gelang Hanna Busiek besonders gut, sodass sie sich am Ende einen tollen 10. Platz in der Einzelwertung erturnte, w\\u00e4hrend die Mannschaften den 8. Platz belegte.<\\/p>\\r\\n<p>Auch die Turnerinnen der Wettkampfklasse 6 (Jahrgang 2014 und j\\u00fcnger) hatten sich f\\u00fcr die Bezirksmeisterschaften qualifiziert. Die Mannschaft mit Laura Hempel, Katharina Andreae, Ella Winterfeldt, Tamara Lott und Lotta Willerscheidt konnte am Sprung (53,0 Punkte) gut mit der Konkurrenz mithalten. An den anderen Ger\\u00e4ten zeigten sie jeodch noch einige Unsicherheiten und verloren damit einige Punkte. Am Ende belegten die Turnerinnen den 8. Platz in der Gesamtwertung.&nbsp;<\\/p>\\r\\n<p>F\\u00fcr die qualifizierte Mannschaft hei\\u00dft es nun den \\u00dcbungen den n\\u00f6tigen Feinschliff zu verpassen f\\u00fcr die finalen Gaumeisterschaften, die am 5. April wiederum vor heimischer Kulisse stattfinden.&nbsp;<\\/p>\",\"categories\":\"0\",\"related\":\"0\",\"tags\":\"0\",\"author\":\"\",\"author_email\":\"\",\"keywords\":\"\",\"description\":\"\",\"alternative_title\":\"\",\"sitemap_changefreq\":\"\",\"sys_language_uid\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"notes\":\"\",\"crdate\":1743687428,\"t3ver_stage\":0,\"tstamp\":1743687428,\"uid\":8}', 0, '0400$bb0224872baf1736f6f79a7d4fe4da06:ff635a07b31923a6d7cd863a31313787'),
