(876, 1744092150, 1, 'BE', 1, 0, 9, 'tx_news_domain_model_news', '{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"hidden\":\"0\",\"istopnews\":\"0\",\"editlock\":\"0\",\"path_segment\":\"bronzemedaille-fuer-tsv-turnerinnen-bei-muensterlandmeisterschaften\",\"sitemap_priority\":\"0.5\",\"pid\":30,\"type\":\"0\",\"title\":\"Bronzemedaille f\\u00fcr TSV-Turnerinnen bei M\\u00fcnsterlandmeisterschaften\",\"teaser\":\"Am vergangenen Samstag fanden in Ladbergen die M\\u00fcnsterlandmeisterschaften im Ger\\u00e4teturnen statt \\u2013 dem h\\u00f6chstm\\u00f6glichen Wettkampf f\\u00fcr Turnerinnen im P-Bereich. \",\"datetime\":1744091807,\"archive\":0,\"bodytext\":\"<p>Bei diesem Wettkampf treffen die besten Mannschaften des Turngau M\\u00fcnsterlands, die sich \\u00fcber Wettk\\u00e4mpfe auf Kreis- und Bezirksebene qualifiziert haben, aufeinander. Darunter auch eine Mannschaft des TSV Ladbergen, die in der Wettkampfklasse 2 noch einmal vor heimischer Kulisse auftreten durfte.<\\/p>\\r\\n<p>F\\u00fcr Lena Kn\\u00fcfer, Lucy Berghaus, Arina Matyusha, Melina Herte und Klara Vietmeier startete der Wettkampf am Boden. Hier zeigten alle Turnerinnen sehr gute \\u00dcbungen, was der Mannschaft 59,35 Punkte und damit den 2. Platz in der Ger\\u00e4tewertung einbrachte. Wie schon beim letzten Wettkampf, lief es auch dieses Mal am Sprungtisch f\\u00fcr die M\\u00e4dchen besonders gut. Mit 60,2 Punkte belegten sie den 1. Platz an diesem Ger\\u00e4t. Am Stufenbarren bissen sich alle Turnerinnen durch, blieben mit insgesamt 56,4 Punkten (5. Platz in der Ger\\u00e4tewertung) jedoch insgesamt ein wenig unter ihren M\\u00f6glichkeiten. Zum Abschluss ging es an den Schwebebalken. Hier zeigten sich die M\\u00e4dchen sehr nervenstark, turnten saubere \\u00dcbungen und konnten so mit 57,2 Punkte den 3. Platz an diesem Ger\\u00e4t erzielen.<\\/p>\\r\\n<p>Gro\\u00dfer Jubel brandete bei der Siegerehrung auf, als die TSV-Turnerinnen mit einer Gesamtpunktzahl von 233,15 Punkten das Treppchen besteigen und sich \\u00fcber die Bronzemedaille freuen durften. Dabei wurde der 2. Platz, den der TV Gescher belegte, um die Winzigkeit von 0,05 Punkten verfehlt. Dennoch waren Turnerinnen, Trainerinnen und die Fangemeinschaft zurecht stolz auf das erreichte Ergebnis.<\\/p>\\r\\n<p>Mit diesem Erfolg im R\\u00fccken geht es nun an die Vorbereitung f\\u00fcr die Bezirksliga, die nach den Osterferien startet.<\\/p>\",\"categories\":\"0\",\"related\":\"0\",\"tags\":\"0\",\"author\":\"\",\"author_email\":\"\",\"keywords\":\"\",\"description\":\"\",\"alternative_title\":\"\",\"sitemap_changefreq\":\"\",\"sys_language_uid\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"notes\":\"\",\"crdate\":1744092150,\"t3ver_stage\":0,\"tstamp\":1744092150,\"uid\":9}', 0, '0400$3dc55b706cc1aa59960f632d4fbe2f27:ea59bb16023727fc0c0128366bbe4ed3'),
