(880, 1744092543, 2, 'BE', 1, 0, 25, 'tt_content', '{\"oldRecord\":{\"header\":\"Kinderger\\u00e4teturnen\",\"bodytext\":\"<p>Das Kinderger\\u00e4tturnen ist eine Weiterentwicklung des allgemeine Kinderturnens und konzentriert sich auf das Erlernen turnerischer Grundelemente an den verschiedenen Ger\\u00e4ten, wie z. B. Reck, Boden und Balken. Es f\\u00f6rdert Kraft, Koordination, Beweglichkeit und K\\u00f6rperspannung auf spielerische Weise und bildet eine gute Grundlage f\\u00fcr viele andere Sportarten.<\\/p>\\r\\n<p>Kinderger\\u00e4tturnen st\\u00e4rkt nicht nur die k\\u00f6rperlichen F\\u00e4higkeiten, sondern auch Selbstvertrauen, Disziplin und Teamgeist!<\\/p>\"},\"newRecord\":{\"header\":\"Turnabteilung TSV Ladbergen\",\"bodytext\":\"<p>Herzlich willkommen in der Abteilung Turnen! Bei uns steht das Bewegen an und auf Ger\\u00e4ten im Mittelpunkt \\u2013 vom ersten klettern, springen und rollen bis hin zu Handstand, Flick-Flack und Salto. Unser Angebot umfasst sowohl das Eltern-Kind-Turnen f\\u00fcr die J\\u00fcngsten, das Ger\\u00e4teturnen f\\u00fcr Anf\\u00e4ngerinnen als auch das Wettkampfturnen f\\u00fcr die fortgeschrittenen Turnerinnen.&nbsp;<\\/p>\\r\\n<p>Wir freuen uns sehr \\u00fcber den regen Zulauf und das gro\\u00dfe Interesse an unseren Angeboten, m\\u00fcssen jedoch aufgrund der hohen Nachfrage f\\u00fcr einige Gruppen eine Warteliste f\\u00fchren. Wir bitten deshalb um eine vorherige Kontaktaufnahme mit der jeweiligen Ansprechpartnerin. Alle Gruppen trainieren in der Rottsporthalle.<\\/p>\"}}', 0, '0400$6c47c9cb7a32e5e3498801d24d34c6c6:581bf77acde559fe457e0d401d2ada7b'),
(881, 1744092559, 1, 'BE', 1, 0, 38, 'pages', '{\"doktype\":\"1\",\"slug\":\"\\/turnen\\/gruppen\",\"categories\":\"0\",\"layout\":\"0\",\"lastUpdated\":0,\"newUntil\":0,\"cache_timeout\":\"0\",\"shortcut\":0,\"shortcut_mode\":\"0\",\"content_from_pid\":0,\"mount_pid\":0,\"module\":\"\",\"hidden\":1,\"starttime\":0,\"endtime\":0,\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"sitemap_priority\":\"0.5\",\"twitter_card\":\"\",\"pid\":9,\"sorting\":128,\"perms_userid\":1,\"perms_groupid\":0,\"perms_user\":31,\"perms_group\":27,\"perms_everybody\":0,\"title\":\"Gruppen\",\"sys_language_uid\":0,\"crdate\":1744092559,\"t3ver_stage\":0,\"tstamp\":1744092559,\"uid\":38}', 0, '0400$a66d87cd6a55e49eecf92109b04c2d0c:25fb0f8c54125efeb15a71bcd7ab0dae'),
(882, 1744092664, 1, 'BE', 1, 0, 64, 'tt_content', '{\"CType\":\"text\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"small\",\"colPos\":\"1\",\"date\":0,\"header_layout\":\"3\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"0\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":\"1\",\"hidden\":\"0\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"pid\":38,\"sorting\":256,\"header\":\"Gruppen\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<p><strong>Eltern-Kind-Turnen (f\\u00fcr Kinder von etwa 1 bis 4 Jahre):&nbsp;<\\/strong><\\/p>\\r\\n<p>Hier sammeln unsere j\\u00fcngsten Mitglieder ihre ersten Bewegungserfahrungen an den Ger\\u00e4ten. Die 1-2j\\u00e4hrigen Kinder turnen mit ihren Eltern oder Gro\\u00dfeltern im Hallenanbau der Rottsporthalle. Hier gibt es eine Bewegungslandschaft, die auf die kleinen TurnerInnen abgestimmt ist. Zeitgleich gibt es in der Haupthalle eine etwas anspruchsvollere Bewegungslandschaft f\\u00fcr die 3-4j\\u00e4hrigen Kinder, die ebenfalls von ihren Eltern oder Gro\\u00dfeltern unterst\\u00fctzt werden.<\\/p>\\r\\n<p>Trainingszeit: donnerstags 16.00 \\u2013 17.00 Uhr<\\/p>\\r\\n<p>Ansprechpartnerin: Simone Maneke 01708016943<\\/p>\\r\\n\\r\\n<p><strong>Kinderturnen (f\\u00fcr Kinder von etwa 4 bis 6 Jahre):<\\/strong><\\/p>\\r\\n<p>Trainingszeit: donnerstags 15.00 \\u2013 16.00 Uhr<\\/p>\\r\\n<p>Ansprechpartnerin: Simone Maneke 01708016943<\\/p>\\r\\n\\r\\n<p><strong>Ger\\u00e4teturnen \\u2013 Anf\\u00e4ngerinnen (f\\u00fcr M\\u00e4dchen von etwa 5 bis 8 Jahre):<\\/strong><\\/p>\\r\\n<p>Diese Gruppe ist eine Weiterentwicklung des allgemeinen Kinderturnens und konzentriert sich auf das Erlernen turnerischen Grundelemente an den verschiedenen Ger\\u00e4ten, wie z.B. Reck, Boden und Balken. Es f\\u00f6rdert Kraft, Koordination, Beweglichkeit und K\\u00f6rperspannung und st\\u00e4rkt neben den k\\u00f6rperlichen F\\u00e4higkeiten auch Selbstvertrauen, Disziplin und Teamgeist.<\\/p>\\r\\n<p>Trainingszeit: montags von 16.00 \\u2013 18.00 Uhr<\\/p>\\r\\n<p>Ansprechpartnerin: Pia H\\u00fcsing 015228454241<\\/p>\\r\\n\\r\\n<p><strong>Ger\\u00e4teturnen \\u2013 Wettkampfturnen (f\\u00fcr M\\u00e4dchen ab etwa 8 Jahre)<\\/strong><\\/p>\\r\\n<p>Hier turnen die M\\u00e4dchen, die schon \\u00fcber gewisse turnerische Grundlagen an den Ger\\u00e4ten Sprung, Reck\\/ Stufenbarren, Schwebebalken und Boden verf\\u00fcgen und diese weiterentwickeln m\\u00f6chten. Aufgeteilt in unterschiedliche Alters- und Leistungsgruppen trainieren die M\\u00e4dchen f\\u00fcr die Teilnahme an Mannschafts- und Einzelwettk\\u00e4mpfe des Turngaus M\\u00fcnsterland.<\\/p>\\r\\n<p>Trainingszeiten: mittwochs 16.30 \\u2013 19.00 Uhr und freitags 15.00 \\u2013 17.00 Uhr bzw. 16.30 \\u2013 19.00 Uhr<\\/p>\\r\\n<p>Ansprechpartnerinnen: Melanie Behling 05485-3569 und Marina Hilgemann 016098435159<\\/p>\\r\\n\\r\\n<p><strong>Grundschulturnen (f\\u00fcr Kinder im Grundschulalter)<\\/strong><\\/p>\\r\\n<p>Zu Beginn der Stunde starten wir mit Aufw\\u00e4rmspielen in der Gruppe, um den K\\u00f6rper in Bewegung zu bringen und die Muskeln zu lockern. Dabei arbeiten die Kinder zusammen, f\\u00f6rdern den Teamgeist und haben viel Spa\\u00df. Im Anschluss d\\u00fcrfen sie die aufgebauten Ger\\u00e4te und Spiellandschaften nutzen, um ihre motorischen F\\u00e4higkeiten zu trainieren. Beim freien Spielen k\\u00f6nnen die Kinder ihre Kreativit\\u00e4t entfalten und neue Bewegungsabl\\u00e4ufe ausprobieren.<\\/p>\\r\\n<p>Trainingszeit: montags 15.30 \\u2013 16.30 Uhr (f\\u00fcr Kinder im Grundschulalter)<\\/p>\\r\\n<p>Ansprechpartnerin: Anita Pawlaczyk 01717019573<\\/p>\",\"linkToTop\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1744092664,\"t3ver_stage\":0,\"tstamp\":1744092664,\"uid\":64}', 0, '0400$565cd9d33df3c850a0982914c4a228ba:c8805dec1eadaaa6fcc10ed05fa41f91'),
