(894, 1745339788, 1, 'BE', 1, 0, 10, 'tx_news_domain_model_news', '{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"hidden\":\"0\",\"istopnews\":\"0\",\"editlock\":\"0\",\"path_segment\":\"tsv-ladbergen-belebt-traditionelle-ostereierrallye-wieder\",\"sitemap_priority\":\"0.5\",\"pid\":30,\"type\":\"0\",\"title\":\"TSV Ladbergen belebt traditionelle Ostereierrallye wieder\",\"teaser\":\"Mit viel Spa\\u00df und Teamgeist fand in diesem Jahr die Osterrallye in Ladbergen statt. 53 Kinder traten in 12 Teams gegeneinander an und lieferten sich ein spannendes Kopf-an-Kopf-Rennen. Interessant: Es gab keinen 10., 11. oder 12. Platz \\u2013 alle Teams waren nah beieinander!\",\"datetime\":1745339700,\"archive\":0,\"bodytext\":\"<p>Zwischen den Spielstationen mussten die Kinder knifflige Fragen l\\u00f6sen. Der richtige Weg zur n\\u00e4chsten Station wurde dabei durch kleine Hinweise auf ihren Frageb\\u00f6gen verraten \\u2013 ein echtes R\\u00e4tselabenteuer! An vier abwechslungsreichen Spielstationen konnten die Kinder ihr K\\u00f6nnen unter Beweis stellen. Bei Station 1 wartete ein Ball-Pong-Spiel, begleitet von Brezeln und Trinkp\\u00e4ckchen zur St\\u00e4rkung. Station 2 forderte Fingerspitzengef\\u00fchl: In einem Schuhkarton mussten Gegenst\\u00e4nde wie eine Osterhasenfigur blind ertastet und erkannt werden. Station 3 verlangte echten Teamgeist \\u2013 beim Langski-Lauf mussten die Kinder auf Skiern mit vier Schlaufen gemeinsam einen kleinen Parcours meistern.<\\/p>\\r\\n<p>An der Zielstation in der Turnhalle wartete die finale Aufgabe: In einer gro\\u00dfen Schale voller bunter Eier musste die Anzahl gesch\\u00e4tzt werden \\u2013 gar nicht so leicht!<\\/p>\\r\\n<p>Zum Abschluss hielt das Orga-Team um Pia H\\u00fcsing und Sabine Haase f\\u00fcr alle Kinder frische Waffeln, Getr\\u00e4nke und Kekse bereit. Bei der Siegerehrung erhielt jedes Kind eine Urkunde und einen Schokohasen \\u2013 der von den meisten mit Genuss direkt verputzt wurde.<\\/p>\\r\\n<p>Ein gelungener Tag voller Freude und Bewegung!<\\/p>\",\"categories\":\"1\",\"related\":\"0\",\"tags\":\"0\",\"author\":\"\",\"author_email\":\"\",\"keywords\":\"\",\"description\":\"\",\"alternative_title\":\"\",\"sitemap_changefreq\":\"\",\"sys_language_uid\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"notes\":\"\",\"crdate\":1745339788,\"t3ver_stage\":0,\"tstamp\":1745339788,\"uid\":10}', 0, '0400$94381b9c301b486bf94a652e2da527e5:74d687ec564a59b0360c2264c05d7a29'),
