(902, 1745397456, 1, 'BE', 4, 0, 11, 'tx_news_domain_model_news', '{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"hidden\":\"0\",\"istopnews\":\"0\",\"editlock\":0,\"path_segment\":\"theo-schulz-gewinnt-beim-friese-masters\",\"sitemap_priority\":\"0.5\",\"pid\":30,\"type\":\"0\",\"title\":\"Theo Schulz gewinnt beim Friese Masters\",\"teaser\":\"Nur wenige Kilometer von der Nordseek\\u00fcste entfernt traten am Ostersamstag die Judokas des TSV Ladbergen beim international besetzten Friese Masters in Stiens an.\",\"datetime\":1745397277,\"archive\":0,\"bodytext\":\"<p class=\\\"text-justify\\\">Nur wenige Kilometer von der Nordseek\\u00fcste entfernt traten am Ostersamstag die Judokas des TSV Ladbergen beim international besetzten Friese Masters in Stiens an. Die Erwartungen waren offen \\u2013 schlie\\u00dflich warteten auf die Athletinnen und Athleten gr\\u00f6\\u00dftenteils unbekannte Gegner.<\\/p>\\r\\n<p class=\\\"text-justify\\\">F\\u00fcr Aaron Schulz und Dennis Scheck verlief das Turnier herausfordernd. Beide jeweils im ersten Jahr ihrer Altersklasse, sahen sie sich einem sehr starken Teilnehmerfeld gegen\\u00fcber. Aaron unterlag in beiden Begegnungen klar, zeigte sich jedoch k\\u00e4mpferisch: \\u201eBeim n\\u00e4chsten Mal knacke ich sie\\u201c, versprach er. Auch Dennis hatte es schwer. W\\u00e4hrend er im ersten Duell chancenlos blieb, entwickelte sich der zweite Kampf zun\\u00e4chst ausgeglichen. Doch nach mehreren Angriffen seines Gegners konnte er seine Verteidigung nicht mehr halten und schied aus.<\\/p>\\r\\n<p class=\\\"text-justify\\\">Besser lief es f\\u00fcr Theo Schulz, der nach l\\u00e4ngerer Wettkampfpause wieder auf die Matte zur\\u00fcckkehrte. Hochkonzentriert und in starker Form k\\u00e4mpfte er sich souver\\u00e4n bis ins Finale. Dort traf er auf einen deutlich gr\\u00f6\\u00dferen und schwereren Gegner. Dank seiner \\u00fcberlegenen Ausdauer und Kraft gelang ihm in der Verl\\u00e4ngerung der entscheidende Punkt \\u2013 Gold f\\u00fcr Theo und damit der Titel \\u201eFriese Master\\u201c. \\u00dcberschattet wurde der sportliche Erfolg allerdings durch die Disqualifikation von Maximilian Wollnik. Nach einer un\\u00fcbersichtlichen Situation wurde ihm ein <i>Hansoku-make<\\/i> (Turnierdisqualifikation) ausgesprochen \\u2013 eine Entscheidung, die sich nach R\\u00fccksprache mit den Kampfrichtern als falsch herausstellte. Dennoch wurde sie nicht revidiert. \\u201eMaximilian war heute sehr stark \\u2013 da w\\u00e4re definitiv etwas drin gewesen\\u201c, sagte Trainer Maximilian Greshake entt\\u00e4uscht.<\\/p>\\r\\n<p class=\\\"text-justify\\\">F\\u00fcr einen vers\\u00f6hnlichen Abschluss sorgte Lena Busiek. Sie musste eine Gewichtsklasse h\\u00f6her antreten und traf in ihrem Pool auf f\\u00fcnf Gegnerinnen. Zwei K\\u00e4mpfe entschied sie souver\\u00e4n dank ihrer \\u00fcberlegenen Bodenarbeit. In zwei weiteren Duellen war sie k\\u00f6rperlich unterlegen und musste sich geschlagen geben. Der f\\u00fcnfte Kampf wurde zum entscheidenden Duell um Bronze. Trotz einer starken Leistung und beinahe erfolgreicher Bodenaktion geriet Lena nach einer missgl\\u00fcckten Standtechnik in R\\u00fcckstand, den sie nicht mehr aufholen konnte. Am Ende reichte es dennoch f\\u00fcr Platz drei und eine verdiente Bronzemedaille.Theo Schulz gewinnt beim Friese Masters<\\/p>\",\"categories\":\"1\",\"related\":\"0\",\"tags\":\"0\",\"author\":\"\",\"author_email\":\"\",\"keywords\":\"\",\"description\":\"\",\"alternative_title\":\"\",\"sitemap_changefreq\":\"\",\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"notes\":\"\",\"crdate\":1745397456,\"t3ver_stage\":0,\"tstamp\":1745397456,\"uid\":11}', 0, '0400$2e21e2d4633b06153b9064dcbef7362d:a7708bdfd76f24b1743f6d30ac679090'),
