(931, 1746951954, 1, 'BE', 1, 0, 12, 'tx_news_domain_model_news', '{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"hidden\":\"0\",\"istopnews\":\"0\",\"editlock\":\"0\",\"path_segment\":\"ein-sehr-erfolgreiches-wettkampf-wochenende-liegt-hinter-unseren-turnerinnen\",\"sitemap_priority\":\"0.5\",\"pid\":30,\"type\":\"0\",\"title\":\"Ein sehr erfolgreiches Wettkampf-Wochenende liegt hinter unseren Turnerinnen\",\"teaser\":\"Am vergangenen Wochenende fanden in Gievenbeck die ersten Bezirksliga-Wettk\\u00e4mpfe der oberen Altersklassen statt. Am Samstag waren hier zwei Riegen aus Ladbergen am Start.\",\"datetime\":1746951600,\"archive\":0,\"bodytext\":\"<p>Im Wettkampf Nr. 3 \\u2013 Turnerinnen 14 Jahre und j\\u00fcnger \\u2013 hatten 12 Teams gemeldet. F\\u00fcr uns starteten Arina Matyusha, Lucy Berghaus, Lena Kn\\u00fcfer, Klara Vietmeier und Zoe Lautenschl\\u00e4ger. Die Ausschreibund dieses Wettkampfes ist schon ambitioniert, kann man sogar \\u00dcbungen bis zur P8 (zweit-h\\u00f6chster Schwierigkeitsgrad) turnen. Im Training hatten die M\\u00e4dels flei\\u00dfig trainiert und waren gut vorbereitet.<\\/p>\\r\\n<p>Los ging es am Samstag am Sprung! Alle Turnerinnen zeigten sch\\u00f6ne Handstand\\u00fcberschl\\u00e4ge \\u00fcber den Sprungtisch. Hier gelang es Lena die Tagesh\\u00f6chstwertung von 16,1 (von m\\u00f6glichen 17) Punkten zur erreichen. Der Start war also gegl\\u00fcckt. Dann ging es zum Barren, an dem von den Ladberger Turnerinnen noch nicht die ganz hohen \\u00dcbungen gezeigt werden konnten, aber die etwas \\u201eeinfacheren\\u201c \\u00dcbungen wurden sehr pr\\u00e4zise ausgef\\u00fchrt und wurden daher auch mit guten Wertungen belohnt. Im Mannschaftsergebnis an diesem Ger\\u00e4t konnte man vorne mithalten! Dann ging es an den gef\\u00fcrchteten Schwebebalken, der sich als echter Zitterbalken erwies\\u2026. Leider mussten unsere M\\u00e4dels h\\u00e4ufig ungeplant absteigen und b\\u00fc\\u00dften so viele Punkte ein. Hervorzuheben ist hier noch die \\u00dcbung von Lucy, die mit 14,7 Punkten bewertet wurde. Mit diesem Rucksack ging es dann noch zum Boden. Lena und Lucy zeigten jeweils eine sehr sauber ausgef\\u00fchrte P8! Aber auch Arina, Klara und Zoe turnten ihre \\u00dcbungen fl\\u00fcssig zur Musik durch. Nun ging das Warten auf die Siegerehrung los.<\\/p>\\r\\n<p><br \\/>Diese Riege schaffte einen phantastischen 2. Platz in der Hinrunde! Da war der Applaus der mitgereisten Fans riesengro\\u00df! Mit einem Mannschaftsergebnis von 183,10 Punkten musste sich nur der Riege aus Ibbenb\\u00fcren (185,25 Punkte) geschlagen geben. Bis zur R\\u00fcckrunde im September wird noch etwas an den \\u00dcbungen gefeilt! Warten wir ab, was dann noch m\\u00f6glich ist.<\\/p>\\r\\n<p><br \\/>Als Sahneh\\u00e4ubchen wurde noch die beste Einzelturnerin aufgerufen. Dieses Sonderlob konnte Lena Kn\\u00fcfer mit nach Hause nehmen!<\\/p>\\r\\n<p><br \\/>Ebenso erfolgreich verlief der Wettkampf Nr. 4. Hier starteten alle Turnerinnen im offenen Jahrgang. F\\u00fcr den TSV gingen Laura Herter, Hanna Busiek, Melina Herte und Ella Kolzow ins Rennen. Diese neu formatierte Riege ist ohne gro\\u00dfe Erwartungen ins Rennen gegangen und war am Ende sehr happy \\u00fcber den 2. Platz in einem Teilnehmerfeld von insgesamt 9 Mannschaften! Auch einen herzlichen Gl\\u00fcckwunsch an diese M\\u00e4dels.<\\/p>\\r\\n<p><br \\/>Der Wettkampf startete hier ebenfalls am Sprung. Die M\\u00e4dels legten einen guten Start hin und wechselten zum Barren. Auch hier konnten die Leistungen aus dem Training abgerufen werden! Die Wertungen der Kampfrichterinnen waren entsprechend gut! Dann wechselte die Riege zum Schwebebalken, an dem das Einturnen so gar nicht nach Ma\\u00df lief. Hanna hatte einen schweren Sturz, konnte dann aber im Wettkampf tapfer die \\u00dcbung durchziehen! F\\u00fcr die beste Wertung der TSV-Turnerinnen sorgte Melina, die fehlerfrei durch die \\u00dcbung kam. Als letztes Ger\\u00e4t war dann noch der Boden dran. Mit viel Spannung und Ausstrahlung konnten Hanna und Laura ganz nach an die Tagesh\\u00f6chstwertung heranturnen.<\\/p>\\r\\n<p><br \\/>So ging ein sch\\u00f6ner und \\u00fcberraschend erfolgreicher Wettkampftag zu Ende.<\\/p>\\r\\n<p><br \\/>Am Sonntag war dann unsere K\\u00fcr-Riege im Einsatz. Leider mussten wir ersatzgeschw\\u00e4cht nach M\\u00fcnster anreisen und auch das Training in den letzten Wochen lief durch Verletzungen und Ausf\\u00e4llen nicht optimal. Dennoch gingen Sarah Maneke, Daria Eberhardt, Enie Schlichter und Svea Behling motiviert in den Wettkampf. Im Teilnehmerfeld traf man auf Absteiger aus der M\\u00fcnsterland-Liga und weitere stark eingesch\\u00e4tzte Konkurrenz aus dem ganzen Bezirk! Insgesamt hatten 13 Teams gemeldet!<\\/p>\\r\\n<p><br \\/>Die jungen Damen starteten am Boden! Hier gelang ein richtig guter Start in den Wettkampf und es wurden ordentlich Punkte mitgenommen. Motiviert ging es zum Sprung. Im Training wurde hier an schwierigeren Spr\\u00fcnge gearbeitet und diese konnten auch am Sonntag morgen gezeigt werden. Nach der H\\u00e4lfte des Wettkampfes waren Turnerinnen und Trainerinnen sehr zufrieden. Doch dann kam der Barren! Nur Enie und Daria konnten hier konkurrenzf\\u00e4hige \\u00dcbungen zeigen und auch am abschie\\u00dfenden Balken gab es leider zu viele Absteiger, sodass am Ende ein 11 Platz stand!<\\/p>\\r\\n<p><br \\/>Nun hei\\u00dft es trainieren, trainieren, trainieren\\u2026 doch erstmal steht das Highlight des Jahres an! Endlich wird wieder ein \\u201eInternationales Deutsches Turnfest\\u201c stattfinden! Und wir sind in Leipzig dabei!<\\/p>\\r\\n<p><br \\/>Wir m\\u00f6chten uns noch ausdr\\u00fccklich bei unseren Sponsoren f\\u00fcr die super-sch\\u00f6nen neuen Anz\\u00fcgen bedanken! Wir denken, dass auch das neue Outfit ihren Anteil an den Erfolgen des Wochenendes haben!<\\/p>\",\"categories\":\"1\",\"related\":\"0\",\"tags\":\"0\",\"author\":\"\",\"author_email\":\"\",\"keywords\":\"\",\"description\":\"\",\"alternative_title\":\"\",\"sitemap_changefreq\":\"\",\"sys_language_uid\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"notes\":\"\",\"crdate\":1746951954,\"t3ver_stage\":0,\"tstamp\":1746951954,\"uid\":12}', 0, '0400$1247e400fa8b239a5aaab0faf970ca87:6c6005b66e9191f57d7fa62294c401ca'),
