(1195, 1752555462, 1, 'BE', 8, 0, 14, 'tx_news_domain_model_news', '{\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"hidden\":\"0\",\"istopnews\":\"0\",\"editlock\":0,\"path_segment\":\"ab-august-ist-es-soweit-wir-eroeffnen-unseren-eigenen-padel-court\",\"sitemap_priority\":\"0.5\",\"pid\":30,\"type\":\"0\",\"title\":\"Ab August ist es soweit \\u2013 wir er\\u00f6ffnen unseren eigenen Padel-Court!\",\"teaser\":\"Padel ist noch eine relativ junge Sportart, die in den 1960er Jahren in Mexiko entstand und sich seitdem weltweit verbreitet hat. Der neue Trendsport ist eine Mischung aus Tennis & Squash und begeistert nun ganz Europa. Mit der Einf\\u00fchrung des neuen Padel Courts erweitert der TSV Ladbergen sein Sportangebot und er\\u00f6ffnet die M\\u00f6glichkeit, eine innovative und aufregende Sportart zu entdecken.\",\"datetime\":1752554973,\"archive\":0,\"bodytext\":\"<p><span style=\\\"color:#408844;\\\"><strong>NEU beim TSV Ladbergen: Padel kommt<\\/strong><\\/span><\\/p>\\r\\n<p><strong>Ladbergen, der 15.07.2025: <\\/strong>Ab August ist es soweit \\u2013 wir er\\u00f6ffnen unseren eigenen Padel-Court!&nbsp;<\\/p>\\r\\n<p>Aber was ist genau Padel? Padel ist noch eine relativ junge Sportart, die in den 1960er Jahren in Mexiko entstand und sich seitdem weltweit verbreitet hat. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash und begeistert nun ganz Europa. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz ist und von W\\u00e4nden umgeben ist. Die Spieler verwenden spezielle Schl\\u00e4ger ohne Saiten und einen drucklosen Ball. Padel ist bekannt f\\u00fcr seine schnellen Ballwechsel und die Einbeziehung der W\\u00e4nde ins Spiel, was zus\\u00e4tzliche strategische Elemente einbringt.<\\/p>\\r\\n<p>Padel wird im Doppel gespielt, das hei\\u00dft, zwei Spieler treten gegen zwei andere Spieler an. Das Spiel beginnt mit einem Aufschlag, der unter H\\u00fcfth\\u00f6he erfolgen muss. Der Ball darf den Boden nur einmal ber\\u00fchren und kann danach von den W\\u00e4nden abprallen. Punkte werden \\u00e4hnlich wie beim Tennis gez\\u00e4hlt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erh\\u00e4lt den Punkt.<\\/p>\\r\\n<p>Padel ist sehr leicht zu erlernen und auch f\\u00fcr Anf\\u00e4nger geeignet, die soziale Interaktion durch das Doppelspiel wird gef\\u00f6rdert und bietet eine sehr spannende und mitrei\\u00dfende Spielweise bietet.&nbsp;<\\/p>\\r\\n<p>Mit der Einf\\u00fchrung des neuen Padel Courts erweitert der TSV Ladbergen sein Sportangebot und er\\u00f6ffnet die M\\u00f6glichkeit, eine innovative und aufregende Sportart zu entdecken. Wir hoffen, dass viele Bewohner von Ladbergen und Umgebung diese Gelegenheit nutzen und die Freude am Padelsport erleben werden. Bleibt informiert \\u00fcber unsere Homepage und Social-Media-Kan\\u00e4le, um die neuesten Updates und Veranstaltungshinweise zu erhalten.<\\/p>\",\"categories\":\"1\",\"related\":\"0\",\"tags\":\"0\",\"author\":\"\",\"author_email\":\"\",\"keywords\":\"\",\"description\":\"\",\"alternative_title\":\"\",\"sitemap_changefreq\":\"\",\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"notes\":\"\",\"crdate\":1752555462,\"t3ver_stage\":0,\"tstamp\":1752555462,\"uid\":14}', 0, '0400$b9235df3749f4579bd90fb92367bcb9a:c4df3248ab1f66dd5e0277da2fc121b2');
