(1205, 1753091819, 2, 'BE', 1, 0, 11, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p>Zur Zeit haben wir ca. 220 Mitglieder, in allen Altersklassen von 4 Jahren bis 80 Jahren. Wir spielen auf sechs gepflegten Sandpl\\u00e4tzen von April bis November. Auf unserer Anlage befindet sich ein modernes Clubhaus mit einer gro\\u00dfen Terrasse, die f\\u00fcr Vereinsveranstaltungen, sowie f\\u00fcr private Feiern der Vereinsmitgliedern genutzt wird. F\\u00fcr Zuschauer befindet sich eine weitere Terrasse direkt an den Spielfeldern.<\\/p>\\r\\n<p>Unser Verein ist von vielen Angeboten und Veranstaltungen f\\u00fcr jung und alt gepr\\u00e4gt.<\\/p>\\r\\n<p>F\\u00fcr Kinder und Jugendliche bieten wir Ballschulen, Kleinfeld- Tennistraining und Tennistraining \\u00fcber das ganze Jahr an. F\\u00fcr Erwachsene bieten wir Einzel,- oder auch Gruppentraining an. Das Training wird von professionellen Trainern durchgef\\u00fchrt.<\\/p>\\r\\n<p>F\\u00fcr alle, die noch nicht wissen, ob der Tennissport das richtige f\\u00fcr ihn ist, gibt es die M\\u00f6glichkeit an einem Schnuppertraining teilzunehmen, auch ohne Mitgliedschaft im TSV. Ebenfalls werden f\\u00fcr Erwachsene, Mixedturniere zum Saisonstart, zu Pfingsten, zum Neujahr gespielt. Hier sind auch neue Mitglieder und auch Anf\\u00e4nger herzlich willkommen.<\\/p>\\r\\n<p>In den Sommermonaten werden vereinsintern Meisterschaften im Jugend-, Damen- und Herrenbereich als Einzel und Doppel ausgetragen, was nach den Endspielen auch geb\\u00fchrend gefeiert wird. Nat\\u00fcrlich sind wir auch im Leistungsbereich mit Kindern und Erwachsenen dabei und nehmen an WTV Meisterschaftsspielen teil.<\\/p>\\r\\n<p>Der pers\\u00f6nliche Kontakt zu unseren Mitgliedern ist uns wichtig. Unser Vorstandsteam ist jederzeit f\\u00fcr Mitglieder und Interessierte ansprechbar und beantwortet gerne Fragen zum Verein und unseren Angeboten.<\\/p>\\r\\n<p>Willst du Teil unserer Tennisabteilung werden? Wir freuen uns auf Dich.<\\/p>\\r\\n\\r\\n<p>TSV- Tennisabteilung<br \\/>1. Vorsitzender<br \\/>Rainer Jendroska<\\/p>\\r\\n\\r\\n\\r\\n\",\"l18n_diffsource\":\"{\\\"CType\\\":\\\"\\\",\\\"colPos\\\":\\\"\\\",\\\"header\\\":\\\"\\\",\\\"header_layout\\\":\\\"\\\",\\\"header_position\\\":\\\"\\\",\\\"date\\\":\\\"\\\",\\\"header_link\\\":\\\"\\\",\\\"subheader\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"image\\\":\\\"\\\",\\\"imagewidth\\\":\\\"\\\",\\\"imageheight\\\":\\\"\\\",\\\"imageborder\\\":\\\"\\\",\\\"imageorient\\\":\\\"\\\",\\\"imagecols\\\":\\\"\\\",\\\"image_zoom\\\":\\\"\\\",\\\"layout\\\":\\\"\\\",\\\"frame_class\\\":\\\"\\\",\\\"space_before_class\\\":\\\"\\\",\\\"space_after_class\\\":\\\"\\\",\\\"sectionIndex\\\":\\\"\\\",\\\"linkToTop\\\":\\\"\\\",\\\"categories\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"editlock\\\":\\\"\\\",\\\"rowDescription\\\":\\\"\\\"}\"},\"newRecord\":{\"bodytext\":\"<p>Zur Zeit haben wir ca. 220 Mitglieder, in allen Altersklassen von 4 Jahren bis 80 Jahren. Wir spielen auf sechs gepflegten Sandpl\\u00e4tzen von April bis November. Auf unserer Anlage befindet sich ein modernes Clubhaus mit einer gro\\u00dfen Terrasse, die f\\u00fcr Vereinsveranstaltungen, sowie f\\u00fcr private Feiern der Vereinsmitgliedern genutzt wird. F\\u00fcr Zuschauer befindet sich eine weitere Terrasse direkt an den Spielfeldern.<\\/p>\\r\\n<p>Unser Verein ist von vielen Angeboten und Veranstaltungen f\\u00fcr jung und alt gepr\\u00e4gt.<\\/p>\\r\\n<p>F\\u00fcr Kinder und Jugendliche bieten wir Ballschulen, Kleinfeld- Tennistraining und Tennistraining \\u00fcber das ganze Jahr an. F\\u00fcr Erwachsene bieten wir Einzel,- oder auch Gruppentraining an. Das Training wird von professionellen Trainern durchgef\\u00fchrt.<\\/p>\\r\\n<p>F\\u00fcr alle, die noch nicht wissen, ob der Tennissport das richtige f\\u00fcr ihn ist, gibt es die M\\u00f6glichkeit an einem Schnuppertraining teilzunehmen, auch ohne Mitgliedschaft im TSV. Ebenfalls werden f\\u00fcr Erwachsene, Mixedturniere zum Saisonstart, zu Pfingsten, zum Neujahr gespielt. Hier sind auch neue Mitglieder und auch Anf\\u00e4nger herzlich willkommen.<\\/p>\\r\\n<p>In den Sommermonaten werden vereinsintern Meisterschaften im Jugend-, Damen- und Herrenbereich als Einzel und Doppel ausgetragen, was nach den Endspielen auch geb\\u00fchrend gefeiert wird. Nat\\u00fcrlich sind wir auch im Leistungsbereich mit Kindern und Erwachsenen dabei und nehmen an WTV Meisterschaftsspielen teil.<\\/p>\\r\\n<p>Der pers\\u00f6nliche Kontakt zu unseren Mitgliedern ist uns wichtig. Unser Vorstandsteam ist jederzeit f\\u00fcr Mitglieder und Interessierte ansprechbar und beantwortet gerne Fragen zum Verein und unseren Angeboten.<\\/p>\\r\\n<p>Willst du Teil unserer Tennisabteilung werden? Wir freuen uns auf Dich.<\\/p>\\r\\n\\r\\n<p>TSV-Tennisabteilung<br \\/>1. Vorsitzender<br \\/>Rainer Jendroska<\\/p>\\r\\n\\r\\n\\r\\n\",\"l18n_diffsource\":\"{\\\"CType\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"categories\\\":\\\"\\\",\\\"colPos\\\":\\\"\\\",\\\"date\\\":\\\"\\\",\\\"editlock\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"frame_class\\\":\\\"\\\",\\\"header\\\":\\\"\\\",\\\"header_layout\\\":\\\"\\\",\\\"header_link\\\":\\\"\\\",\\\"header_position\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"image\\\":\\\"\\\",\\\"image_zoom\\\":\\\"\\\",\\\"imageborder\\\":\\\"\\\",\\\"imagecols\\\":\\\"\\\",\\\"imageheight\\\":\\\"\\\",\\\"imageorient\\\":\\\"\\\",\\\"imagewidth\\\":\\\"\\\",\\\"layout\\\":\\\"\\\",\\\"linkToTop\\\":\\\"\\\",\\\"rowDescription\\\":\\\"\\\",\\\"sectionIndex\\\":\\\"\\\",\\\"space_after_class\\\":\\\"\\\",\\\"space_before_class\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"subheader\\\":\\\"\\\"}\"}}', 0, '0400$411147029aed52ee2a5a63c5bde2d27b:7a14c618500ae24604910dfdd2f8ff12'),
(1206, 1753118623, 2, 'BE', 1, 0, 65, 'tt_content', '{\"oldRecord\":{\"CType\":\"textpic\",\"header\":\"\",\"bodytext\":\"<p>Momentan sind wir in der Bauphase f\\u00fcr einen Padel-Court, so dass wir voraussichtlich ab August 2025 eine Buchungsplattform daf\\u00fcr anbieten k\\u00f6nnen.<\\/p>\",\"l18n_diffsource\":\"{\\\"CType\\\":\\\"\\\",\\\"colPos\\\":\\\"\\\",\\\"header\\\":\\\"\\\",\\\"header_layout\\\":\\\"\\\",\\\"header_position\\\":\\\"\\\",\\\"date\\\":\\\"\\\",\\\"header_link\\\":\\\"\\\",\\\"subheader\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"image\\\":\\\"\\\",\\\"imagewidth\\\":\\\"\\\",\\\"imageheight\\\":\\\"\\\",\\\"imageborder\\\":\\\"\\\",\\\"imageorient\\\":\\\"\\\",\\\"imagecols\\\":\\\"\\\",\\\"image_zoom\\\":\\\"\\\",\\\"layout\\\":\\\"\\\",\\\"frame_class\\\":\\\"\\\",\\\"space_before_class\\\":\\\"\\\",\\\"space_after_class\\\":\\\"\\\",\\\"sectionIndex\\\":\\\"\\\",\\\"linkToTop\\\":\\\"\\\",\\\"categories\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"editlock\\\":\\\"\\\",\\\"rowDescription\\\":\\\"\\\"}\"},\"newRecord\":{\"CType\":\"text\",\"header\":\"Trendsportart Padel nun auch beim TSV Ladbergen m\\u00f6glich!\",\"bodytext\":\"<p>Ab sofort bieten wir allen Mitgliedern und Sportbegeisterten Padel als neue, spannende Sportart auf unserem Tennis Vereinsgel\\u00e4nde an. Padel ist ein dynamischer R\\u00fcckschlagsport, der Elemente aus Tennis und Squash kombiniert \\u2013 ideal f\\u00fcr Anf\\u00e4nger*innen wie Fortgeschrittene, ob jung oder alt. Erfahre mehr zur Trendsportart in <a href=\\\"https:\\/\\/youtube.com\\/watch?v=O_yQQMu7iK8&amp;si=fsQyRd-LTGOWdBdO\\\" title=\\\"Mehr zu Padel\\\">diesem Video.<\\/a><\\/p>\",\"l18n_diffsource\":\"{\\\"CType\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"categories\\\":\\\"\\\",\\\"colPos\\\":\\\"\\\",\\\"date\\\":\\\"\\\",\\\"editlock\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"frame_class\\\":\\\"\\\",\\\"header\\\":\\\"\\\",\\\"header_layout\\\":\\\"\\\",\\\"header_link\\\":\\\"\\\",\\\"header_position\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"image\\\":\\\"\\\",\\\"image_zoom\\\":\\\"\\\",\\\"imageborder\\\":\\\"\\\",\\\"imagecols\\\":\\\"\\\",\\\"imageheight\\\":\\\"\\\",\\\"imageorient\\\":\\\"\\\",\\\"imagewidth\\\":\\\"\\\",\\\"layout\\\":\\\"\\\",\\\"linkToTop\\\":\\\"\\\",\\\"rowDescription\\\":\\\"\\\",\\\"sectionIndex\\\":\\\"\\\",\\\"space_after_class\\\":\\\"\\\",\\\"space_before_class\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"subheader\\\":\\\"\\\"}\"}}', 0, '0400$5eda6db829d6444519d1bf48167e06d0:e08526b91530e5e31740873db49cb482'),
