(1229, 1753120517, 1, 'BE', 1, 0, 75, 'tt_content', '{\"CType\":\"text\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"small\",\"colPos\":\"1\",\"date\":0,\"header_layout\":\"3\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"0\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":\"1\",\"hidden\":\"0\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"pid\":39,\"sorting\":448,\"header\":\"Was ist Padel?\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<p>Padel (auch \\u201ePadel-Tennis\\u201c) ist eine der am schnellsten wachsenden Sportarten Europas. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz und von W\\u00e4nden umgeben ist. Padel ist leicht zu erlernen, f\\u00fcr jedes Alter und jeden Fitnesszustand geeignet, macht von der ersten Minute an Spa\\u00df und ist durch das kleinere Feld besonders kommunikativ.<\\/p>\\r\\n<p><strong>Die wichtigsten Merkmale:<\\/strong><\\/p>\\r\\n<ul><li>Gespielt wird \\u00fcblicherweise im Doppel (2 gegen 2).<\\/li><li>Der Schl\\u00e4ger ist k\\u00fcrzer, ohne Saiten und hat eine feste Schlagfl\\u00e4che mit L\\u00f6chern.<\\/li><li>Die B\\u00e4lle \\u00e4hneln Tennisb\\u00e4llen, sind aber etwas weniger druckvoll.<\\/li><li>Die W\\u00e4nde d\\u00fcrfen \\u2013 nach dem Aufprall auf dem Boden \\u2013 ins Spiel einbezogen werden.<\\/li><li>Punkte werden \\u00e4hnlich wie beim Tennis gez\\u00e4hlt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erh\\u00e4lt den Punkt.<\\/li><\\/ul>\",\"linkToTop\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1753120517,\"t3ver_stage\":0,\"tstamp\":1753120517,\"uid\":75}', 0, '0400$8c4e7d83b762739c95325666c08d9d57:01f68e9d48ad1c90c1083aea60fbf5bf'),
