(1233, 1753120902, 1, 'BE', 1, 0, 45, 'pages', '{\"doktype\":\"1\",\"slug\":\"\\/padel\\/faq\",\"categories\":\"0\",\"layout\":\"0\",\"lastUpdated\":0,\"newUntil\":0,\"cache_timeout\":\"0\",\"shortcut\":0,\"shortcut_mode\":\"0\",\"content_from_pid\":0,\"mount_pid\":0,\"module\":\"\",\"hidden\":1,\"starttime\":0,\"endtime\":0,\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"sitemap_priority\":\"0.5\",\"twitter_card\":\"\",\"pid\":39,\"sorting\":384,\"perms_userid\":1,\"perms_groupid\":0,\"perms_user\":31,\"perms_group\":27,\"perms_everybody\":0,\"title\":\"FAQ\",\"sys_language_uid\":0,\"crdate\":1753120902,\"t3ver_stage\":0,\"tstamp\":1753120902,\"uid\":45}', 0, '0400$8b4c1fefd16429a148c41ff03d6f3989:d5c8a0c399b70b593af4e702ea1ff918'),
