(1251, 1753122039, 2, 'BE', 1, 0, 75, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p>Padel (auch \\u201ePadel-Tennis\\u201c) ist eine der am schnellsten wachsenden Sportarten Europas. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz und von W\\u00e4nden umgeben ist. Padel ist leicht zu erlernen, f\\u00fcr jedes Alter und jeden Fitnesszustand geeignet, macht von der ersten Minute an Spa\\u00df und ist durch das kleinere Feld besonders kommunikativ.<\\/p>\\r\\n<p><strong>Die wichtigsten Merkmale:<\\/strong><\\/p>\\r\\n<ul><li>Gespielt wird \\u00fcblicherweise im Doppel (2 gegen 2).<\\/li><li>Der Schl\\u00e4ger ist k\\u00fcrzer, ohne Saiten und hat eine feste Schlagfl\\u00e4che mit L\\u00f6chern.<\\/li><li>Die B\\u00e4lle \\u00e4hneln Tennisb\\u00e4llen, sind aber etwas weniger druckvoll.<\\/li><li>Die W\\u00e4nde d\\u00fcrfen \\u2013 nach dem Aufprall auf dem Boden \\u2013 ins Spiel einbezogen werden.<\\/li><li>Punkte werden \\u00e4hnlich wie beim Tennis gez\\u00e4hlt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erh\\u00e4lt den Punkt.<\\/li><\\/ul>\"},\"newRecord\":{\"bodytext\":\"<p>Padel (auch \\u201ePadel-Tennis\\u201c) ist eine der am schnellsten wachsenden Sportarten Europas. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz und von W\\u00e4nden umgeben ist. Padel ist leicht zu erlernen, f\\u00fcr jedes Alter und jeden Fitnesszustand geeignet, macht von der ersten Minute an Spa\\u00df und ist durch das kleinere Feld besonders kommunikativ.<\\/p>\\r\\n<p><strong>Die wichtigsten Merkmale:<\\/strong><\\/p>\\r\\n<ul><li>Gespielt wird \\u00fcblicherweise im Doppel (2 gegen 2).<\\/li><li>Der Schl\\u00e4ger ist k\\u00fcrzer, ohne Saiten und hat eine feste Schlagfl\\u00e4che mit L\\u00f6chern.<\\/li><li>Die B\\u00e4lle \\u00e4hneln Tennisb\\u00e4llen, sind aber etwas weniger druckvoll.<\\/li><li>Die W\\u00e4nde d\\u00fcrfen \\u2013 nach dem Aufprall auf dem Boden \\u2013 ins Spiel einbezogen werden.<\\/li><li>Punkte werden \\u00e4hnlich wie beim Tennis gez\\u00e4hlt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erh\\u00e4lt den Punkt.<\\/li><\\/ul>\\r\\n<h3><strong>Jetzt Platz buchen &gt;&gt;<\\/strong><\\/h3>\"}}', 0, '0400$9a674aacb9c6e40c2cc274b46efd415c:01f68e9d48ad1c90c1083aea60fbf5bf'),
