(1256, 1753122131, 2, 'BE', 1, 0, 75, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p>Padel (auch \\u201ePadel-Tennis\\u201c) ist eine der am schnellsten wachsenden Sportarten Europas. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz und von W\\u00e4nden umgeben ist. Padel ist leicht zu erlernen, f\\u00fcr jedes Alter und jeden Fitnesszustand geeignet, macht von der ersten Minute an Spa\\u00df und ist durch das kleinere Feld besonders kommunikativ.<\\/p>\\r\\n<p><strong>Die wichtigsten Merkmale:<\\/strong><\\/p>\\r\\n<ul><li>Gespielt wird \\u00fcblicherweise im Doppel (2 gegen 2).<\\/li><li>Der Schl\\u00e4ger ist k\\u00fcrzer, ohne Saiten und hat eine feste Schlagfl\\u00e4che mit L\\u00f6chern.<\\/li><li>Die B\\u00e4lle \\u00e4hneln Tennisb\\u00e4llen, sind aber etwas weniger druckvoll.<\\/li><li>Die W\\u00e4nde d\\u00fcrfen \\u2013 nach dem Aufprall auf dem Boden \\u2013 ins Spiel einbezogen werden.<\\/li><li><p>Punkte werden \\u00e4hnlich wie beim Tennis gez\\u00e4hlt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erh\\u00e4lt den Punkt.<\\/p><p>&nbsp;<\\/p><\\/li><\\/ul>\\r\\n<h4 class=\\\"text-end\\\"><strong>Jetzt Platz buchen &gt;&gt;<\\/strong><\\/h4>\"},\"newRecord\":{\"bodytext\":\"<p>Padel (auch \\u201ePadel-Tennis\\u201c) ist eine der am schnellsten wachsenden Sportarten Europas. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz und von W\\u00e4nden umgeben ist. Padel ist leicht zu erlernen, f\\u00fcr jedes Alter und jeden Fitnesszustand geeignet, macht von der ersten Minute an Spa\\u00df und ist durch das kleinere Feld besonders kommunikativ.<\\/p>\\r\\n<p><strong>Die wichtigsten Merkmale:<\\/strong><\\/p>\\r\\n<ul><li>Gespielt wird \\u00fcblicherweise im Doppel (2 gegen 2).<\\/li><li>Der Schl\\u00e4ger ist k\\u00fcrzer, ohne Saiten und hat eine feste Schlagfl\\u00e4che mit L\\u00f6chern.<\\/li><li>Die B\\u00e4lle \\u00e4hneln Tennisb\\u00e4llen, sind aber etwas weniger druckvoll.<\\/li><li>Die W\\u00e4nde d\\u00fcrfen \\u2013 nach dem Aufprall auf dem Boden \\u2013 ins Spiel einbezogen werden.<\\/li><li><p>Punkte werden \\u00e4hnlich wie beim Tennis gez\\u00e4hlt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erh\\u00e4lt den Punkt.<\\/p><p>&nbsp;<\\/p><\\/li><\\/ul>\\r\\n<h4 class=\\\"text-end\\\"><a href=\\\"t3:\\/\\/page?uid=43\\\"><strong>Jetzt Platz buchen &gt;&gt;<\\/strong><\\/a><\\/h4>\"}}', 0, '0400$6d8a7adf3ff7cfd1e40a6c52dc0067f2:01f68e9d48ad1c90c1083aea60fbf5bf'),
(1257, 1753122462, 2, 'BE', 1, 0, 76, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p><strong>Muss ich Mitglied beim TSV Ladbergen sein, um den Platz zu buchen?<\\/strong><\\/p>\\r\\n<p>Nein, auch G\\u00e4ste k\\u00f6nnen den Court buchen. Alle TSV Mitglieder k\\u00f6nnen den Sport bis zum 31.12.2025 kostenlos spielen. Wenn Du bereits TSV Tennis-Mitglied bist, kannst Du ab dem 01.01.2026 auch weiterhin den Padel Court kostenfrei nutzen.<br \\/>&nbsp;<\\/p>\\r\\n<p><strong>Ich m\\u00f6chte regelm\\u00e4\\u00dfig spielen und nicht immer einzeln zahlen m\\u00fcssen. Bietet ihr eine \\u201eFlatrate\\u201c an?<\\/strong><\\/p>\\r\\n<p>Ja. Als TSV Mitglied mit einem Zusatzbeitrag f\\u00fcr Padel kannst Du so oft spielen, wie Du m\\u00f6chtest. \\u00dcber diesen Antrag kannst Du ganz TSV Mitglied werden und\\/oder die zus\\u00e4tzliche Padel-Flatrate dazu buchen. <span style=\\\"color:#0563c1;\\\"><u>Link zum Digitalen Mitgliedsantrag<\\/u><\\/span><\\/p>\\r\\n\\r\\n<p><strong>Wie viele Spieler*innen braucht man f\\u00fcr eine Partie?<\\/strong><\\/p>\\r\\n<p>Padel wird standardm\\u00e4\\u00dfig als Doppel, also mit 4 Spieler*innen gespielt.<\\/p>\\r\\n\\r\\n<p><strong>Ben\\u00f6tige ich eigene Ausr\\u00fcstung?<\\/strong><\\/p>\\r\\n<p>Nein, Schl\\u00e4ger und B\\u00e4lle stellt der TSV kostenlos im Eingangsbereich der Umkleidekabinen bereit. Zugang zu den Kabinen erh\\u00e4ltst Du nach erfolgter Buchung. Eine eigene Ausr\\u00fcstung darf selbstverst\\u00e4ndlich mitgebracht werden.<\\/p>\\r\\n\\r\\n<p><strong>Welches Schuhwerk wird empfohlen?<\\/strong><\\/p>\\r\\n<p>Es wird auf Kunstrasen gespielt. Ideal sind Tennisschuhe mit Fischgr\\u00e4tprofil oder spezielle Padelschuhe. Zum Einstieg sind jedoch auch herk\\u00f6mmliche Sportschuhe ausreichend.<br \\/>&nbsp;<\\/p>\\r\\n<p><strong>Wie lange dauert eine Spielzeit?<\\/strong><\\/p>\\r\\n<p>Die Buchungseinheit betr\\u00e4gt 60 Minuten. L\\u00e4ngere Spielzeiten sind je nach Verf\\u00fcgbarkeit m\\u00f6glich.<br \\/>&nbsp;<\\/p>\\r\\n<p><strong>Was kostet eine Stunde auf dem Court f\\u00fcr Gastspieler?<\\/strong><\\/p>\\r\\n<p>Im Zeitraum von montags bis freitags bis jeweils 16 Uhr betr\\u00e4gt der Preis 20 \\u20ac f\\u00fcr 4 Gastspieler. F\\u00fcr alle anderen Zeiten werden 28 \\u20ac f\\u00e4llig.<br \\/>&nbsp;<\\/p>\\r\\n<p><strong>Wie erfolgt die Preisermittlung, wenn sowohl TSV-Mitglieder als auch G\\u00e4ste zusammen spielen wollen?<\\/strong><\\/p>\\r\\n<p>Bei der Buchung sind stets alle 4 Spieler namentlich anzugeben und eine entsprechende Mitgliedschaft zu kennzeichnen. Nichtmitglieder zahlen pro Stunde 20\\u20ac \\/4 = 5 \\u20ac bzw. zur Prime Time 28 \\u20ac \\/ 4 = 7 \\u20ac. Der Rechnungsbetrag wird so stets in Abh\\u00e4ngigkeit von der Gastspieler*innen und der gew\\u00fcnschten Uhrzeit individuell berechnet.&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Welche Bezahlm\\u00f6glichkeiten bietet ihr an?<\\/strong><\\/p>\\r\\n<p>Wenn Du Dich f\\u00fcr die TSV Mitgliedschaft inklusive Padel Flatrate entscheidest, kann der Jahresbeitrag ganz einfach per SEPA-Lastschriftmandat eingezogen werden. G\\u00e4ste k\\u00f6nnen das etablierte PayPal-Verfahren nutzen. An der Erweiterung der Bezahloptionen wird gearbeitet. Barzahlungen sind leider nicht m\\u00f6glich.&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>Gibt es eine Beleuchtung f\\u00fcr Abendspiele?<\\/strong><\\/p>\\r\\n<p>Ja! Der Platz ist mit moderner LED-Flutlichtanlage ausgestattet und auch abends bis 22 Uhr bespielbar.<\\/p>\\r\\n\\r\\n<p><strong>Wo befindet sich der Padelcourt?<\\/strong><\\/p>\\r\\n<p>Der Court befindet sich direkt auf dem Gel\\u00e4nde der TSV Tennis Abteilung, Lengericher Stra\\u00dfe 10a in Ladbergen. Parkpl\\u00e4tze sind ausreichend vorhanden.<br \\/>&nbsp;<\\/p>\\r\\n<p><strong>Kann ich den Court auch f\\u00fcr Firmenevents oder Gruppenangebote mieten?<\\/strong><\\/p>\\r\\n<p>Ja! Gerne bieten wir bieten individuelle Angebote f\\u00fcr Gruppen, Firmen oder Schulklassen an. Kontaktiert dazu gerne den angegebenen Padel-Ansprechpartner.<\\/p>\",\"l18n_diffsource\":\"\"},\"newRecord\":{\"bodytext\":\"<p><strong>Muss ich Mitglied beim TSV Ladbergen sein, um den Platz zu buchen?<\\/strong><\\/p>\\r\\n<p>Nein, auch G\\u00e4ste k\\u00f6nnen den Court buchen. Alle TSV Mitglieder k\\u00f6nnen den Sport bis zum 31.12.2025 kostenlos spielen. Wenn Du bereits TSV Tennis-Mitglied bist, kannst Du ab dem 01.01.2026 auch weiterhin den Padel Court kostenfrei nutzen.<br \\/>&nbsp;<\\/p>\\r\\n<p><strong>Ich m\\u00f6chte regelm\\u00e4\\u00dfig spielen und nicht immer einzeln zahlen m\\u00fcssen. Bietet ihr eine \\u201eFlatrate\\u201c an?<\\/strong><\\/p>\\r\\n<p>Ja. Als TSV Mitglied mit einem Zusatzbeitrag f\\u00fcr Padel kannst Du so oft spielen, wie Du m\\u00f6chtest. \\u00dcber diesen Antrag kannst Du ganz TSV Mitglied werden und\\/oder die zus\\u00e4tzliche Padel-Flatrate dazu buchen.&nbsp;<\\/p>\\r\\n<p><a href=\\\"t3:\\/\\/page?uid=11#72\\\"><span style=\\\"color:#0563c1;\\\"><u>Zum Digitalen Mitgliedsantrag<\\/u><\\/span><\\/a><\\/p>\\r\\n\\r\\n<p><strong>Wie viele Spieler*innen braucht man f\\u00fcr eine Partie?<\\/strong><\\/p>\\r\\n<p>Padel wird standardm\\u00e4\\u00dfig als Doppel, also mit 4 Spieler*innen gespielt.<\\/p>\\r\\n\\r\\n<p><strong>Ben\\u00f6tige ich eigene Ausr\\u00fcstung?<\\/strong><\\/p>\\r\\n<p>Nein, Schl\\u00e4ger und B\\u00e4lle stellt der TSV kostenlos im Eingangsbereich der Umkleidekabinen bereit. Zugang zu den Kabinen erh\\u00e4ltst Du nach erfolgter Buchung. Eine eigene Ausr\\u00fcstung darf selbstverst\\u00e4ndlich mitgebracht werden.<\\/p>\\r\\n\\r\\n<p><strong>Welches Schuhwerk wird empfohlen?<\\/strong><\\/p>\\r\\n<p>Es wird auf Kunstrasen gespielt. Ideal sind Tennisschuhe mit Fischgr\\u00e4tprofil oder spezielle Padelschuhe. Zum Einstieg sind jedoch auch herk\\u00f6mmliche Sportschuhe ausreichend.<br \\/>&nbsp;<\\/p>\\r\\n<p><strong>Wie lange dauert eine Spielzeit?<\\/strong><\\/p>\\r\\n<p>Die Buchungseinheit betr\\u00e4gt 60 Minuten. L\\u00e4ngere Spielze