en wir bieten individuelle Angebote f\\u00fcr Gruppen, Firmen oder Schulklassen an. Kontaktiert dazu gerne den angegebenen Padel-Ansprechpartner.<\\/p>\"}}', 0, '0400$88a7065488b7efa592f96cc3ecd60d18:da6a75c189a82195cd10601da079c94c'),
