(1265, 1753123612, 2, 'BE', 1, 0, 73, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p>\\u00dcber unser Online-Buchungssystem kann jeder, sowohl TSV Mitglied als auch Gastspieler, einfach und flexibel Spielzeiten reservieren. Besonderes Bonbon: Alle TSV Mitglieder k\\u00f6nnen bis zum 31.12.2025 die neue Sportart kostenlos erproben.<\\/p>\"},\"newRecord\":{\"bodytext\":\"<p>\\u00dcber unser Online-Buchungssystem kann jeder, sowohl TSV Mitglied als auch Gastspieler, einfach und flexibel Spielzeiten reservieren. <strong>Besonderes Bonbon: Alle TSV Mitglieder k\\u00f6nnen bis zum 31.12.2025 die neue Sportart kostenlos erproben.<\\/strong><\\/p>\"}}', 0, '0400$d01dff018065deb53baff868a82460e3:86adf7cdd54d1fb03c0b7bd8e5782d95'),
(1266, 1753123875, 2, 'BE', 1, 0, 75, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p>Padel (auch \\u201ePadel-Tennis\\u201c) ist eine der am schnellsten wachsenden Sportarten Europas. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz und von W\\u00e4nden umgeben ist. Padel ist leicht zu erlernen, f\\u00fcr jedes Alter und jeden Fitnesszustand geeignet, macht von der ersten Minute an Spa\\u00df und ist durch das kleinere Feld besonders kommunikativ.<\\/p>\\r\\n<p><strong>Die wichtigsten Merkmale:<\\/strong><\\/p>\\r\\n<ul><li>Gespielt wird \\u00fcblicherweise im Doppel (2 gegen 2).<\\/li><li>Der Schl\\u00e4ger ist k\\u00fcrzer, ohne Saiten und hat eine feste Schlagfl\\u00e4che mit L\\u00f6chern.<\\/li><li>Die B\\u00e4lle \\u00e4hneln Tennisb\\u00e4llen, sind aber etwas weniger druckvoll.<\\/li><li>Die W\\u00e4nde d\\u00fcrfen \\u2013 nach dem Aufprall auf dem Boden \\u2013 ins Spiel einbezogen werden.<\\/li><li><p>Punkte werden \\u00e4hnlich wie beim Tennis gez\\u00e4hlt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erh\\u00e4lt den Punkt.<\\/p><p>&nbsp;<\\/p><\\/li><\\/ul>\\r\\n<h4 class=\\\"text-end\\\"><a href=\\\"t3:\\/\\/page?uid=43\\\"><strong>Jetzt Platz buchen &gt;&gt;<\\/strong><\\/a><\\/h4>\"},\"newRecord\":{\"bodytext\":\"<p>Padel (auch \\u201ePadel-Tennis\\u201c) ist eine der am schnellsten wachsenden Sportarten Europas. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz und von W\\u00e4nden umgeben ist. Padel ist leicht zu erlernen, f\\u00fcr jedes Alter und jeden Fitnesszustand geeignet, macht von der ersten Minute an Spa\\u00df und ist durch das kleinere Feld besonders kommunikativ.<\\/p>\\r\\n<p><strong>Die wichtigsten Merkmale:<\\/strong><\\/p>\\r\\n<ul><li>Gespielt wird \\u00fcblicherweise im Doppel (2 gegen 2).<\\/li><li>Der Schl\\u00e4ger ist k\\u00fcrzer, ohne Saiten und hat eine feste Schlagfl\\u00e4che mit L\\u00f6chern.<\\/li><li>Die B\\u00e4lle \\u00e4hneln Tennisb\\u00e4llen, sind aber etwas weniger druckvoll.<\\/li><li>Die W\\u00e4nde d\\u00fcrfen \\u2013 nach dem Aufprall auf dem Boden \\u2013 ins Spiel einbezogen werden.<\\/li><li>Punkte werden \\u00e4hnlich wie beim Tennis gez\\u00e4hlt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erh\\u00e4lt den Punkt.<\\/li><\\/ul>\\r\\n<h4 class=\\\"text-end\\\"><a href=\\\"t3:\\/\\/page?uid=43\\\"><strong>Jetzt Platz buchen &gt;&gt;<\\/strong><\\/a><\\/h4>\"}}', 0, '0400$1246ed0186aa9550362064836fa8c238:01f68e9d48ad1c90c1083aea60fbf5bf'),
(1267, 1753124012, 2, 'BE', 1, 0, 75, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p>Padel (auch \\u201ePadel-Tennis\\u201c) ist eine der am schnellsten wachsenden Sportarten Europas. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz und von W\\u00e4nden umgeben ist. Padel ist leicht zu erlernen, f\\u00fcr jedes Alter und jeden Fitnesszustand geeignet, macht von der ersten Minute an Spa\\u00df und ist durch das kleinere Feld besonders kommunikativ.<\\/p>\\r\\n<p><strong>Die wichtigsten Merkmale:<\\/strong><\\/p>\\r\\n<ul><li>Gespielt wird \\u00fcblicherweise im Doppel (2 gegen 2).<\\/li><li>Der Schl\\u00e4ger ist k\\u00fcrzer, ohne Saiten und hat eine feste Schlagfl\\u00e4che mit L\\u00f6chern.<\\/li><li>Die B\\u00e4lle \\u00e4hneln Tennisb\\u00e4llen, sind aber etwas weniger druckvoll.<\\/li><li>Die W\\u00e4nde d\\u00fcrfen \\u2013 nach dem Aufprall auf dem Boden \\u2013 ins Spiel einbezogen werden.<\\/li><li>Punkte werden \\u00e4hnlich wie beim Tennis gez\\u00e4hlt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erh\\u00e4lt den Punkt.<\\/li><\\/ul>\\r\\n<h4 class=\\\"text-end\\\"><a href=\\\"t3:\\/\\/page?uid=43\\\"><strong>Jetzt Platz buchen &gt;&gt;<\\/strong><\\/a><\\/h4>\"},\"newRecord\":{\"bodytext\":\"<p>Padel (auch \\u201ePadel-Tennis\\u201c) ist eine der am schnellsten wachsenden Sportarten Europas. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz und von W\\u00e4nden umgeben ist. Padel ist leicht zu erlernen, f\\u00fcr jedes Alter und jeden Fitnesszustand geeignet, macht von der ersten Minute an Spa\\u00df und ist durch das kleinere Feld besonders kommunikativ.<\\/p>\\r\\n\\r\\n<p><strong>Die wichtigsten Merkmale:<\\/strong><\\/p>\\r\\n<ul><li>Gespielt wird \\u00fcblicherweise im Doppel (2 gegen 2).<\\/li><li>Der Schl\\u00e4ger ist k\\u00fcrzer, ohne Saiten und hat eine feste Schlagfl\\u00e4che mit L\\u00f6chern.<\\/li><li>Die B\\u00e4lle \\u00e4hneln Tennisb\\u00e4llen, sind aber etwas weniger druckvoll.<\\/li><li>Die W\\u00e4nde d\\u00fcrfen \\u2013 nach dem Aufprall auf dem Boden \\u2013 ins Spiel einbezogen werden.<\\/li><li>Punkte werden \\u00e4hnlich wie beim Tennis gez\\u00e4hlt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erh\\u00e4lt den Punkt.<\\/li><\\/ul>\\r\\n<h4 class=\\\"text-end\\\"><a href=\\\"t3:\\/\\/page?uid=43\\\"><strong>Jetzt Platz buchen &gt;&gt;<\\/strong><\\/a><\\/h4>\"}}', 0, '0400$fe32ca4a95cf954d266f4d1ae568ae53:01f68e9d48ad1c90c1083aea60fbf5bf'),
(1268, 1753124040, 2, 'BE', 1, 0, 75, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p>Padel (auch \\u201ePadel-Tennis\\u201c) ist eine der am schnellsten wachsenden Sportarten Europas. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz und von W\\u00e4nden umgeben ist. Padel ist leicht zu erlernen, f\\u00fcr jedes Alter und jeden Fitnesszustand geeignet, macht von der ersten Minute an Spa\\u00df und ist durch das kleinere Feld besonders kommunikativ.<\\/p>\\r\\n\\r\\n<p><strong>Die wichtigsten Merkmale:<\\/strong><\\/p>\\r\\n<ul><li>Gespielt wird \\u00fcblicherweise im Doppel (2 gegen 2).<\\/li><li>Der Schl\\u00e4ger ist k\\u00fcrzer, ohne Saiten und hat eine feste Schlagfl\\u00e4che mit L\\u00f6chern.<\\/li><li>Die B\\u00e4lle \\u00e4hneln Tennisb\\u00e4llen, sind aber etwas weniger druckvoll.<\\/li><li>Die W\\u00e4nde d\\u00fcrfen \\u2013 nach dem Aufprall auf dem Boden \\u2013 ins Spiel einbezogen werden.<\\/li><li>Punkte werden \\u00e4hnlich wie beim Tennis gez\\u00e4hlt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erh\\u00e4lt den Punkt.<\\/li><\\/ul>\\r\\n<h4 class=\\\"text-end\\\"><a href=\\\"t3:\\/\\/page?uid=43\\\"><strong>Jetzt Platz buchen &gt;&gt;<\\/strong><\\/a><\\/h4>\"},\"newRecord\":{\"bodytext\":\"<p>Padel (auch \\u201ePadel-Tennis\\u201c) ist eine der am schnellsten wachsenden Sportarten Europas. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz und von W\\u00e4nden umgeben ist. Padel ist leicht zu erlernen, f\\u00fcr jedes Alter und jeden Fitnesszustand geeignet, macht von der ersten Minute an Spa\\u00df und ist durch das kleinere Feld besonders kommunikativ.<\\/p>\\r\\n\\r\\n<p><strong>Die wichtigsten Merkmale:<\\/strong><\\/p>\\r\\n<ul><li>Gespielt wird \\u00fcblicherweise im Doppel (2 gegen 2).<\\/li><li>Der Schl\\u00e4ger ist k\\u00fcrzer, ohne Saiten und hat eine feste Schlagfl\\u00e4che mit L\\u00f6chern.<\\/li><li>Die B\\u00e4lle \\u00e4hneln Tennisb\\u00e4llen, sind aber etwas weniger druckvoll.<\\/li><li>Die W\\u00e4nde d\\u00fcrfen \\u2013 nach dem Aufprall auf dem Boden \\u2013 ins Spiel einbezogen werden.<\\/li><li>Punkte werden \\u00e4hnlich wie beim Tennis gez\\u00e4hlt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erh\\u00e4lt den Punkt.<\\/li><\\/ul>\\r\\n<p class=\\\"text-end\\\"><a href=\\\"t3:\\/\\/page?uid=43\\\"><strong>Jetzt Platz buchen &gt;&gt;<\\/strong><\\/a><\\/p>\"}}', 0, '0400$b15b4a3c906e0896438a41a381b9a6ce:01f68e9d48ad1c90c1083aea60fbf5bf'),
