(1270, 1753124168, 2, 'BE', 1, 0, 65, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p>Ab sofort bieten wir allen Mitgliedern und Sportbegeisterten Padel als neue, spannende Sportart auf unserem Tennis Vereinsgel\\u00e4nde an. Padel ist ein dynamischer R\\u00fcckschlagsport, der Elemente aus Tennis und Squash kombiniert \\u2013 ideal f\\u00fcr Anf\\u00e4nger*innen wie Fortgeschrittene, ob jung oder alt. Erfahre mehr zur Trendsportart in <a href=\\\"https:\\/\\/youtube.com\\/watch?v=O_yQQMu7iK8&amp;si=fsQyRd-LTGOWdBdO\\\" title=\\\"Mehr zu Padel\\\">diesem Video.<\\/a><\\/p>\"},\"newRecord\":{\"bodytext\":\"<p>Ab sofort bieten wir allen Mitgliedern und Sportbegeisterten Padel als neue, spannende Sportart auf unserem Tennis Vereinsgel\\u00e4nde an. Padel ist ein dynamischer R\\u00fcckschlagsport, der Elemente aus Tennis und Squash kombiniert \\u2013 ideal f\\u00fcr Anf\\u00e4nger*innen wie Fortgeschrittene, ob jung oder alt. Erfahre mehr zur Trendsportart im Video.<\\/p>\\r\\n\\r\\n<p class=\\\"text-end\\\"><a href=\\\"https:\\/\\/youtube.com\\/watch?v=O_yQQMu7iK8&amp;si=fsQyRd-LTGOWdBdO\\\" title=\\\"Weitere Inforamtionen zu Padel\\\"><strong>Zum Video &gt;&gt;<\\/strong><\\/a><\\/p>\"}}', 0, '0400$b72ce81d5852aedd38a327d414b464e0:e08526b91530e5e31740873db49cb482'),
