(1280, 1753198162, 1, 'BE', 1, 0, 1, 'tsv_accordion_collection', '{\"hidden\":\"0\",\"starttime\":0,\"endtime\":0,\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"pid\":45,\"sorting\":256,\"header\":\"Muss ich Mitglied beim TSV Ladbergen sein, um den Platz zu buchen?\",\"answer\":\"<p>Nein, auch G\\u00e4ste k\\u00f6nnen den Court buchen. Alle TSV Mitglieder k\\u00f6nnen den Sport bis zum 31.12.2025 kostenlos spielen. Wenn Du bereits TSV Tennis-Mitglied bist, kannst Du ab dem 01.01.2026 auch weiterhin den Padel Court kostenfrei nutzen.<\\/p>\",\"sys_language_uid\":0,\"fe_group\":\"\",\"editlock\":\"0\",\"crdate\":1753198162,\"tstamp\":1753198162,\"uid\":1}', 0, '0400$7c7dbf29193f08a7c3bd8e939585d444:01f44a36127a64b0abb1c58315202fb0'),
