(1283, 1753198241, 1, 'BE', 1, 0, 2, 'tsv_accordion_collection', '{\"hidden\":\"0\",\"starttime\":0,\"endtime\":0,\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"pid\":45,\"sorting\":0,\"header\":\"Ich m\\u00f6chte regelm\\u00e4\\u00dfig spielen und nicht immer einzeln zahlen m\\u00fcssen. Bietet ihr eine \\u201eFlatrate\\u201c an?\",\"answer\":\"<p>Ja. Als TSV Mitglied mit einem Zusatzbeitrag f\\u00fcr Padel kannst Du so oft spielen, wie Du m\\u00f6chtest. \\u00dcber diesen Antrag kannst Du ganz TSV Mitglied werden und\\/oder die zus\\u00e4tzliche Padel-Flatrate dazu buchen. <a href=\\\"t3:\\/\\/page?uid=11\\\"><span style=\\\"color:#0563c1;\\\"><u>Zum Mitgliedsantrag<\\/u><\\/span><\\/a><\\/p>\",\"sys_language_uid\":0,\"fe_group\":\"\",\"editlock\":\"0\",\"crdate\":1753198241,\"tstamp\":1753198241,\"uid\":2}', 0, '0400$6b0e8123ff01869553ee94d2794e36ac:f6f8f9fe847d44141e0f167a1766fef6'),
