(1291, 1753198374, 1, 'BE', 1, 0, 5, 'tsv_accordion_collection', '{\"hidden\":\"0\",\"starttime\":0,\"endtime\":0,\"l10n_parent\":0,\"l10n_diffsource\":\"\",\"pid\":45,\"sorting\":0,\"header\":\"Welches Schuhwerk wird empfohlen?\",\"answer\":\"<p>Es wird auf Kunstrasen gespielt. Ideal sind Tennisschuhe mit Fischgr\\u00e4tprofil oder spezielle Padelschuhe. Zum Einstieg sind jedoch auch herk\\u00f6mmliche Sportschuhe ausreichend.<\\/p>\",\"sys_language_uid\":0,\"fe_group\":\"\",\"editlock\":\"0\",\"crdate\":1753198374,\"tstamp\":1753198374,\"uid\":5}', 0, '0400$52b2da96f916e26e4ea9d5736cc59eff:9f40cf52b035b3a8fb2f5f4cd285ebe8'),
