INSERT INTO `tsv_accordion_collection` (`uid`, `pid`, `tstamp`, `crdate`, `deleted`, `hidden`, `starttime`, `endtime`, `fe_group`, `sorting`, `editlock`, `sys_language_uid`, `l10n_parent`, `l10n_source`, `l10n_state`, `l10n_diffsource`, `foreign_table_parent_uid`, `header`, `answer`) VALUES
(1, 45, 1753198583, 1753198162, 1, 0, 0, 0, '', 1, 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 80, 'Muss ich Mitglied beim TSV Ladbergen sein, um den Platz zu buchen?', '<p>Nein, auch Gäste können den Court buchen. Alle TSV Mitglieder können den Sport bis zum 31.12.2025 kostenlos spielen. Wenn Du bereits TSV Tennis-Mitglied bist, kannst Du ab dem 01.01.2026 auch weiterhin den Padel Court kostenfrei nutzen.</p>'),
(2, 45, 1753198583, 1753198241, 1, 0, 0, 0, '', 2, 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 80, 'Ich möchte regelmäßig spielen und nicht immer einzeln zahlen müssen. Bietet ihr eine „Flatrate“ an?', '<p>Ja. Als TSV Mitglied mit einem Zusatzbeitrag für Padel kannst Du so oft spielen, wie Du möchtest. Über diesen Antrag kannst Du ganz TSV Mitglied werden und/oder die zusätzliche Padel-Flatrate dazu buchen. <a href=\"t3://page?uid=11\"><span style=\"color:#0563c1;\"><u>Zum Mitgliedsantrag</u></span></a></p>'),
(3, 45, 1753198583, 1753198306, 1, 0, 0, 0, '', 3, 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 80, 'Wie viele Spieler*innen braucht man für eine Partie?', '<p>Padel wird standardmäßig als Doppel, also mit 4 Spieler*innen gespielt.</p>'),
(4, 45, 1753198583, 1753198306, 1, 0, 0, 0, '', 4, 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 80, 'Benötige ich eigene Ausrüstung?', '<p>Nein, Schläger und Bälle stellt der TSV kostenlos im Eingangsbereich der Umkleidekabinen bereit. Zugang zu den Kabinen erhältst Du nach erfolgter Buchung. Eine eigene Ausrüstung darf selbstverständlich mitgebracht werden.</p>'),
(5, 45, 1753198583, 1753198374, 1, 0, 0, 0, '', 5, 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 80, 'Welches Schuhwerk wird empfohlen?', '<p>Es wird auf Kunstrasen gespielt. Ideal sind Tennisschuhe mit Fischgrätprofil oder spezielle Padelschuhe. Zum Einstieg sind jedoch auch herkömmliche Sportschuhe ausreichend.</p>'),
(6, 45, 1753198583, 1753198374, 1, 0, 0, 0, '', 6, 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 80, 'Wie lange dauert eine Spielzeit?', '<p>Die Buchungseinheit beträgt 60 Minuten. Längere Spielzeiten sind je nach Verfügbarkeit möglich.</p>'),
(7, 45, 1753198583, 1753198417, 1, 0, 0, 0, '', 7, 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 80, 'Was kostet eine Stunde auf dem Court für Gastspieler?', '<p>Im Zeitraum von montags bis freitags bis jeweils 16 Uhr beträgt der Preis 20 € für 4 Gastspieler. Für alle anderen Zeiten werden 28 € fällig.</p>'),
(8, 45, 1753198583, 1753198417, 1, 0, 0, 0, '', 8, 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 80, 'Wie erfolgt die Preisermittlung, wenn sowohl TSV-Mitglieder als auch Gäste zusammen spielen wollen?', '<p>Bei der Buchung sind stets alle 4 Spieler namentlich anzugeben und eine entsprechende Mitgliedschaft zu kennzeichnen. Nichtmitglieder zahlen pro Stunde 20€ /4 = 5 € bzw. zur Prime Time 28 € / 4 = 7 €. Der Rechnungsbetrag wird so stets in Abhängigkeit von der Gastspieler*innen und der gewünschten Uhrzeit individuell berechnet.&nbsp;</p>'),
(9, 45, 1753198583, 1753198496, 1, 0, 0, 0, '', 9, 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 80, 'Welche Bezahlmöglichkeiten bietet ihr an?', '<p>Wenn Du Dich für die TSV Mitgliedschaft inklusive Padel Flatrate entscheidest, kann der Jahresbeitrag ganz einfach per SEPA-Lastschriftmandat eingezogen werden. Gäste können das etablierte PayPal-Verfahren nutzen. An der Erweiterung der Bezahloptionen wird gearbeitet. Barzahlungen sind leider nicht möglich.&nbsp;</p>'),
(10, 45, 1753198583, 1753198496, 1, 0, 0, 0, '', 10, 0, 0, 0, 0, NULL, 0x7b22616e73776572223a22222c22656469746c6f636b223a22222c22656e6474696d65223a22222c2266655f67726f7570223a22222c22686561646572223a22222c2268696464656e223a22222c22737461727474696d65223a22227d, 80, 'Gibt es eine Beleuchtung für Abendspiele?', '<p>Ja! Der Platz ist mit moderner LED-Flutlichtanlage ausgestattet und auch abends bis 22 Uhr bespielbar.</p>'),
(11, 45, 1753198583, 1753198496, 1, 0, 0, 0, '', 11, 0, 0, 0, 0, NULL, 0x7b22616e73776572223a22222c22656469746c6f636b223a22222c22656e6474696d65223a22222c2266655f67726f7570223a22222c22686561646572223a22222c2268696464656e223a22222c22737461727474696d65223a22227d, 80, 'Wo befindet sich der Padelcourt?', '<p>Der Court befindet sich direkt auf dem Gelände der TSV Tennis Abteilung, Lengericher Straße 10a in Ladbergen. Parkplätze sind ausreichend vorhanden.</p>'),
(12, 45, 1753198583, 1753198518, 1, 0, 0, 0, '', 12, 0, 0, 0, 0, NULL, '', 80, 'Kann ich den Court auch für Firmenevents oder Gruppenangebote mieten?', '<p>Ja! Gerne bieten wir bieten individuelle Angebote für Gruppen, Firmen oder Schulklassen an. Kontaktiert dazu gerne den angegebenen Padel-Ansprechpartner.</p>'),
(13, 45, 1753198755, 1753198660, 1, 0, 0, 0, '', 1, 0, 0, 0, 0, NULL, '', 81, 'Muss ich Mitglied beim TSV Ladbergen sein, um den Platz zu buchen?', '<p>Nein, auch Gäste können den Court buchen. Alle TSV Mitglieder können den Sport bis zum 31.12.2025 kostenlos spielen. Wenn Du bereits TSV Tennis-Mitglied bist, kannst Du ab dem 01.01.2026 auch weiterhin den Padel Court kostenfrei nutzen.</p>'),
(14, 45, 1753198905, 1753198836, 1, 0, 0, 0, '', 1, 0, 0, 0, 0, NULL, '', 82, 'Muss ich Mitglied beim TSV Ladbergen sein, um den Platz zu buchen?', '<p>Nein, auch Gäste können den Court buchen. Alle TSV Mitglieder können den Sport bis zum 31.12.2025 kostenlos spielen. Wenn Du bereits TSV Tennis-Mitglied bist, kannst Du ab dem 01.01.2026 auch weiterhin den Padel Court kostenfrei nutzen.</p>'),
(15, 45, 1753200676, 1753198931, 1, 0, 0, 0, '', 1, 0, 0, 0, 0, NULL, '', 83, 'Muss ich Mitglied beim TSV Ladbergen sein, um den Platz zu buchen?', '<p>Nein, auch Gäste können den Court buchen. Alle TSV Mitglieder können den Sport bis zum 31.12.2025 kostenlos spielen. Wenn Du bereits TSV Tennis-Mitglied bist, kannst Du ab dem 01.01.2026 auch weiterhin den Padel Court kostenfrei nutzen.</p>');
