(1, 1, 1733825608, 1730225097, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 5, 'small', 'large', 0, 'Vielfalt in Bewegung!', 1, '', '', 'Entdecke die Welt des Sports in deinem Verein!', '<p>Wir bieten dir eine breite Palette an Aktivitäten für Jung und Alt. Unsere engagierten Trainer und einladenden Gemeinschaften fördern nicht nur sportliche Fähigkeiten, sondern auch Teamgeist und Freundschaften.</p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(2, 15, 1746955284, 1730228223, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, 'Impressum', 3, '', '', '', '<p>TSV Ladbergen 1921 e.V.<br />Heidkampstraße 36<br />49549 Ladbergen&nbsp;<br />E-Mail: vorsitz@tsv-ladbergen.de&nbsp;<br />Internet: www.tsv-ladbergen.de<br /><br />Vertretungsberechtigter Vorstand: Udo Kaiser (Heidkampstraße 36, 49549 Ladbergen)<br />Registergericht: Amtsgericht Tecklenburg<br />Registernummer:&nbsp;326</p>\r\n\r\n<p>Inhaltlich Verantwortlicher gemäß § 55 Abs. 2 RStV: Udo Kaiser (Anschrift wie oben)</p>\r\n<h3>Haftungsausschluss:</h3>\r\n<p><strong>Haftung für Inhalte</strong></p>\r\n<p>Die Inhalte unserer Seiten wurden mit größter Sorgfalt erstellt. Für die Richtigkeit, Vollständigkeit und Aktualität der Inhalte können wir jedoch keine Gewähr übernehmen. Als Diensteanbieter sind wir gemäß § 7 Abs.1 TMG für eigene Inhalte auf diesen Seiten nach den allgemeinen Gesetzen verantwortlich. Nach §§ 8 bis 10 TMG sind wir als Diensteanbieter jedoch nicht verpflichtet, übermittelte oder gespeicherte fremde Informationen zu überwachen oder nach Umständen zu forschen, die auf eine rechtswidrige Tätigkeit hinweisen. Verpflichtungen zur Entfernung oder Sperrung der Nutzung von Informationen nach den allgemeinen Gesetzen bleiben hiervon unberührt. Eine diesbezügliche Haftung ist jedoch erst ab dem Zeitpunkt der Kenntnis einer konkreten Rechtsverletzung möglich. Bei Bekanntwerden von entsprechenden Rechtsverletzungen werden wir diese Inhalte umgehend entfernen.</p>\r\n\r\n<p><strong>Haftung für Links</strong></p>\r\n<p>Unser Angebot enthält Links zu externen Webseiten Dritter, auf deren Inhalte wir keinen Einfluss haben. Deshalb können wir für diese fremden Inhalte auch keine Gewähr übernehmen. Für die Inhalte der verlinkten Seiten ist stets der jeweilige Anbieter oder Betreiber der Seiten verantwortlich. Die verlinkten Seiten wurden zum Zeitpunkt der Verlinkung auf mögliche Rechtsverstöße überprüft. Rechtswidrige Inhalte waren zum Zeitpunkt der Verlinkung nicht erkennbar. Eine permanente inhaltliche Kontrolle der verlinkten Seiten ist jedoch ohne konkrete Anhaltspunkte einer Rechtsverletzung nicht zumutbar. Bei Bekanntwerden von Rechtsverletzungen werden wir derartige Links umgehend entfernen.</p>\r\n\r\n<p><strong>Urheberrecht</strong></p>\r\n<p>Die durch die Seitenbetreiber erstellten Inhalte und Werke auf diesen Seiten unterliegen dem deutschen Urheberrecht. Die Vervielfältigung, Bearbeitung, Verbreitung und jede Art der Verwertung außerhalb der Grenzen des Urheberrechtes bedürfen der schriftlichen Zustimmung des jeweiligen Autors bzw. Erstellers. Downloads und Kopien dieser Seite sind nur für den privaten, nicht kommerziellen Gebrauch gestattet. Soweit die Inhalte auf dieser Seite nicht vom Betreiber erstellt wurden, werden die Urheberrechte Dritter beachtet. Insbesondere werden Inhalte Dritter als solche gekennzeichnet. Sollten Sie trotzdem auf eine Urheberrechtsverletzung aufmerksam werden, bitten wir um einen entsprechenden Hinweis. Bei Bekanntwerden von Rechtsverletzungen werden wir derartige Inhalte umgehend entfernen.</p>\r\n\r\n<p><strong>Datenschutz</strong></p>\r\n<p>Die Nutzung unserer Webseite ist in der Regel ohne Angabe personenbezogener Daten möglich. Soweit auf unseren Seiten personenbezogene Daten (beispielsweise Name, Anschrift oder eMail-Adressen) erhoben werden, erfolgt dies, soweit möglich, stets auf freiwilliger Basis. Diese Daten werden ohne Ihre ausdrückliche Zustimmung nicht an Dritte weitergegeben.</p>\r\n<p>Wir weisen darauf hin, dass die Datenübertragung im Internet (z.B. bei der Kommunikation per E-Mail) Sicherheitslücken aufweisen kann. Ein lückenloser Schutz der Daten vor dem Zugriff durch Dritte ist nicht möglich.</p>\r\n<p>Der Nutzung von im Rahmen der Impressumspflicht veröffentlichten Kontaktdaten durch Dritte zur Übersendung von nicht ausdrücklich angeforderter Werbung und Informationsmaterialien wird hiermit ausdrücklich widersprochen. Die Betreiber der Seiten behalten sich ausdrücklich rechtliche Schritte im Falle der unverlangten Zusendung von Werbeinformationen, etwa durch Spam-Mails, vor.</p>\r\n\r\n', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(3, 14, 1730228361, 1730228361, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, '', 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, 'Datenschutz', 3, '', '', '', '<p>Verantwortliche Stelle im Sinne der Datenschutzgesetze, insbesondere der EU-Datenschutzgrundverordnung (DSGVO), ist:</p>\r\n<p>TSV Ladbergen 1921 e.V.&nbsp;<br />Heidkampstraße 36<br />49549 Ladbergen</p>\r\n\r\n<p><strong>Ihre Betroffenenrechte</strong></p>\r\n<p>Unter den angegebenen Kontaktdaten können Sie jederzeit folgende Rechte ausüben:</p>\r\n<ul><li>Auskunft über Ihre bei uns gespeicherten Daten und deren Verarbeitung,</li><li>Berichtigung unrichtiger personenbezogener Daten,</li><li>Löschung Ihrer bei uns gespeicherten Daten,</li><li>Einschränkung der Datenverarbeitung, sofern wir Ihre Daten aufgrund gesetzlicher Pflichten noch nicht löschen dürfen,</li><li>Widerspruch gegen die Verarbeitung Ihrer Daten bei uns und</li><li>Datenübertragbarkeit, sofern Sie in die Datenverarbeitung eingewilligt haben oder einen Vertrag mit uns abgeschlossen haben.</li></ul>\r\n<p>Sofern Sie uns eine Einwilligung erteilt haben, können Sie diese jederzeit mit Wirkung für die Zukunft widerrufen.</p>\r\n<p>Sie können sich jederzeit mit einer Beschwerde an die für Sie zuständige Aufsichtsbehörde wenden. Ihre zuständige Aufsichtsbehörde richtet sich nach dem Bundesland Ihres Wohnsitzes, Ihrer Arbeit oder der mutmaßlichen Verletzung. Eine Liste der Aufsichtsbehörden (für den nichtöffentlichen Bereich) mit Anschrift finden Sie unter:&nbsp;<a href=\"https://www.bfdi.bund.de/DE/Infothek/Anschriften_Links/anschriften_links-node.html\" target=\"_blank\" rel=\"noopener\">https://www.bfdi.bund.de/DE/Infothek/Anschriften_Links/anschriften_links-node.html</a>.</p>\r\n\r\n<p><strong>Zwecke der Datenverarbeitung durch die verantwortliche Stelle und Dritte</strong></p>\r\n<p>Wir verarbeiten Ihre personenbezogenen Daten nur zu den in dieser Datenschutzerklärung genannten Zwecken. Eine Übermittlung Ihrer persönlichen Daten an Dritte zu anderen als den genannten Zwecken findet nicht statt. Wir geben Ihre persönlichen Daten nur an Dritte weiter, wenn:</p>\r\n<ul><li>Sie Ihre ausdrückliche Einwilligung dazu erteilt haben,</li><li>die Verarbeitung zur Abwicklung eines Vertrags mit Ihnen erforderlich ist,</li><li>die Verarbeitung zur Erfüllung einer rechtlichen Verpflichtung erforderlich ist,</li></ul>\r\n<p>die Verarbeitung zur Wahrung berechtigter Interessen erforderlich ist und kein Grund zur Annahme besteht, dass Sie ein überwiegendes schutzwürdiges Interesse an der Nichtweitergabe Ihrer Daten haben.</p>\r\n\r\n<p><strong>Löschung bzw. Sperrung der Daten</strong></p>\r\n<p>Wir halten uns an die Grundsätze der Datenvermeidung und Datensparsamkeit. Wir speichern Ihre personenbezogenen Daten daher nur so lange, wie dies zur Erreichung der hier genannten Zwecke erforderlich ist oder wie es die vom Gesetzgeber vorgesehenen vielfältigen Speicherfristen vorsehen. Nach Fortfall des jeweiligen Zweckes bzw. Ablauf dieser Fristen werden die entsprechenden Daten routinemäßig und entsprechend den gesetzlichen Vorschriften gesperrt oder gelöscht.</p>\r\n\r\n<p><strong>Erfassung allgemeiner Informationen beim Besuch unserer Website</strong></p>\r\n<p>Wenn Sie auf unsere Website zugreifen, werden automatisch mittels eines Cookies Informationen allgemeiner Natur erfasst. Diese Informationen (Server-Logfiles) beinhalten etwa die Art des Webbrowsers, das verwendete Betriebssystem, den Domainnamen Ihres Internet-Service-Providers und ähnliches. Hierbei handelt es sich ausschließlich um Informationen, welche keine Rückschlüsse auf Ihre Person zulassen.</p>\r\n<p>Diese Informationen sind technisch notwendig, um von Ihnen angeforderte Inhalte von Webseiten korrekt auszuliefern und fallen bei Nutzung des Internets zwingend an. Sie werden insbesondere zu folgenden Zwecken verarbeitet:</p>\r\n<ul><li>Sicherstellung eines problemlosen Verbindungsaufbaus der Website,</li><li>Sicherstellung einer reibungslosen Nutzung unserer Website,</li><li>Auswertung der Systemsicherheit und -stabilität sowie</li><li>zu weiteren administrativen Zwecken.</li></ul>\r\n<p>Die Verarbeitung Ihrer personenbezogenen Daten basiert auf unserem berechtigten Interesse aus den vorgenannten Zwecken zur Datenerhebung. Wir verwenden Ihre Daten nicht, um Rückschlüsse auf Ihre Person zu ziehen. Empfänger der Daten sind nur die verantwortliche Stelle und ggf. Auftragsverarbeiter.</p>\r\n<p>Anonyme Informationen dieser Art werden von uns ggfs. statistisch ausgewertet, um unseren Internetauftritt und die dahinterstehende Technik zu optimieren.</p>\r\n\r\n<p><strong>Cookies</strong></p>\r\n<p>Wie viele andere Webseiten verwenden wir auch so genannte „Cookies“. Cookies sind kleine Textdateien, die von einem Websiteserver auf Ihre Festplatte übertragen werden. Hierdurch erhalten wir automatisch bestimmte Daten wie z. B. IP-Adresse, verwendeter Browser, Betriebssystem und Ihre Verbindung zum Internet.</p>\r\n<p>Cookies können nicht verwendet werden, um Programme zu starten oder Viren auf einen Computer zu übertragen. Anhand der in Cookies enthaltenen Informationen können wir Ihnen die Navigation erleichtern und die korrekte Anzeige unserer Webseiten ermöglichen.</p>\r\n<p>In keinem Fall werden die von uns erfassten Daten an Dritte weitergegeben oder ohne Ihre Einwilligung eine Verknüpfung mit personenbezogenen Daten hergestellt.</p>\r\n<p>Natürlich können Sie unsere Website grundsätzlich auch ohne Cookies betrachten. Internet-Browser sind regelmäßig so eingestellt, dass sie Cookies akzeptieren. Im Allgemeinen können Sie die Verwendung von Cookies jederzeit über die Einstellungen Ihres Browsers deaktivieren. Bitte verwenden Sie die Hilfefunktionen Ihres Internetbrowsers, um zu erfahren, wie Sie diese Einstellungen ändern können. Bitte beachten Sie, dass einzelne Funktionen unserer Website möglicherweise nicht funktionieren, wenn Sie die Verwendung von Cookies deaktiviert haben.</p>\r\n\r\n<p><strong>SSL-Verschlüsselung</strong></p>\r\n<p>Um die Sicherheit Ihrer Daten bei der Übertragung zu schützen, verwenden wir dem aktuellen Stand der Technik entsprechende Verschlüsselungsverfahren (z. B. SSL) über HTTPS.</p>\r\n\r\n<p><strong>Kontaktformular</strong></p>\r\n<p>Treten Sie bzgl. Fragen jeglicher Art per E-Mail oder Kontaktformular mit uns in Kontakt, erteilen Sie uns zum Zwecke der Kontaktaufnahme Ihre freiwillige Einwilligung. Hierfür ist die Angabe einer validen E-Mail-Adresse erforderlich. Diese dient der Zuordnung der Anfrage und der anschließenden Beantwortung derselben. Die Angabe weiterer Daten ist optional. Die von Ihnen gemachten Angaben werden zum Zwecke der Bearbeitung der Anfrage sowie für mögliche Anschlussfragen gespeichert. Nach Erledigung der von Ihnen gestellten Anfrage werden personenbezogene Daten automatisch gelöscht.</p>\r\n\r\n<p><strong>Änderung unserer Datenschutzbestimmungen</strong></p>\r\n<p>Wir behalten uns vor, diese Datenschutzerklärung anzupassen, damit sie stets den aktuellen rechtlichen Anforderungen entspricht oder um Änderungen unserer Leistungen in der Datenschutzerklärung umzusetzen, z.B. bei der Einführung neuer Services. Für Ihren erneuten Besuch gilt dann die neue Datenschutzerklärung.</p>\r\n\r\n<p><i>Die Datenschutzerklärung wurde mit dem&nbsp;</i><a href=\"https://www.activemind.de/datenschutz/datenschutzhinweis-generator/\" target=\"_blank\" rel=\"noopener\"><i>Datenschutzerklärungs-Generator der activeMind AG erstellt</i></a><i>.</i></p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(4, 13, 1740639426, 1730228416, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, 'Satzung', 3, '', '', 'des Turn- und Sportvereins Ladbergen 1921 e.V.', '<p><strong>Inhaltsübersicht</strong></p>\r\n<p>§ 1 Name, Sitz<br />§ 2 Zweck des Vereins<br />§ 3 Mitgliedschaft<br />§ 4 Mitgliedsbeiträge<br />§ 5 Organe des Vereins<br />§ 6 Mitgliederversammlung<br />§ 7 Vorstand<br />§ 8 Verwaltungsrat<br />§ 9 Wahlen der Vorstands- und Verwaltungsratsmitglieder<br />§ 10 Jugendvertretung<br />§ 11 Kassenprüfung<br />§ 12 Geschäftsjahr<br />§ 13 Haftung<br />§ 14 Datenschutz<br />§ 15 Ehrenrat<br />§ 16 Vereinsauflösung<br />§ 17 Schlussbestimmungen</p>\r\n\r\n<p><strong>§ 1 Name, Sitz</strong></p>\r\n<p>(1) Der am 23.08.1921 gegründete Verein trägt den Namen „Turn- und Sportverein (abgekürzt: TSV) Ladbergen 1921 e. V.“. Er ist in das Vereinsregister beim Amtsgericht Tecklenburg am 22.05.1978 unter der Nr. 0326 eingetragen.</p>\r\n<p>(2) Sitz des Vereins ist 49549 Ladbergen.</p>\r\n<p>(3) Der Verein ist Mitglied des Deutschen Sportbundes sowie seiner Untergliederungen und Fachverbände.</p>\r\n\r\n<p><strong>§ 2 Zweck des Vereins</strong></p>\r\n<p>(1) Der Verein mit Sitz in Ladbergen verfolgt ausschließlich und unmittelbar gemeinnützige Zwecke im Sinne des Abschnitts „Steuerbegünstigte Zwecke“ der Abgabenordnung. Zweck des Vereins ist die allseitige körperliche und geistige Förderung seiner Mitglieder durch Turnen, Sport und Spiel.</p>\r\n<p>(2) Der Verein ist selbstlos tätig; er verfolgt nicht in erster Linie eigenwirtschaftliche Zwecke.</p>\r\n<p>(3) Die Mittel des Vereins dürfen nur für satzungsgemäße Zwecke verwendet werden. Die Mitglieder erhalten keine Zuwendungen aus Mitteln des Vereins.</p>\r\n<p>(4) Es darf keine Person durch Ausgaben, die dem Zweck des Vereins fremd sind, oder durch unverhältnismäßig hohe Vergütungen begünstigt werden.</p>\r\n<p>(5) Politische und konfessionelle Bestrebungen sind ausgeschlossen.</p>\r\n<p>(6) Zur Verwirklichung des Vereinszwecks sind Abteilungen gegründet worden, denen jeweils ein Leiter vorsteht. Der Vorstand (§ 7) hat das Recht, weitere Abteilungen zu gründen oder bestehende aufzulösen.</p>\r\n\r\n<p><strong>§ 3 Mitgliedschaft</strong></p>\r\n<p>(1) Mitglied kann auf schriftlichen Antrag an den Vorstand jede natürliche Person werden. Bei Minderjährigen ist die schriftliche Zustimmung eines gesetzlichen Vertreters erforderlich.</p>\r\n<p>(2) Über die Aufnahme entscheidet der Vorstand nach freiem Ermessen.</p>\r\n<p>(3) Der Austritt aus dem Verein kann nur durch schriftliche Mitteilung an den Vorstand mit einer Kündigungsfrist von 3 Monaten zum Ende des Geschäftsjahres erfolgen. In diesem Fall ist der Betrag für das laufende Geschäftsjahr zu entrichten.</p>\r\n<p>(4) Der Ausschluss eines Mitgliedes kann nur aus wichtigen Gründen vom Vorstand nach Anhörung des Betroffenen beschlossen werden. Ein wichtiger Grund liegt namentlich vor bei</p>\r\n<p>&nbsp; · Verstoß gegen die Satzung,</p>\r\n<p>&nbsp; · Zahlungsrückstand von mehr als einem Jahresbetrag trotz Mahnung,</p>\r\n<p>&nbsp; · schwerem Verstoß gegen die Interessen des Vereins oder</p>\r\n<p>&nbsp; · grobem unsportlichen und unflätigen Verhalten.</p>\r\n<p>(5) Alle Mitglieder sind berechtigt, an den Übungen und Veranstaltungen des Vereins teilzunehmen und seine Einrichtungen im Rahmen der darüber erlassenen Bestimmungen und Richtlinien zu benutzen.</p>\r\n\r\n<p><strong>§ 4 Mitgliedsbeiträge</strong></p>\r\n<p>(1) Der Verein erhebt Beiträge, die in der jährlichen ordentlichen Jahreshauptversammlung festgesetzt werden.</p>\r\n<p>(2) Kostenintensive Abteilungen können nach Zustimmung des Vorstandes zusätzlich zum Vereinsbeitrag Sonderbeiträge zur eigenen zweckentsprechenden Verwendung erheben.</p>\r\n\r\n<p><strong>§ 5 Organe des Vereins</strong></p>\r\n<p>Die Organe des Vereins sind:</p>\r\n<p>&nbsp; 1. die Mitgliederversammlung (ordentliche und außerordentliche, § 6)</p>\r\n<p>&nbsp; 2. der Vorstand ( § 7)</p>\r\n<p>&nbsp; 3. der Verwaltungsrat ( § 8 )</p>\r\n<p>&nbsp; 4. die Jugendvertretung ( § 10 )</p>\r\n\r\n<p><strong>§ 6 Mitgliederversammlung</strong></p>\r\n<p>(1) Die Mitgliederversammlung ist das oberste Organ des Vereins. Der Vorstand ruft im Geschäftsjahr mindestens eine ordentliche Mitgliederversammlung (Jahreshauptversammlung) ein, und zwar möglichst innerhalb der ersten 3 Monaten nach Beginn des Geschäftsjahres.</p>\r\n<p>(2) Die Jahreshauptversammlung ist vom Vorstand durch Brief, in der Tageszeitung oder in sonstigen ortsüblichen Medien unter Einhaltung einer Frist von einer Woche sowie unter Mitteilung der Tagesordnung zu berufen.</p>\r\n<p>(3) Anträge von Mitgliedern zur Tagesordnung sind spätestens 3 Tage vor der Jahreshauptversammlung dem Vorstand schriftlich einzureichen.</p>\r\n<p>(4) Der Vorstand kann eine außerordentliche Mitgliedersammlung einberufen. Er ist dazu verpflichtet, wenn mindestens 10% der Mitglieder es verlangen. Dafür gelten die unter Punkt 2 genannten Einladungsformalitäten.</p>\r\n<p>(5) Jedem Mitglied ab vollendetem 16. Lebensjahr steht bei Wahlen und Beschlüssen nur eine Stimme zu. Das Stimmrecht ist nicht übertragbar.</p>\r\n<p>(6) Die Mitgliederversammlung ist ohne Rücksicht auf die Anzahl der erschienen Mitglieder beschlussfähig. Die Entscheidungen werden mit einfacher Mehrheit der abgegebenen Stimmen beschlossen. Die Entscheidung über die Auflösung des Vereins sowie über die Änderung der Satzung sind allerdings mit einer 2/3-Mehrheit der abgegebenen Stimmen zu fällen. Stimmenthaltungen und ungültige Stimmen gelten als nicht abgegeben.</p>\r\n<p>(7) Über die Jahreshauptversammlung ist eine Niederschrift zu fertigen. Sie ist vom Versammlungsleiter und dem/der Protokollführer/in zu unterschreiben.</p>\r\n<p>(8) Die Jahreshauptversammlung ist besonders für folgende Angelegenheiten zuständig:</p>\r\n<p>&nbsp; · Genehmigung des Protokolls der Jahreshauptversammlung vom vorangegangenen Jahr,</p>\r\n<p>&nbsp; · Entgegennahme der Berichte des Vorstandes, des Verwaltungsrates und der Abteilungen,</p>\r\n<p>&nbsp; · Entgegennahme des Berichtes des Kassenwartes,</p>\r\n<p>&nbsp; · Entgegennahme des Berichtes der Kassenprüfer,</p>\r\n<p>&nbsp; · Abnahme der Jahresrechnung,</p>\r\n<p>&nbsp; · Entlastung des Vorstandes,</p>\r\n<p>&nbsp; · Wahl der Vorstandsmitglieder,</p>\r\n<p>&nbsp; · Vorstellung des Verwaltungsrates und der Jugendvertretung,</p>\r\n<p>&nbsp; · Wahl des Ehrenrates,</p>\r\n<p>&nbsp; · Wahl der Kassenprüfer,</p>\r\n<p>&nbsp; · Satzungsänderungen sowie</p>\r\n<p>&nbsp; · Festsetzung der Vereinsbeiträge</p>\r\n\r\n<p><strong>§ 7 Vorstand</strong></p>\r\n<p>(1) Der Vorstand führt die Geschäfte des Vereins und besteht aus:</p>\r\n<p>&nbsp; 1. dem/der 1. Vorsitzenden</p>\r\n<p>&nbsp; 2. dem/der 1. stellv. Vorsitzenden</p>\r\n<p>&nbsp; 3. dem/der 2. stellv. Vorsitzenden</p>\r\n<p>&nbsp; 4. dem/der 1. Kassenwart/in</p>\r\n<p>&nbsp; 5. dem/der 1. Geschäftsführer/in</p>\r\n<p>&nbsp; 6. dem/der 2. Geschäftsführer/in</p>\r\n<p>&nbsp; 7. dem/der Turn- und Sportwart/in</p>\r\n<p>&nbsp; 8. dem/der Vorsitzenden des Jugendausschusses</p>\r\n<p>&nbsp; 9. dem/der stellv. Vorsitzenden des Jugendausschusses</p>\r\n<p>(2) Die unter den Ziffern 1., 4. und 5. genannten Mitglieder des Vorstandes bilden den Vorstand im Sinne des § 26 BGB. Sie vertreten den Vorstand gerichtlich und außergerichtlich.</p>\r\n<p>(3) Der/die Vorsitzende, im Verhinderungsfall der/die 1. stellv. Vorsitzende oder der/die 2.stellv. Vorsitzende beruft und leitet die Sitzungen des Vorstandes. Er/sie ist verpflichtet den Vorstand einzuberufen, wenn es das Vereinsinteresse erfordert oder aber, wenn dies von der Mehrheit der Vorstandsmitglieder verlangt wird.</p>\r\n<p>(4) Der Vorstand kann zur Erfüllung bestimmter Aufgaben Ausschüsse bilden, die ihn bei der Erfüllung und Ausführung unterstützen und beraten.</p>\r\n<p>(5) &nbsp;Der Vorstand kann bei Bedarf und unter Berücksichtigung der wirtschaftlichen Verhältnisse und der Haushaltslage beschließen, dass Vereins- und Organämter gegen Zahlung einer pauschalen Aufwandsentschädigung gem. § 3 Nr. 26 a EStG ausgeübt werden.</p>\r\n\r\n<p><strong>§ 8 Verwaltungsrat</strong></p>\r\n<p>(1) Der Verwaltungsrat besteht aus:</p>\r\n<p>&nbsp; 1. den in § 7 genannten Vorstandsmitgliedern,</p>\r\n<p>&nbsp; 2. den Leitern und Sportwarten der Abteilungen</p>\r\n<p>&nbsp; 3. dem/der Pressewart/in</p>\r\n<p>&nbsp; 4. dem/der 2. Kassenwart/in</p>\r\n<p>&nbsp; 5. dem/der Sozialwart/in</p>\r\n<p>(2) Die vorstehend genannten Mitglieder des Verwaltungsrats haben beratende Funktionen, soweit nicht in dieser Satzung ausdrücklich etwas anderes bestimmt ist.</p>\r\n\r\n<p><strong>§ 9 Wahlen der Vorstands- und Verwaltungsratsmitglieder</strong></p>\r\n<p>(1) Die in § 7 unter den Ziffern 1. bis 7. genannten Mitglieder des Vorstandes sowie unter den Ziffern 3. bis 5. genannten Mitglieder der Verwaltungsrates werden auf die Dauer von 2 Jahren von der Jahreshauptversammlung gewählt und zwar in wechselndem Turnus. In den Jahren mit ungerader Endzahl werden die Mitglieder des Vorstandes unter den Ziffern 1., 3., 5. und 7. sowie die Mitglieder des Verwaltungsrates unter den Ziffern 4. und 5. gewählt. In den Jahren mit gerader Endzahl werden die Mitglieder des Vorstandes unter den Ziffern 2., 4. und 6. sowie das Mitglied des Verwaltungsrates unter der Ziffer 3. gewählt.</p>\r\n<p>Der/die Vorsitzende und der/die stellv. Vorsitzende des Jugendausschusses werden von der Jugendvertretung gewählt und in der Jahreshauptversammlung bestätigt.</p>\r\n<p>Die Vertreter der Abteilungen werden in den jeweiligen Abteilungsversammlungen gewählt.</p>\r\n<p>(2) Die Wahlen sind in der Regel öffentlich durch Handzeichen. Auf Antrag ist mit einfacher Mehrheit durch Handzeichen darüber abzustimmen, ob die Wahl geheim durch Stimmzettel zu erfolgen hat.</p>\r\n\r\n<p><strong>§ 10 Jugendvertretung</strong></p>\r\n<p>(1) Die Jugendvertretung führt und verwaltet sich selbständig im Rahmen der von ihr beschlossenen Jugendordnung.</p>\r\n<p>(2) Der von der Jugendvertretung gewählte Vereinsjugendausschuss erfüllt seine Aufgaben im Rahmen der Vereinssatzung, der Jugendordnung sowie der Beschlüsse des Vereinsjugendtages. Er ist für seine Beschlüsse dem Vereinsjugendtag und dem Vorstand verantwortlich. Er entscheidet über die Verwendung der der Jugendvertretung zufließenden Mittel.</p>\r\n\r\n<p><strong>§ 11 Kassenprüfung</strong></p>\r\n<p>Die ordnungsgemäße Buch- und Kassenführung des Vereins wird jährlich durch mindestens zwei von der Jahreshauptversammlung gewählte Kassenprüfer/innen überprüft. Die Kassenprüfer/innen erstatten der Mitgliederversammlung einen Prüfbericht und bringen ggfs. den Vorschlag zur Entlastung des Vorstandes ein.</p>\r\n\r\n<p><strong>§ 12 Geschäftsjahr</strong></p>\r\n<p>Das Geschäftsjahr ist das Kalenderjahr.</p>\r\n\r\n<p><strong>§ 13 Haftung</strong></p>\r\n<p>Der Verein haftet nicht für die zu irgendwelchen Übungsstunden, Versammlungen oder sonstige Veranstaltungen mitgebrachten Kleidungsstücke, Wertgegenstände oder Bargeldbeträge.</p>\r\n\r\n<p><strong>§ 14 Datenschutz im Verein</strong></p>\r\n<p>(1) Zur Erfüllung der Zwecke und Aufgaben des Vereins werden unter Beachtung der gesetzlichen Vorgaben des Bundesdatenschutzgesetzes (BDSG) personenbezogene Daten über persönliche und sachliche Verhältnisse der Mitglieder im Verein genutzt, gespeichert, übermittelt und verändert.<br />&nbsp;<br />(2) Jedes Vereinsmitglied hat das Recht auf: a) Auskunft über die zu seiner Person gespeicherten Daten; b) Berichtigung über die zu seiner Person gespeicherten Daten, wenn sie unrichtig sind; c) Sperrung der zu seiner Person gespeicherten Daten, wenn sich bei behaupteten Fehlern weder deren Richtigkeit noch deren Unrichtigkeit feststellen lässt; d) Löschung der zu seiner Person gespeicherten Daten, wenn die Speicherung unzulässig war.<br />&nbsp;<br />(3) Den Organen des Vereins, allen Mitarbeitern oder sonst für den Verein Tätigen ist es untersagt, personenbezogene Daten unbefugt zu anderen als dem zur jeweiligen Aufgabenerfüllung gehörenden Zweck zu verarbeiten, bekannt zu geben, Dritten zugänglich zu machen oder sonst zu nutzen. Diese Pflicht besteht auch über das Ausscheiden der oben genannten Personen aus dem Verein hinaus.<br />&nbsp;<br />(4) Zur Wahrnehmung der Aufgaben und Pflichten nach dem Bundesdatenschutzgesetz (BDSG) bestellt der geschäftsführende Vorstand einen Datenschutzbeauftragten.</p>\r\n\r\n<p><strong>§ 15 Ehrenrat</strong></p>\r\n<p>Zur Schlichtung von Streitfällen innerhalb des Vereins wird ein Ehrenrat gebildet. Er besteht aus fünf verdienten, von der Jahreshauptversammlung gewählten Mitgliedern. Die Amtszeit der Mitglieder des Ehrenrates beträgt 2 Jahre. Wiederwahl ist zulässig.</p>\r\n\r\n<p><strong>§ 16 Vereinsauflösung</strong></p>\r\n<p>(1) Die Auflösung des Vereins kann in einer besonderen zu diesem Zweck einberufenen Mitgliederversammlung mit einer Mehrheit von 2/3 der abgegebenen Stimmen beschlossen werden. Die Auflösung unterbleibt, wenn mindestens 50 stimmberechtigte Mitglieder das Fortbestehen des Vereins verlangen.</p>\r\n<p>(2) Bei Auflösung des Vereins oder bei Wegfall steuerbegünstigter Zwecke fällt das Vermögen des Vereins an die Gemeinde Ladbergen, die es unmittelbar und ausschließlich für gemeinnützige, mildtätige oder kirchliche Zwecke zu verwenden hat.</p>\r\n\r\n<p><strong>§ 17 Schlussbestimmungen</strong></p>\r\n<p>Diese Satzung wurde durch Beschluss der Mitglieder in der Jahreshauptversammlung vom 21.02.2025 abgenommen. Sie tritt an die Stelle der Satzung vom 17.09.2021.</p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(5, 11, 1730228565, 1730228565, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, '', 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, 'Mitglied werden', 3, '', '', '', '<p>Wir freuen uns über jeden, der sich dazu entschließt, bei uns mitzumachen und Sport zu treiben!</p>\r\n<p>Dafür müsst ihr Mitglied im Verein sein. Das Aufnahmeformular findet ihr hier. Bitte gebt es ausgefüllt bei einem unserer Vorstandsmitglieder ab.</p>\r\n<p>Das Formular kann direkt am Computer mit dem&nbsp;<a href=\"http://get.adobe.com/de/reader/\" target=\"_blank\" rel=\"noopener\"><strong>Adobe Reader</strong></a> ausgefüllt und ausdruckt werden. Anschließend braucht ihr es nur noch unterschreiben.</p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(6, 11, 1753019448, 1730228604, 0, 0, 0, 0, '', 512, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, 'Jährliche Beitrage TSV', 3, '', '', '', '<figure class=\"table\"><table><tbody><tr><td>Erwachsene</td><td>86 €</td></tr><tr><td>Paare</td><td>140 €</td></tr><tr><td>Familienbeitrag</td><td>165 €</td></tr><tr><td>Schüler / Studenten / Rentner<br>Azubis / Wehrpflichtige</td><td>&nbsp;</td></tr><tr><td>1. Kind</td><td>48 €</td></tr><tr><td>2. Kind</td><td>48 €</td></tr><tr><td>3. Kind und weitere</td><td>frei</td></tr><tr><td>Mitglieder ab dem 75. Lebensjahr<br>zahlen einen Kostenbeitrag von</td><td>10 €</td></tr></tbody></table></figure>\r\n\r\n<p><strong>Zusatzbeitrag Padel ab 2026</strong></p>\r\n<figure class=\"table\"><table><tbody><tr><td>Einzelpersonen</td><td>54 €</td></tr><tr><td>Kinder, Jugendliche, Schüler, Studenten, Auszubildende bis 25 Jahre</td><td>36 €</td></tr></tbody></table></figure>\r\n<p>Der Jahresbeitrag wird im März abgebucht.</p>\r\n<p>Die Kündigungsfrist beträgt 6 Wochen zum Jahresende. Sie muss schriftlich oder per E-Mail bei einem Mitglied des Vorstandes erfolgen.<br />&nbsp;</p>\r\n<p><strong>Zusatzbeitrag Tennis</strong></p>\r\n<figure class=\"table\"><table><tbody><tr><td>Einzelpersonen</td><td>108 €</td></tr><tr><td>Kinder, Jugendliche, Schüler, Studenten, Auszubildende bis 25 Jahre</td><td>36 €</td></tr><tr><td>Förderndes Mitglied</td><td>24 €</td></tr></tbody></table></figure>\r\n<p>Jedes Mitglied ab 16 Jahren bis zum vollendeten 65. Lebensjahr leistet jährlich 5 Arbeitsstunden. Diese Verpflichtung beginnt im 2. Mitgliedsjahr. Für jede <strong>nicht geleistete Arbeitsstunde </strong>werden 15 € in Rechnung gestellt.</p>\r\n<p>Die Arbeitsumlage wird im Wege des Abbuchungsverfahrens jeweils Mitte April des laufenden Jahres im Voraus erhoben; für geleistete Arbeitsstunden erfolgt eine Rückerstattung. Die Beiträge für die Tennisabteilung werden halbjährlich im Voraus (April und Oktober) durch Einzugsermächtigung erhoben.</p>\r\n<p>Abmeldungen-aus der Tennisabteilung können schriftlich zum 30.06. bzw. 31.12. eines Jahres bei einer Kündigungsfrist von jeweils 6 Wochen gegenüber dem Vorstand der Tennisabteilung erfolgen.</p>\r\n\r\n<p>Stand: Juli 2025</p>\r\n<p>Sollte es euch aus persönlichen Gründen nicht möglich sein, am Vereinssport teilzunehmen, ist der 1. Vorsitzende jederzeit ansprechbar, um eine Lösung zu finden!</p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
