(9, 12, 1735043789, 1730229338, 1, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'tsv_contactperson', 0, 0, '', 'small', 0, '', 3, '', '', '', NULL, 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(10, 5, 1735042290, 1730229520, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, '', 3, '', '', '', '<p><a href=\"https://www.facebook.com/tsv.tennis.ladbergen/?fref=ts\" title=\"TSV Ladbergen - Tennis\" target=\"_blank\"><strong>TSV Tennisabteilung bei Facebook</strong></a></p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(11, 5, 1753091819, 1730229658, 0, 0, 0, 0, '', 128, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'textpic', 0, 0, '', 'small', 0, 'Wir sind die Tennis-Abteilung', 3, '', '', '', '<p>Zur Zeit haben wir ca. 220 Mitglieder, in allen Altersklassen von 4 Jahren bis 80 Jahren. Wir spielen auf sechs gepflegten Sandplätzen von April bis November. Auf unserer Anlage befindet sich ein modernes Clubhaus mit einer großen Terrasse, die für Vereinsveranstaltungen, sowie für private Feiern der Vereinsmitgliedern genutzt wird. Für Zuschauer befindet sich eine weitere Terrasse direkt an den Spielfeldern.</p>\r\n<p>Unser Verein ist von vielen Angeboten und Veranstaltungen für jung und alt geprägt.</p>\r\n<p>Für Kinder und Jugendliche bieten wir Ballschulen, Kleinfeld- Tennistraining und Tennistraining über das ganze Jahr an. Für Erwachsene bieten wir Einzel,- oder auch Gruppentraining an. Das Training wird von professionellen Trainern durchgeführt.</p>\r\n<p>Für alle, die noch nicht wissen, ob der Tennissport das richtige für ihn ist, gibt es die Möglichkeit an einem Schnuppertraining teilzunehmen, auch ohne Mitgliedschaft im TSV. Ebenfalls werden für Erwachsene, Mixedturniere zum Saisonstart, zu Pfingsten, zum Neujahr gespielt. Hier sind auch neue Mitglieder und auch Anfänger herzlich willkommen.</p>\r\n<p>In den Sommermonaten werden vereinsintern Meisterschaften im Jugend-, Damen- und Herrenbereich als Einzel und Doppel ausgetragen, was nach den Endspielen auch gebührend gefeiert wird. Natürlich sind wir auch im Leistungsbereich mit Kindern und Erwachsenen dabei und nehmen an WTV Meisterschaftsspielen teil.</p>\r\n<p>Der persönliche Kontakt zu unseren Mitgliedern ist uns wichtig. Unser Vorstandsteam ist jederzeit für Mitglieder und Interessierte ansprechbar und beantwortet gerne Fragen zum Verein und unseren Angeboten.</p>\r\n<p>Willst du Teil unserer Tennisabteilung werden? Wir freuen uns auf Dich.</p>\r\n\r\n<p>TSV-Tennisabteilung<br />1. Vorsitzender<br />Rainer Jendroska</p>\r\n\r\n\r\n', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(12, 7, 1731054782, 1730229862, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, 'Bewegung, Auspowern und Hobbysport', 3, '', '', '', '<p>Badminton bietet der TSV seit Mitte 2021 an. Momentan besteht die Gruppe aus ca. 10 Frauen, Männern und Jugendlichen, so dass Zuwachs durchaus gut wäre. Es geht um reinen Hobbysport, Bewegung, Auspowern und wer mag ein gemütliches Getränk danach.</p>\r\n<p>Es stehen vier Doppelfelder in der Jahnsporthalle zur Verfügung.<br />Gespielt wird momentan mittwochs von 20 Uhr bis 21.30 Uhr.</p>\r\n<p>Weitere Zeiten, z.B. am Wochenende können individuell vergeben werden.</p>\r\n<p>Reinschnuppern ohne Anmeldung oder Vereinsmitgliedschaft ist jederzeit möglich.</p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(13, 7, 1735043820, 1730229956, 1, 0, 0, 0, '', 128, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 2, NULL, 0, 'tsv_contactperson', 0, 0, '', 'small', 0, '', 3, '', '', '', NULL, 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(14, 7, 1739861699, 1730230007, 0, 0, 0, 0, '', 192, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 2, NULL, 0, 'text', 0, 0, 'small', 'small', 0, 'Trainingszeit', 6, '', '', '', '<figure class=\"table\"><table><tbody><tr><td><strong>Mittwochs</strong></td><td>&nbsp;</td></tr><tr><td>gemischtes Alter<br>&nbsp;</td><td>20.00 – 21.30 Uhr<br>&nbsp;</td></tr><tr><td><strong>Sporthalle 1</strong><br>Jahnstraße 1a<br>49549 Ladbergen</td><td>&nbsp;</td></tr></tbody></table></figure>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(15, 6, 1733900830, 1730230153, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, 'Wir haben Bogensport in Ladbergen!', 3, '', '', '', '<p><span style=\"color:rgb(34,34,34);\">Kurz zur Geschichte und wie es dazu kam.</span></p>\r\n<p><span style=\"color:rgb(34,34,34);\">Am 11.06.2022 hat der TSV Ladbergen sein 100-jähriges Bestehen an der Tennisanlage in Ladbergen gefeiert. Durch meine aktive Beteiligung an der Einrichtung einer Badminton Gruppe hatte ich gute Kontakte zum Vorstand und war eingeladen dabei zu sein.</span></p>\r\n<p><span style=\"color:rgb(34,34,34);\">Durch Knüpfung von neuen Kontakten, z. B. auch mit dem Bürgermeister Torsten Buller kam dann das Gespräch auf, dass es schön wäre, einen Platz für Bogenschießen zu finden und dass es doch toll wäre, wenn Ladbergen auch dieses anbieten könnte. Das fanden der Bürgermeister und der Vorstand auch. Am darauffolgenden Montag hatte ich auch schon einen Termin im Rathaus angeboten bekommen, mit dem Ziel eine Fläche zu finden auf der wir die Idee realisieren können. Wir waren uns dann mit dem VFL einig das wir die Freiluftsportanlage an der Königsbrücke mitbenutzen könnten.&nbsp;</span></p>\r\n<p><span style=\"color:rgb(34,34,34);\">Danach bin ich in die Planung eingestiegen wir haben etwas Werbung gemacht über Mundpropaganda und Facebook.</span></p>\r\n<p><span style=\"color:rgb(34,34,34);\">Am 01.09.2022 war der Plan dann reif und wir haben mit den Menschen, die Interesse hatten eine WhatsApp Gruppe eröffnet und einen Termin für ein erstes Treffen gemacht.</span></p>\r\n<p><span style=\"color:rgb(34,34,34);\">Am 25.08.2022 viel dann der Start Schuss. Um 18:00 Uhr hat sich ein bunter Mix an Menschen aus verschiedenen Altersklassen auf dem Sportplatz getroffen. Ich hatte eine kleine Scheibe und einen Bogen dabei. Wir haben viel geredet und ein wenig geschossen und es hat sich schnell eine kleine Gruppe von Menschen gefunden, die große Lust hatten, sich mit dem Thema Bogenschießen auseinanderzusetzen.</span></p>\r\n<p><span style=\"color:rgb(34,34,34);\">Kurz nach dem Treffen waren die ersten Interessierten schon los sich mit Bögen und Pfeilen ausstatten. Der TSV Ladbergen hat anschließend zwei einfache Scheiben mit einfachem Ständer besorgt. Von da an wurde bislang jeden Sonntag von 10.00 Uhr bis 12:00 Uhr dort geschossen. Das sind jetzt immerhin schon 2 Jahre.</span></p>\r\n<p><span style=\"color:rgb(34,34,34);\">Die Gruppe ist extrem entspannt. Wir bauen seit dem unsere Scheibenständer selber. Aktuell sind wir bei 5 Scheiben angekommen und wir sind ca. 18 aktive Schützen/Schützinnen.</span></p>\r\n<p><span style=\"color:rgb(34,34,34);\">Bei uns ist jeder Willkommen der es mal versuchen möchte. Kinder ab 10 Jahre bis 14 Jahre aber nur in Begleitung eines Erziehungsberechtigten (das hat die Erfahrung gezeigt).</span></p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
