(17, 17, 1730230605, 1730230393, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'textpic', 0, 0, '', 'small', 0, 'Damen 50', 3, '', '', '', '<p>oben (vlnr): Margrit Behning, Mathilde Struck, Margret Hölscher, Gabi Schröer</p>\r\n<p>unten (vlnr): Birgit Saatkamp, Birgit Milde, Jutta Decker, Monika Jendroska</p>', 1, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(18, 17, 1730230672, 1730230672, 0, 0, 0, 0, '', 512, '', 0, 0, 0, 0, NULL, '', 0, 0, 0, 0, 'default', 1, NULL, 0, 'textpic', 0, 0, '', 'small', 0, 'Herren', 3, '', '', '', '<p>Obere Reihe: Sascha Gläser, Lucas Holdsch, Christian Kielmann, Stefan Laumann, Karsten Tönis, Jörg Wierwille, Dennis Schröer, Julian Schröer, Patrick Schröer, Fabian Kipp, Philipp Wüller.&nbsp;</p>\r\n<p>Untere Reihe: Jonas Untiet, Max Schürmann, Philipp Untiet</p>', 1, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
