(20, 18, 1730230854, 1730230854, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, '', 0, 0, 0, 0, 'default', 1, NULL, 0, 'header', 0, 0, '', 'small', 0, 'Vereinsmeister 2022', 3, '', '', '', NULL, 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(21, 18, 1730231108, 1730230911, 0, 0, 0, 0, '', 512, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'textpic', 0, 0, '', 'small', 0, 'Jugend', 4, '', '', '', '', 1, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(22, 18, 1730231097, 1730231069, 0, 0, 0, 0, '', 768, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'textpic', 0, 0, '', 'small', 0, 'Erwachsene', 4, '', '', '', '', 1, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(23, 22, 1730231421, 1730231309, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'textpic', 0, 0, '', 'small', 0, 'Natürlich bietet die Tennisabteilung auch Trainingsstunden an', 3, '', '', '', '<p>Für Kinder und Jugendliche besteht sowohl die Möglichkeit über Schnuppertraining in den Tennissport einzublicken, zudem kann in festen Trainingsgruppen das ganze Jahr über bei ausgebildeten Trainern trainiert werden. Das Training wird hierbei alter- und leistungsgerecht an die Kinder und Jugendlichen angepasst.</p>\r\n\r\n<p><strong>Ab welchem Alter mit Tennisspielen begonnen werden sollte?</strong></p>\r\n<p>Ein richtiges oder falsches Einstiegsalter gibt es nicht. Viele Kinder fangen bereits im Alter von 5-6 Jahren an und da unser Training altersgerecht angepasst wird, ist dies auch kein Problem. Generell gilt: Je jünger man mit Tennis anfängt, desto einfacher ist es, den Sport zu erlernen.</p>\r\n\r\n<p><strong>Doch:</strong> Tennis ist ein Sport für jedes Alter. Nicht nur Kinder, sondern auch junge Erwachsene und Senioren können an Tennis herangeführt werden.</p>\r\n\r\n<p><strong>Daher bieten wir sowohl Schnuppertraining für Erwachsene an, wie auch Trainerstunden für Hobbyspieler, die noch etwas an ihrer Schlagtechnik verbessern möchten!</strong></p>\r\n\r\n<p><strong>Haben Sie Fragen zum Tennistraining?</strong></p>\r\n<p>Gerne helfen wir Ihnen weiter und informieren Sie.</p>', 1, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(24, 19, 1731006534, 1730231673, 0, 1, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 0, 0, 0, 0, 'default', 1, NULL, 0, 'textpic', 0, 0, '', 'small', 1712098800, 'Tennisplätze eröffnet!', 3, '', 't3://page?uid=19#24', '', '<p>Unsere Tennisplätze wurden am Samstag beim Platzeröffnungsturnier offiziell für die neue Sommersaison eingeweiht! Los geht´s!</p>', 1, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(25, 9, 1744092759, 1730232212, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, 'Turnabteilung TSV Ladbergen', 3, '', 't3://page?uid=9#25', '', '<p>Herzlich willkommen in der Abteilung Turnen! Bei uns steht das Bewegen an und auf Geräten im Mittelpunkt – vom ersten klettern, springen und rollen bis hin zu Handstand, Flick-Flack und Salto. Unser Angebot umfasst sowohl das Eltern-Kind-Turnen für die Jüngsten, das Geräteturnen für Anfängerinnen als auch das Wettkampfturnen für die fortgeschrittenen Turnerinnen.&nbsp;</p>\r\n<p>Wir freuen uns sehr über den regen Zulauf und das große Interesse an unseren Angeboten, müssen jedoch aufgrund der hohen Nachfrage für einige Gruppen eine Warteliste führen. Wir bitten deshalb um eine vorherige Kontaktaufnahme mit der jeweiligen Ansprechpartnerin. Alle Gruppen trainieren in der Rottsporthalle.</p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(26, 9, 1735043800, 1730232668, 1, 0, 0, 0, '', 128, '', 0, 0, 0, 0, NULL, '', 0, 0, 0, 0, 'default', 2, NULL, 0, 'tsv_contactperson', 0, 0, '', 'small', 0, '', 3, '', '', '', NULL, 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(27, 1, 1731005631, 1730232893, 1, 0, 0, 0, '', 128, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 0, NULL, 0, 'shortcut', 0, 0, '', 'small', 0, '', 3, '', '', '', NULL, 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, '', 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(28, 26, 1730233405, 1730233265, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'textpic', 0, 0, '', 'small', 1716505200, 'TSV Ladbergen II ist auf Wiedergutmachung aus', 3, '', 't3://page?uid=26#28', '', '<p><strong>Nach der zweiwöchigen Osterpause geht es für die Handballer der TSV-Reserve am</strong><br /><strong>Samstag mit einem Heimspiel weiter. Zu Gast in der Rott-Sporthalle ist dann Adler</strong><br /><strong>Münster.</strong></p>\r\n<p>Auf dem Papier eine ziemlich klare Angelegenheit. Die Münsteraner bekleiden mit<br />8:30 Punkten derzeit Platz 12 und haben nur noch theoretische Chancen auf den<br />Klassenerhalt in der Münsterlandklasse. Die Ladberger hingegen haben mit zuletzt<br />fünf Siegen in Serie einen gesicherten Mittelfeldplatz fest im Visier. Nur eine Sache<br />gießt dabei doch Öl ins Feuer, denn die Ladberger erlitten im Hinspiel eine herbe<br />30:23-Schlappe in Münster. Das Team von Trainergespann Stork/Friese ist also<br />entsprechend gewarnt fokussiert an die Sache zu gehen. „Bei Adler Münster weiß<br />man nie was einen so wirklich erwartet. Es liegt immer ganz daran welches Personal<br />den Gästen zur Verfügung steht. In der Hinrunde haben wir gesehen was passieren<br />kann, wenn Münster gut drauf ist. Aber wir wollen in eigener Halle den sechsten Sieg<br />in Serie holen und uns für den Saisonendspurt positionieren“, so Trainer Thorsten<br />Stork.<br /><br />Personell müssen die Ladberger am Wochenende auf die Rückraumspieler Jan<br />Hakmann und Dominik Walter verzichten, sowie auf Bernd Stiepermann und Tobias<br />Kipp. Der Rest des Kaders ist einsatzbereit.<br />Anwurf der Partie ist Samstag, 18 Uhr in der Rott-Sporthalle Ladbergen</p>', 1, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(29, 16, 1735043810, 1730233587, 1, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 2, NULL, 0, 'tsv_contactperson', 0, 0, '', 'small', 0, '', 3, '', '', '', NULL, 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(30, 16, 1742467215, 1730233622, 0, 0, 0, 0, '', 128, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, 'Willkommen in unserer Judo-Abteilung!', 3, '', '', '', '<p>Judo ist mehr als nur ein Sport – es ist eine faszinierende Kampfkunst, die Kraft, Technik und Respekt vereint. In unserem Verein bieten wir Training für alle Altersklassen und Leistungsstufen, vom Anfänger bis zum erfahrenen Judoka. Unser engagiertes Trainerteam vermittelt nicht nur die Techniken des Judo, sondern auch wichtige Werte wie Fairness, Disziplin und Teamgeist.</p>\r\n<p>Egal, ob du Judo als Wettkampfsport betreiben oder einfach deine Fitness und Selbstverteidigungsfähigkeiten verbessern möchtest – bei uns bist du genau richtig! Komm vorbei und erlebe die Dynamik und Gemeinschaft unseres Judo-Teams.</p>\r\n<p>Wir freuen uns auf dich!</p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(31, 5, 1735043826, 1730276085, 1, 0, 0, 0, '', 64, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 2, NULL, 0, 'tsv_contactperson', 0, 0, '', 'small', 0, '', 3, '', '', '', NULL, 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(32, 6, 1739860837, 1730314263, 0, 0, 0, 0, '', 192, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 2, NULL, 0, 'text', 0, 0, 'small', 'small', 0, 'Trainingszeiten', 6, '', '', '', '<figure class=\"table\"><table><tbody><tr><td><strong>Sonntags:</strong></td><td>10.00 - 12.00 Uhr</td></tr><tr><td><strong>Freiluftsportanlage Königsbrücke</strong><br><span>Zur Königsbrücke 7</span><br><span>49549 Ladbergen</span></td><td>&nbsp;</td></tr></tbody></table></figure>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(33, 8, 1735043805, 1730315381, 1, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 2, NULL, 0, 'tsv_contactperson', 0, 0, '', 'small', 0, '', 3, '', '', '', NULL, 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(34, 28, 1730315668, 1730315625, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'textpic', 0, 0, '', 'small', 0, '', 3, '', '', '', '<p>Liebe Fans,</p>\r\n<p>besucht unseren <a href=\"https://www.facebook.com/TSV.Ladbergen.Handball.Damen.tsvladbergendamen\" target=\"_blank\" rel=\"noopener\"><strong>Facebookauftritt</strong></a>.</p>', 1, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(35, 29, 1730315760, 1730315760, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, '', 0, 0, 0, 0, 'default', 1, NULL, 0, 'textpic', 0, 0, '', 'small', 0, '', 3, '', '', '', '<p>Die Vereine TV Kattenvenne, HSG Hohne/Lengerich und der TSV Ladbergen haben den Jugendbereich in der JSG Tecklenburger Land zusammengelegt.</p>\r\n\r\n<p><a href=\"https://www.jsg-tl.de/\" target=\"_blank\" rel=\"noopener\"><strong>› zur Website vom JSG Tecklenburger Land</strong></a></p>', 1, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
