        </field>\n                <field index=\"settings.templateLayout\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>', NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(44, 8, 1731072654, 1731072356, 0, 0, 0, 0, '', 128, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, 'Herzlich willkommen im Handballbereich', 3, '', '', '', '<p>Hier dreht sich alles um Teamgeist, Leidenschaft und den unermüdlichen Einsatz für den Handballsport. Egal, ob du ein erfahrener Spieler, ein Neuling oder einfach nur ein begeisterter Fan bist – bei uns findest du die perfekte Plattform, um deine Fähigkeiten zu entwickeln, neue Freundschaften zu schließen und Teil einer lebendigen Gemeinschaft zu werden.</p>\r\n<p>Unser engagiertes Trainerteam fördert nicht nur die sportliche Leistung, sondern legt auch großen Wert auf Fairness, Respekt und Spaß am Spiel. Von den Jüngsten in der Jugendabteilung bis hin zu unseren ambitionierten Erwachsenenmannschaften – wir bieten für jedes Alter und jedes Leistungsniveau die passende Trainingsmöglichkeit.</p>\r\n<p>Schau dich um, informiere dich über unsere Teams, Trainingszeiten und bevorstehenden Veranstaltungen. Wir freuen uns darauf, dich bald in der Halle willkommen zu heißen! Gemeinsam bringen wir den Handball zum Blühen!</p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
