(60, 10, 1742467343, 1742467343, 0, 0, 0, 0, '', 128, '', 0, 0, 0, 0, NULL, '', 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, 'Willkommen in unserer Gymnastik-Abteilung!', 3, '', '', '', '<p>Beweglichkeit, Kraft und Spaß an der Bewegung – das ist Gymnastik in unserem Verein! Egal ob jung oder alt, Einsteiger oder Fortgeschrittene, wir bieten abwechslungsreiche Kurse für alle, die ihre Fitness verbessern und sich in angenehmer Atmosphäre bewegen möchten. Von klassischer Gymnastik über funktionelles Training bis hin zu entspannenden Einheiten – bei uns steht die Freude an der Bewegung im Mittelpunkt.</p>\r\n<p>Komm vorbei, bleib aktiv und erlebe die positive Wirkung von Gymnastik auf Körper und Geist! Wir freuen uns auf dich.</p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
