(70, 42, 1751449718, 1751449718, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, '', 0, 0, 0, 0, 'default', 1, NULL, 0, 'news_newsdetail', 0, 0, '', 'small', 0, '', 3, '', '', '', NULL, 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, '<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"settings.singleNews\">\n                    <value index=\"vDEF\"></value>\n                </field>\n                <field index=\"settings.previewHiddenRecords\">\n                    <value index=\"vDEF\">2</value>\n                </field>\n                <field index=\"settings.startingpoint\">\n                    <value index=\"vDEF\">30</value>\n                </field>\n                <field index=\"settings.recursive\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n        <sheet index=\"additional\">\n            <language index=\"lDEF\">\n                <field index=\"settings.detailPid\">\n                    <value index=\"vDEF\">42</value>\n                </field>\n                <field index=\"settings.listPid\">\n                    <value index=\"vDEF\">41</value>\n                </field>\n                <field index=\"settings.backPid\">\n                    <value index=\"vDEF\">41</value>\n                </field>\n                <field index=\"settings.excludeAlreadyDisplayedNews\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"settings.disableOverrideDemand\">\n                    <value index=\"vDEF\">1</value>\n                </field>\n            </language>\n        </sheet>\n        <sheet index=\"template\">\n            <language index=\"lDEF\">\n                <field index=\"settings.media.maxWidth\">\n                    <value index=\"vDEF\"></value>\n              