(71, 43, 1753123447, 1751450102, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'full-width', 0, NULL, 0, 'html', 0, 0, '', '', 0, 'Platzbuchung iFrame', 3, '', '', '', '<iframe src=\"https://app.tennis-club.net/?tvid=6695&dev=0&direkt=52&nolayout=1\" style=\"height: auto; width: 100%; outline: 0; border: 0; margin: 0 auto;\"></iframe>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(72, 11, 1753183160, 1751450644, 0, 1, 0, 0, '', 768, '', 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 0, 0, 0, 0, 'default', 1, NULL, 0, 'html', 0, 0, '', 'small', 0, 'Digitaler Mitgliedsantrag iFrame', 3, '', '', '', '<iframe src=\"https://app.tennis-club.net/?tvid=6695&dev=0&direkt=106&nolayout=1\" style=\"height: 2150px; width: 100%; outline: 0; border: 0; margin: 0 auto;\"></iframe>\r\n', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(73, 43, 1753124226, 1753118856, 0, 0, 0, 0, '', 32, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'large', 0, '', 4, '', '', '', '<p>Über unser Online-Buchungssystem kann jeder, sowohl TSV Mitglied als auch Gastspieler, einfach und flexibel Spielzeiten reservieren. <strong>Besonderes Bonbon: Alle TSV Mitglieder können bis zum 31.12.2025 die neue Sportart kostenlos erproben.</strong></p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(74, 43, 1753121742, 1753119045, 0, 0, 0, 0, '', 64, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 0, NULL, 0, 'header', 0, 0, '', '', 0, 'Termin aussuchen und Platz buchen', 3, 'center', '', '', NULL, 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(75, 39, 1753124052, 1753120517, 0, 0, 0, 0, '', 320, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'extra-large', 0, 'Was ist Padel?', 4, '', '', '', '<p>Padel (auch „Padel-Tennis“) ist eine der am schnellsten wachsenden Sportarten Europas. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz und von Wänden umgeben ist. Padel ist leicht zu erlernen, für jedes Alter und jeden Fitnesszustand geeignet, macht von der ersten Minute an Spaß und ist durch das kleinere Feld besonders kommunikativ.</p>\r\n\r\n<p><strong>Die wichtigsten Merkmale:</strong></p>\r\n<ul><li>Gespielt wird üblicherweise im Doppel (2 gegen 2).</li><li>Der Schläger ist kürzer, ohne Saiten und hat eine feste Schlagfläche mit Löchern.</li><li>Die Bälle ähneln Tennisbällen, sind aber etwas weniger druckvoll.</li><li>Die Wände dürfen – nach dem Aufprall auf dem Boden – ins Spiel einbezogen werden.</li><li>Punkte werden ähnlich wie beim Tennis gezählt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erhält den Punkt.</li></ul>\r\n<p class=\"text-end\">&nbsp;</p>\r\n<p class=\"text-end\"><a href=\"t3://page?uid=43\"><strong>Jetzt Platz buchen &gt;&gt;</strong></a></p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(76, 45, 1753189459, 1753120965, 0, 0, 0, 0, '', 256, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, 'Häufig gestellte Fragen (FAQs)', 3, '', '', '', '<p><strong>Muss ich Mitglied beim TSV Ladbergen sein, um den Platz zu buchen?</strong></p>\r\n<p>Nein, auch Gäste können den Court buchen. Alle TSV Mitglieder können den Sport bis zum 31.12.2025 kostenlos spielen. Wenn Du bereits TSV Tennis-Mitglied bist, kannst Du ab dem 01.01.2026 auch weiterhin den Padel Court kostenfrei nutzen.<br />&nbsp;</p>\r\n<p><strong>Ich möchte regelmäßig spielen und nicht immer einzeln zahlen müssen. Bietet ihr eine „Flatrate“ an?</strong></p>\r\n<p>Ja. Als TSV Mitglied mit einem Zusatzbeitrag für Padel kannst Du so oft spielen, wie Du möchtest. Über diesen Antrag kannst Du ganz TSV Mitglied werden und/oder die zusätzliche Padel-Flatrate dazu buchen.&nbsp;</p>\r\n<p class=\"text-end\"><a href=\"t3://page?uid=11\">Zum Digitalen Mitgliedsantrag</a></p>\r\n\r\n<p><strong>Wie viele Spieler*innen braucht man für eine Partie?</strong></p>\r\n<p>Padel wird standardmäßig als Doppel, also mit 4 Spieler*innen gespielt.</p>\r\n\r\n<p><strong>Benötige ich eigene Ausrüstung?</strong></p>\r\n<p>Nein, Schläger und Bälle stellt der TSV kostenlos im Eingangsbereich der Umkleidekabinen bereit. Zugang zu den Kabinen erhältst Du nach erfolgter Buchung. Eine eigene Ausrüstung darf selbstverständlich mitgebracht werden.</p>\r\n\r\n<p><strong>Welches Schuhwerk wird empfohlen?</strong></p>\r\n<p>Es wird auf Kunstrasen gespielt. Ideal sind Tennisschuhe mit Fischgrätprofil oder spezielle Padelschuhe. Zum Einstieg sind jedoch auch herkömmliche Sportschuhe ausreichend.<br />&nbsp;</p>\r\n<p><strong>Wie lange dauert eine Spielzeit?</strong></p>\r\n<p>Die Buchungseinheit beträgt 60 Minuten. Längere Spielzeiten sind je nach Verfügbarkeit möglich.<br />&nbsp;</p>\r\n<p><strong>Was kostet eine Stunde auf dem Court für Gastspieler?</strong></p>\r\n<p>Im Zeitraum von montags bis freitags bis jeweils 16 Uhr beträgt der Preis 20 € für 4 Gastspieler. Für alle anderen Zeiten werden 28 € fällig.<br />&nbsp;</p>\r\n<p><strong>Wie erfolgt die Preisermittlung, wenn sowohl TSV-Mitglieder als auch Gäste zusammen spielen wollen?</strong></p>\r\n<p>Bei der Buchung sind stets alle 4 Spieler namentlich anzugeben und eine entsprechende Mitgliedschaft zu kennzeichnen. Nichtmitglieder zahlen pro Stunde 20€ /4 = 5 € bzw. zur Prime Time 28 € / 4 = 7 €. Der Rechnungsbetrag wird so stets in Abhängigkeit von der Gastspieler*innen und der gewünschten Uhrzeit individuell berechnet.&nbsp;</p>\r\n\r\n<p><strong>Welche Bezahlmöglichkeiten bietet ihr an?</strong></p>\r\n<p>Wenn Du Dich für die TSV Mitgliedschaft inklusive Padel Flatrate entscheidest, kann der Jahresbeitrag ganz einfach per SEPA-Lastschriftmandat eingezogen werden. Gäste können das etablierte PayPal-Verfahren nutzen. An der Erweiterung der Bezahloptionen wird gearbeitet. Barzahlungen sind leider nicht möglich.&nbsp;</p>\r\n\r\n<p><strong>Gibt es eine Beleuchtung für Abendspiele?</strong></p>\r\n<p>Ja! Der Platz ist mit moderner LED-Flutlichtanlage ausgestattet und auch abends bis 22 Uhr bespielbar.</p>\r\n\r\n<p><strong>Wo befindet sich der Padelcourt?</strong></p>\r\n<p>Der Court befindet sich direkt auf dem Gelände der TSV Tennis Abteilung, Lengericher Straße 10a in Ladbergen. Parkplätze sind ausreichend vorhanden.<br />&nbsp;</p>\r\n<p><strong>Kann ich den Court auch für Firmenevents oder Gruppenangebote mieten?</strong></p>\r\n<p>Ja! Gerne bieten wir bieten individuelle Angebote für Gruppen, Firmen oder Schulklassen an. Kontaktiert dazu gerne den angegebenen Padel-Ansprechpartner.</p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(77, 39, 1753122096, 1753121831, 0, 1, 0, 0, '', 576, '', 0, 0, 0, 0, NULL, 0x7b2268696464656e223a22227d, 0, 0, 0, 0, 'default', 1, NULL, 0, 'header', 0, 0, '', 'small', 0, 'Jetzt Platz buchen >>', 4, 'right', 't3://page?uid=43', '', NULL, 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
(78, 43, 1753123570, 1753123554, 0, 0, 0, 0, '', 48, '', 0, 0, 0, 0, NULL, , 0, 0, 0, 0, 'default', 1, NULL, 0, 'text', 0, 0, '', 'small', 0, 'Gemeinsam Padel erleben!', 4, '', '', '', '<p>Ob Training, Freizeitsport oder Turnier! Wir möchten Padel zu einem generationenübergreifenden Treffpunkt für Sport, Spaß und Gemeinschaft machen. Bei Fragen oder Anregungen schreibe uns gerne eine E-Mail an <a href=\"mailto:padel@tsv-ladbergen.de\"><span style=\"color:#0563c1;\"><u>padel@tsv-ladbergen.de</u></span></a>.</p>', 0, 0, 0, 0, 0, 0, 0, 2, NULL, 0, '', 0, NULL, 1, 0, NULL, NULL, '', 0, 0, '', 124, 0, 0, 0, NULL, 0, '', '', '', 0, 0, 0, '', '', 0, 0),
