INSERT INTO `tx_news_domain_model_news` (`notes`, `uid`, `pid`, `tstamp`, `crdate`, `deleted`, `hidden`, `starttime`, `endtime`, `fe_group`, `editlock`, `sys_language_uid`, `l10n_parent`, `l10n_source`, `l10n_state`, `t3_origuid`, `l10n_diffsource`, `t3ver_oid`, `t3ver_wsid`, `t3ver_state`, `t3ver_stage`, `sorting`, `title`, `teaser`, `bodytext`, `datetime`, `archive`, `author`, `author_email`, `categories`, `related`, `related_from`, `related_files`, `fal_related_files`, `related_links`, `type`, `keywords`, `description`, `tags`, `media`, `fal_media`, `internalurl`, `externalurl`, `istopnews`, `content_elements`, `path_segment`, `alternative_title`, `sitemap_changefreq`, `sitemap_priority`, `import_id`, `import_source`) VALUES
('', 1, 30, 1730792860, 1730792716, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 0, 'Kürriege des TSV Ladbergen überzeugt in Gievenbeck', 'Mit dem Hinrunden Wettkampf in Münster-Gievenbeck, starteten auch die Wettkampfklassen IV und V ( Kürbereich ) am letzten Sonntag in die diesjährige Bezirksliga.', '<p>In der Wettkampfklasse IV, gingen am Sonntag insgesamt 13 Mannschaften in zwei Durchgängen in der Sporthalle des Freiherr vom Stein Gymnasium an den Start. Dabei war der Start am Boden durchaus gelungen, wobei hier viel ausprobiert wurde, was die Mädels im Training erarbeitet hatten. Weiter ging es für die TSV-Riege am Sprung. Hier gelang Hanna Busiek ein besonders schön gestreckter Überschlag. Am dritten Gerät, dem Reck, blieben die TSV Turnerinnen im Rahmen ihrer Möglichkeiten, aber leider auch hinter der Konkurrenz zurück. Zum Abschluss, ging es dann noch an den Balken. Dabei blieb die komplette Mannschaft ohne Sturz und Lea-Marie Keller zeigte eine richtig gute P8-Übung, die aber leider nicht mit vielen Punkten belohnt wurde! Mit insgesamt 172,50 Punkten, belegte die TSV Mannschaft mit Hanna Busiek, Laura Herta, Lea-Marie Keller, Marlene Salinga und Finnia Herta am Ende den 8.Platz und kassierte somit auch 6 Platzierungspunkte. Bei der Rückrunde, die am 28./29.September in Beckum ausgetragen wird, möchte sich die Riege noch den einen oder anderen Platz nach vorne arbeiten.</p>\r\n<p>Einen überzeugenden Start in die diesjährige Bezirksliga, legte am Sonntag die neu zusammengestellte Kürriege des TSV in Münster-Gievenbeck hin. Auch hier, waren insgesamt 13 Mannschaften in zwei Durchgängen am Start. Der Start der Mannschaft, erfolgte am Lieblingsgerät dem Boden. Hier möchten immer alle Mädels der Riege turnen, was die Nominierung für die Trainerinnen immer sehr schwierig macht. Svea Behling sorgte hier für einen top Start, als sie mit einer 13,50 Wertung die zweithöchste Tageswertung erzielte. Zudem turnten alle TSV Mädchen hier sehr ausdrucksstark. Am Sprung, agierten die TSV Mädchen solide, wobei hier einige schwierigere Sprünge im Wettkampf ausprobiert wurden. Die Leistungen am Barren können bis zur Rückrunde noch verbessert werden. Hier war die Konkurrenz deutlich stärker. Am Zittergerät dem Balken lief es dann wie geschmiert. Keine Turnerin musste das Gerät verlassen. Lediglich einige „Wackler“ hatten sich in die Übungen geschlichen. Besonders Sarah Maneke zeigte eine souveräne Leistung und wurde mit 12,40 Punkten belohnt. Dabei kamen nur die Mädchen des Siegerteams zu höheren Wertungen. Mit insgesamt 143,60 Punkten, belegte die Kürriege in der Endrunde am Ende einen guten 5.Platz und kassierte dabei 9 Platzierungspunkte ein. „Beide Riegen haben einen tollen Zusammenhalt und sind total motiviert für die Rückrunde noch etwas drauf zu packen“, so das TSV Trainerteam nach dem Wettkampf.</p>', 1715928240, 0, '', '', 1, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 1, NULL, NULL, 0, 0, 'kuerriege-des-tsv-ladbergen-ueberzeugt-in-gievenbeck', '', '', '0.5', '', ''),
('', 2, 30, 1731006696, 1731006294, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 0, 'Tennis Ballschule geht in die dritte Runde! ', '', '<p>Schon im vergangenen Jahr konnten wir viele Kinder mit dem sportlichen Angebot der \"Tennis-Ballschule\" begeistern. Samstags von 09:30 Uhr bis 10:30 Uhr können Kids von 5 bis 8 Jahren gemeinsam Sport machen, Tennis spielen und Fähigkeiten und Interessen austesten. Viele nehmen auch schon das dritte Mal infolge an der Aktion teil. Weitere Termine finden wöchentlich bis zu den Osterferien in der Sporthalle Jahnstraße statt. Neuanmeldungen sind immer herzlich willkommen!</p>', 1731006265, 0, '', '', 1, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 1, NULL, NULL, 0, 0, 'tennis-ballschule-geht-in-die-dritte-runde', '', '', '0.5', '', ''),
('', 3, 30, 1731052338, 1731006385, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 0, 'Jahresauftakt in der TSV Tennisabteilung', 'Vergangenen Freitag fand die Jahreshauptversammlung der TSV Tennisabteilung statt. Neben dem Jahresrückblick 2023 und der Aussprache über die Kassenlage, standen vor allem die Jugendarbeit und die Angebote für das aktuelle Jahr auf der Agenda.', '<p>Besonders erfreulich war die Aktion Ballschule im letzten Frühjahr und im Herbst, bei der Kinder ab fünf Jahren in den Tennissport schnuppern konnten. „Neben dem normalen Trainingsangebot wollen wir dauerhaftes Schnupper-Tennis für Kinder ermöglichen und sie so das gesamte Jahr mit einem Angebot begleiten“, erklärt Rainer Jendroska, 1. Vorsitzender der Abteilung. „Die Ballschule findet auch aktuell wieder statt und soll langfristig in unser Vereinsprogramm aufgenommen werden“. Auch Aktionen wie das Oster-Camp und das Sommer-Camp sind wieder in Planung. Der 1. Vorsitzende spricht noch einen besonderen Dank an die Sponsoren wie die Kreissparkasse Steinfurt und die Familienstiftung Ladbergen aus, die durch ihre Förderung die Jugendarbeit in dieser Form erst ermöglicht haben.</p>\r\n<p>Neben der Jugendarbeit wird auch der Erwachsenen-Bereich mit einem breiten Angebot an vereinsinternen Turnieren und leistungsorientierten Liga-Mannschaften gefördert. „Schon im letzten Jahr hatten wir eine große Beteiligung bei den Erwachsenen. Durch den Zuwachs aus dem Kattenvenner Verein haben wir jetzt viel mehr Möglichkeiten, auch unterschiedliche Mannschaften nach Leistungen und Spielinteressen zu melden“, so Jens Tiemann, Sportwart der TA. „Neben der regulären Damen 40 Mannschaft wird es erstmals eine reine Doppelmannschaft geben“.</p>\r\n<p>Die Besetzung des Vorstandes blieb fast unverändert. Nach über 10 Jahren Vereinsarbeit hat sich nur Katja Brünemeyer aus ihrer Position als Trainingskoordinatorin verabschiedet. Lina Kötterheinrich wurde als Nachfolgerin gewählt.</p>\r\n<p>Der offizielle Startschuss für die kommende Sommersaison ist wieder das traditionelle Familienosterfeuer am Ostersonntag. Hier sind alle Vereinsmitglieder, Familien und Freunde herzlich eingeladen. Sportlich geht es dann ab April los mit dem internen Mixed-Doppel-Turnier.</p>', 1720461900, 0, '', '', 1, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 0, NULL, NULL, 0, 0, 'jahresauftakt-in-der-tsv-tennisabteilung', '', '', '0.5', '', ''),
('', 4, 30, 1732554725, 1732554543, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 0, 'TSV-Turnerinnen verteidigen Podiumsplätze', 'Kurz nach den Sommerferien stand mit der Rückrunde in den Wettkampfklassen 1 und 2 für die Turnerinnen des TSV Ladbergen schon der erste Wettkampf an. Dabei galt es in Ibbenbüren die in der Hinrunde erreichten zweiten Plätze zu verteidigen. Zur großen Freude der mitgereisten Fans gelang es beiden Mannschaften einen Platz auf dem Treppchen zu erreichen!', '<p>Foto: Hintere Reihe (v.l.): Clara Haase, Hannah Kimmina, Maya Labban, Zoe Lautenschläger, Greta Austermann, Ella Kolzow<br />Vordere Reihe (v.l.): Lucy Berghaus, Arina Matyusha, Alysha Ates, Melina Herte, Lena Knüfer, Klara Vietmeier</p>\r\n\r\n<p>In der Wettkampfklasse 1 (Jahrgang 2015 und jünger) ging die Mannschaft mit Clara Haase, Greta Austermann, Ella Kolzow, Hannah Kimmina, Maya Labban und Zoe Lautenschläger in bewährter Besetzung an den Start. Die Mädchen zeigten an ihrem Startgerät Sprung (55,0 Punkte), am Reck (56,1) sowie am Schlussgerät Boden (55,3) gute Leistungen und konnten ihre Trainingsleistungen abrufen. Herausragend war die Leistung von Zoe Lautenschläger am Reck. Ihr gelang eine perfekte Übung, die zurecht mit der vollen Punktzahl (15,0 Punkte) belohnt wurde – mehr ist in dieser Wettkampfklasse nicht möglich! Am Schwebebalken lief es für die TSV-Turnerinnen jedoch nicht wie gewünscht. Mehrere ungeplante Abgänge führten zu niedrigen Wertungen (52,1) und ließen die Spannung vor der Siegerehrung noch einmal steigen. In der Gesamtwertung der Hin- und Rückrunde lagen schließlich die Mannschaften aus Ladbergen und aus Nienberge mit jeweils 19 Platzpunkten gleichauf, sodass die erturnten Punkte den Ausschlag über Platz 2 und 3 geben mussten. Hier landeten die TSV-Turnerinnen mit 438,3 Punkten mit einem hauchdünnen Rückstand von 0,15 Punkten auf dem Bronzerang. Ein toller Erfolg in einem sehr starken Teilnehmerfeld von 14 Mannschaften.</p>\r\n<p>Die Mannschaft in der Wettkampfklasse 2 (Jahrgang 2013 und jünger) musste verletzungsbedingt auf Melina Herte verzichten, wurde jedoch durch die Nachwuchsturnerin Alysha Ates verstärkt. So ging es für Klara Vietmeier, Lena Knüfer, Arina Matyusha und Lucy Berghaus ebenfalls darum, die Leistungen aus der Hinrunde zu bestätigen. Die Turnerinnen starteten mit guten Leistungen am Sprung in den Wettkampf (58,5 Punkt). Nach einem schwachen Einturnen am Reck gelang jedoch allen Mädchen im Wettkampf sehr gute und flüssige Übungen (60,95). Lena Knüfer gelang hier mit 15,85 Punkten gar die Tageshöchstwertung in dieser Wettkampfklasse. Am Schwebebalken (57,5) zeigten die TSV-Turnerinnen dann ungewohnte Nerven und leisteten sich einige Patzer, die nur zu Rang 8 in der Gerätewertung führten. Die verlorenen Punkte galt es nun am Abschlussgerät Boden wieder gutzumachen. Mit stark verbesserten Übungen im Vergleich zur Hinrunde und einer konzentrierten Leistung erreichte die Mannschaft hier starke 61,4 Punkte. Bei der Siegerehrung kam es zur gleichen Situation wie schon im Wettkampf 1: Die Mannschaften aus Ladbergen und aus Warendorf hatten nach Hin- und Rückrunde jeweils 19 Platzpunkte erreicht. Doch dieses Mal hatten die TSV Turnerinnen die Nase vorn. Mit 472,05 Punkten und 1,55 Punkten Vorsprung konnten sie sich den zweiten Platz unter 12 Mannschaften sichern und verdient die Silbermedaille entgegennehmen.</p>\r\n<p>Das Trainerteam zeigte sich mit den gezeigten Leistungen und den erreichten Top-Platzierungen mehr als zufrieden. Dass beide Mannschaften einen Treppchenrang erreichen, war vor der Saison nicht absehbar und ist eine Bestätigung für den großen Einsatz beim Training. Zum Abschluss der Ligasaison steht nun Ende September noch die Rückrunde für die Mannschaften in den Wettkampfklassen 4 und 5 an.</p>', 1732554499, 0, '', '', 1, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 1, NULL, NULL, 0, 0, 'tsv-turnerinnen-verteidigen-podiumsplaetze', '', '', '0.5', '', ''),
('', 5, 30, 1732555886, 1732555536, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 0, 'TSV Turnerinnen liefern in Beckum ab', 'Am vorletzten Wochenende fand die Rückrunde zur Bezirksliga für die älteren Turnerinnen statt.', '<p>Als nächsetes stehen die Bezirks-Einzelmeisterschaften am Samstag, 09.11. auf dem Programm.</p>', 1732555324, 0, '', '', 1, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 2, NULL, NULL, 0, 0, 'tsv-turnerinnen-liefern-in-beckum-ab', '', '', '0.5', '', ''),
('', 6, 30, 1733826108, 1732556241, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 0, 'Sehr erfolgreiche Bezirks-Einzelmeisterschaften für unsere Turnerinnen', 'Insgesamt 6 Treppchenplätze für Ladberger Nachwuchsturnerinnen. Seit vielen Jahren schon finden die Bezirkseinzelmeisterschaften in Beckum statt. Das bedeutet für die Ladberger Turnerinnen und Fans immer eine ordentliche Anreise und für die verantwortlichen Trainer, als auch die Kampfrichterinnen, steht dann ein langer Wettkampftag an! Aber in diesem Jahr wurden alle durch hervorragende Leistungen und auch Ergebnisse belohnt.', '<p>Ebenfalls im ersten Durchgang starteten in der Altersklasse 13 Jahre und älter Hanna Busiek und Laura Herter. Auch dieser Wettkampf begann am Boden. Hier zeigten beide Turnerinnen alles, was sie in den letzten Trainingseinheiten geübt hatten. Weiter ging es dann am Sprung! Beide Mädels zeigten schöne Überschläge, die mit guten Punkten belohnt wurden. Am Barren konnte besonders Hanna punkten. Für ihre Übung ohne Zwischenschwung wurde sie mit 14,80 Punkten belohnt. Bis hierher lief alles noch nach Plan, aber dann kam der Zitterbalken und machte seinem Namen alle Ehre. Leider mussten Laura, als auch Hanna ungewollt absteigen. Dennoch können beide Stolz auf ihre Leistung sein, denn \"wer nicht wagt, der nicht gewinnt\". Am Ende platzierte sich Laura auf Platz 13 und Hanna auf Platz 16 von insgesamt 23 Turnerinnen.</p>\r\n<p>Für den zweiten Durchgang reisten dann die nächsten Turnerinnen an. Die Wettkampfklasse der 8 -jährigen &nbsp;war mit 23 Teilnehmerinnen stark besetzt. Unser Trio Greta Austermann, Clara Haase, Alysha Ates startete am Schwebebalken. Alle Mädels hatten sich die P6 vorgenommen und alles schafften die Übung ohne Sturz. Am Boden lief alles rund. Auch die Strecksprünge mit einer ganzen Drehung klappten. Danach ging es zum Sprung. Am Mattenberg musste ein Überschlag in die Rückenlage gezeigt werden. Hier belohnten die Kampfrichterinnen die Sprünge mit guten Wertungsnoten. Am Ende stand noch das Reck auf dem Programm. Hier zeigte Alysha eine schöne P6 und erhielt dafür 14,4 Punkte. Clara schaffte zum ersten mal im Wettkampf eine Felge am Reck und erhielt dafür 13,9 Punkte. Aber auch Greta erhielt für ihre P5 die gleiche Punktzahl (13,9) und daran kann man erkennen, dass viele Wege zum gleichen Ziel führen! Bei der Siegerehrung wurde dann Greta und Clara mit der exakt gleichen Punktzahl für den 10 Platz ausgezeichnet. Alysha belegte den guten 13. Platz!</p>\r\n<p>Der Wettkampf der 9-jährigen Mädchen begann ebenfalls am Schwebebalken. Hier traten für den TSV Ella Kolzow, Zoe Lautenschläger, Maya Labban und Hannah Kimmina an. Auf dem Wettkampfprogramm standen die Übungen im Schwierigkeitsgrad P5 und / oder P6. Den Wettkampf am Schwebebalken zu beginnen ist immer etwas schwierig, denn wenn die Nervosität noch in den Beinen steckt, ist es besonders schwierig immer in der Balance zu bleiben. Aber die TSVerinnen profitierten hier von ihrer Wettkampferfahrung und konnten ohne Absteiger bleiben. Anschließend ging es an den Boden, den die Mädchen immer gerne turnen. Es wurden alle Übungen sauber druchgeturnt und somit konnten gute Punkte einkassiert werden. Am Sprung hatten sich Zoe und Maya ihre ersten Überschläge über den Sprungtisch vorgenommen. Zoe konnte sich hier die höchste Wertung in ihrer Konkurrenz sichern (14,25 Punkte). Aber auch Maya nimmt ganz wichtige Erfahrungen mit nach Hause. Abschließend wartete noch das Reck. Hanna, Ella und Maya turnten ihre Übungen sauber durch, doch Zoe hatte direkt zu Beginn der Übung einen kleinen Wackler in der Übung, der sie so aus dem Konzept brachte, dass sie die sonst so sichere Felge nicht schaffte. &nbsp;Bei der Siegerehrung wurden insgesamt 33 Turnerinnen ausgezeichnet. Ella belegte in einer sehr starken Konkurrenz Platz 22, Hannah konnte sich Platz 14 sichern und Maya erturnte sich Platz 13. Für die Überraschung sorgte Zoe. Sie durfte mit insgesamt 58,25 auf das Treppchen für den 3. Platz steigen. Das ist bei so einer großen Teilnehmerzahl ein phantastisches Ergebnis!<br />In der Wettkampfklasse der 11-jährigen Mädchen hatte der TSV nur eine Starterin gemeldet. Klara Vietmeier begann ihren Wettkampf ebenfalls am Schwebebalken und turnte ihre P7 super-sauber durch. Zur Belohnung erhielt sie dafür 15,0 Punkte. Das war in ihrer Altersklasse die höchste Punktzahl! Weiter ging es am Boden. Hier wurde die Übung von Klara recht streng bewertet, aber das schmälerte die Motivation überhaupt nicht. Anschließend ging es zum Sprung und abschließend noch zum Barren. Eine flüssig durchgeturnte Übung brachte noch gute Punkte ein. Am Ende gelang es auch Klara einen der begehrten Treppchenplätze zu belegen. Mit 58,3 Punkte wurde sie mit der Bronzemedaille prämiert! Ein ganz toller Erfolg für die Turnabteilung des TSV!</p>\r\n<p>Nachmittags standen dann noch die Kür-Wettkämpfe auf dem Programm. Bei den jüngeren Turnerinnen Altersklasse 14 und jünger startete Daria Eberhardt. Enie Schlichter und Svea Behling mussten sich mit den älteren Turnerinnen messen. Als erstes Gerät stand hier der Boden auf dem Programm. Am Boden turnen die Mädels immer sehr gerne, hat man doch hier seine eigene Musik, die man mit einer ganz persönlichen Choreographie gestaltet hat. Alle drei zeigten viele höherklassige Teile, für die man einen Punktebonus erhält. So konnte man top motviert zum Sprung wechseln. Enie und Daria zeigten hier solide Handstandüberschläge, Svea versuchte sich an einem Yamshita, der aber punkte mäßig nicht belohnt wurde. Weiter ging es zum Barren. Daria startete und zog ihre Übung ohne Pause und Zwischenschwund durch. Auch bei Enie lief es wie geschmiert und sie gab den Kampfrichterinnen nur wenige Möglichkeiten ein paar Pünktchen abzuziehen. Beide wurden mit gerechten Wertungen belohnt. Lediglich Svea musste hier einen Sturz hinnehmen. Am letzten Wettkampfgerät dem Schwebebalken musste auch Daria leider unfreiwillig vom Gerät absteigen. Enie hingegen hatte einen richtigen Lauf und zeigte keine Schwäche. Leider kam auch Svea am Schwebebalken nicht ohne Sturz durch. Für die Siegerehrung hatten wir uns eigentlich gar nicht viel ausgerechnet, doch wir wurden positiv überrascht. Daria belegte in ihrer Wettkampfklasse den 3. Platz! Das ist umso bemerkenswerter, da es ihr erster Einzelwettkampf im Kürbereich war. Aber auch Enie konnte ihren nahezu perfekten Wettkampf mit dem 3. Platz belohnen. Ein sehr schöner Erfolg. Svea platzierte sich am Ende auf Platz 5.</p>\r\n<p>Das war ein super erfolgreicher Wettkampftag für die Turnerinnen aus Ladbergen. Die 16 Starterinnen konnten insgesamt einen Pokal für die Bezirksmeisterin und 5 Bronzemedaillen mit nach Hause nehmen. &nbsp;</p>\r\n\r\n\r\n\r\n\r\n', 1732556151, 0, '', '', 1, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 4, NULL, NULL, 0, 0, 'sehr-erfolgreiche-bezirks-einzelmeisterschaften-fuer-unsere-turnerinnen', '', '', '0.5', '', ''),
('', 7, 30, 1734262896, 1734072702, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 0, 'Adventliche Stimmung – einmal anders', 'TSV Turnabteilung freut sich über viele Teilnehmerinnen beim Nikolauswettkampf', '<p>Der Nikolauswettkampf erfreut sich seit vielen Jahren großer Beliebtheit. In diesem Jahr wurden insgesamt 430 Mädchen aus 20 Vereinen aus dem gesamten Münsterland angemeldet. Damit hatte in den Reihen der Organisatorinnen niemand gerechnet. Aus den Erfahrungen der letzten Jahre, wird der Wettkampfablauf für 400 Teilnehmerinnen geplant! Nun musst dieser aber noch etwas angepasst werden. Aber für das erfahrene Orga-Team stellte das keine großen Probleme dar. Der Start wurde kurzerhand um eine halbe Stunde nach vorne gezogen und noch ein paar Medaillen und Kuscheltiere nachbestellt.</p>\r\n<p>Nachdem am Freitagabend der Aufbau – Dank vieler, starker Helfer – in Rekordzeit erfolgt war, konnte es am Samstagmorgen direkt losgehen. Allerdings war relativ früh klar, dass es richtig eng auf der Tribüne werden sollte! So konnten leider nicht alle Fans einen Sitzplatz ergattern, aber die Stimmung war auch so phantastisch!</p>\r\n<p>Im Wettkampf der 6-jährigen Starterinnen waren 3 Mädchen vom TSV am Start. Sophie Labban sammelte insgesamt 44,6 Punkte und belegte hier den 36. Platz. Auch Aylin Omari (46. Platz) und Leni Augustin (Platz 48.) konnten erste Wettkampfluft schnuppern und einige tolle Erfahrungen mitnehmen.</p>\r\n<p>Im Wettkampf Nr. 3 waren insgesamt 93 Mädchen am Start. Diese sehr große Wettkampfklasse stellte die Kampfrichter vor eine besondere Aufgabe, mussten sie doch gerecht, aber dennoch flott alle Übungen bewerten. Ella Winterfeldt zeigte eine sehr schöne Übung am Boden und konnte damit viele Punkte einsammeln. Sie erreichte den 59. Platz. Auch Anni Jahn sammelte fleißig Punkte, wobei ihr eine besonders schöne Grätsche über den Bock gelang. Am Ende belegte sie Platz 73. LouAnn Hesse (79. Platz), Matilda Kuhn (84. Platz), Jette Karwinkel, Hannah Uennigmann und Hani Omari ließen sich von den zahlreichen Fans feiern.</p>\r\n<p>Auch im Wettkampf 4 – Jahrgang 2016 -&nbsp; war die Anzahl der Teilnehmerinnen riesig. 97 Turnerinnen zeigten hier, was sie in den letzten Wochen gelernt hatten. Anni Hertog vom TSV startete gut in den Wettkampf und konnte im Verlauf mit guter Haltung am Boden überzeugen. Insgesamt konnte sie 50,75&nbsp; Punkte einsammeln und belegte damit Platz 31. Charlotte Spieker turnte an ihrem ersten Wettkampf schon recht routiniert und sammelte viele Punkte am Reck ein. Am Ende stand ein 39. Platz! Bereits einige Wettkampferfahrung kann Daria Matyusha vorweisen, sie glänzte am Sprung und erreichte im Gesamtergebnis Platz 46. Katharina Andreae turnt erst seit kurzer Zeit beim TSV und durfte ihre erste Wettkampfluft schnuppern. Für den ersten Wettkampf legte sie eine solide Vorstellung hin – Platz 77! Auch Paulina Rehbaum und Pia Hempel zeigten an allen vier Geräten, was sie im Training gelernt hatten.</p>\r\n<p>Als alle Übungen im ersten Durchgang absolviert waren, alle Kampfrichterinnen die Wertungen ausgerechnet hatten und unser super-schnelles Auswertungsteam alles zusammengerechnet hatte, konnte die Siegerehrung stattfinden. Als das Licht ausging, war plötzlich alle Still und die Freude war groß, als der echte Nikolaus die Treppe herunterkam. Er attestierte allen Kindern gute Leistungen und wünschte weiterhin viel Spaß am Turnen. Alle Turnerinnen erhielten zur Belohnung der hervorragenden Leistungen eine Medaille und ein Kuscheltier!&nbsp;</p>\r\n<p>Nach einer kurzen Pause ging es dann mit den „älteren“ Turnerinnen weiter. In den Wettkampfklassen 5 – 8 (Jahrgänge 2015,2014,2013,2012/11) waren weitere TSV-Starterinnen vertreten. Marlene Leuker zeigt ihre Übungen in der Altersklasse der 9-Jährigen. Sie absolvierte alle vier Geräte ohne Sturz!</p>\r\n<p>Bei den 10-jährigen Turnerinnen waren insgesamt 42 Turnerinnen am Start. Lena Harmann startete gut in den Wettkampf und konnte viele Punkte am Boden und Schwebebalen einsammeln. Nach vier geturnten Geräten landete Lena auf Platz 23. Für Laura Hempel war es auch der erste Wettkampf. Eine besonders gelungene Übung konnte sie am Reck zeigen. Tamara Lott hatte einen guten Wettkampftag erwischt und konnte eine fehlerfreie Übung am Schwebebalken präsentieren.</p>\r\n<p>Auch am Ende dieses Durchgangs fand selbstverständlich eine Siegerehrung statt. Besonders schön war es zu sehen, dass viele Turnerinnen sich sehr über ihre Platzierungen freuten.</p>\r\n<p>Am Ende des Wettkampftages galt es noch DANKE zu sagen!!!! Einen besonderen Applaus bekamen die Helfer*innen an der Cafeteria, denn hier waren viele Kannen Kaffee zu kochen, Brötchen zu schmieren und Waffeln zu backen. Aber auch dem fleißigen Auf- und Abbauteam, dem Team des DRK und allen Trainerinnen wurde für die Unterstützung gedankt.</p>', 1734072537, 0, '', '', 1, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 3, NULL, NULL, 0, 0, 'adventliche-stimmung-einmal-anders', '', '', '0.5', '', ''),
('', 8, 30, 1743687630, 1743687428, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 0, 'Erfolgreiche Bezirksmeisterschaften der TSV-Turnerinnen', 'Volles Haus herrschte am Sonntag bei den Bezirksmeisterschaften der P-Turnerinnen in Ladbergen. In insgesamt sechs Wettkampfklassen traten jeweils neun qualifizierte Mannschaften an, um sich einen der begehrten Treppchenplätze zu sichern und damit die Qualifikation für die nächste Ebene zu erreichen. Der TSV Ladbergen hatte sich dabei auf Kreisebene mit allen angetretenen Mannschaften für diese Ebene qualifiziert und war somit in vier Wettkampfklassen vertreten.', '<p>In der Wettkampfklasse 2 (Jahrgang 2012 und jünger) schickte der TSV mit Melina Herte, Klara Vietmeier, Lucy Berghaus, Arina Matyusha und Lena Knüfer dasselbe Quintett an den Start, das sich im vergangenen Jahr sehr erfolgreich in diesem Wettkampf geschlagen hatte. Diesen Erfolg wollten die Turnerinnen wiederholen – allerdings nun in einer höheren Wettkampfklasse mit schwierigeren Übungen. Entsprechend groß war die Anspannung unter den Turnerinnen. Doch die Mädchen behielten die Nerven und zeigten ihre Wettkampf- und Teamstärke. Am Sprung turnten alle sehr gute Handstandüberschläge und erzielten insgesamt 58,4 Punkte, was den souveränen Sieg an diesem Gerät bedeutete. Auch an den anderen Geräten (Boden: 59,4 Punkte, 2. Platz/ Stufenbarren: 58,5 Punkte, 2. Platz/ Schwebebalken: 59,0 Punkte, 3. Platz) zeigte die Mannschaft gute Leistungen und kämpfte um jedes Zehntel. Bei der Siegerehrung war der Jubel dann riesengroß, als die TSV-Turnerinnen abermals die Silbermedaille in Empfang nehmen durften und damit die Qualifikation für die Gaumeisterschaften in eigener Halle gesichert war. In der inoffiziellen Einzelwertung stachen dabei Lena Knüfer mit Platz 2 und Lucy Berghaus mit Platz 6 heraus.</p>\r\n<p>Auch in der Wettkampfklasse 3 (Jahrgang 2014 und jünger) schickte der TSV ein aussichtsreiches Team an den Start. Maya Labban, Hannah Kimmina, Ella Kolzow, Clara Haase und Greta Austermann hatten bei den Kreismeisterschaften durch unnötige Fehler noch einige Punkte liegengelassen und wollten dies nun ändern – mit Erfolg! An allen vier Geräten zeigten sich die Mädchen stark verbessert. Am Sprung belegte die Mannschaft mit 57,65 Punkten sogar den 1. Platz in der Gerätewertung. Auch am Reck (57,7 Punkte, 3. Platz), Schwebebalken (54,8 Punkte, 5. Platz) und Boden (55,5 Punkte, 5. Platz) konnten die Turnerinnen ihre Trainingsleistung abrufen und zeigten gute Übungen. Hannah Kimmina (Platz 8) und Maya Labban (Platz 10) konnten mit durchgehend starken Leistungen überzeugen und turnten sich in der Einzelwertung unter die Top Ten. In der Mannschaftsgesamtwertung landeten die TSV-Turnerinnen schließlich auf dem undankbaren 4. Platz. Entsprechend groß war die Enttäuschung unter den Mädchen. Doch das Trainerteam zeigte sich rundum zufrieden: „Die Mädels haben sich enorm gesteigert und können sich nichts vorwerfen lassen. Die anderen Mannschaften waren heute einfach einen Tick stärker.“</p>\r\n<p>Im Wettkampf 1 (offener Jahrgang) schickte der TSV eine kurzfristig zusammengestellte Mannschaft an den Start, bei der es darum ging weitere Wettkampfpraxis zu sammeln. Bei den Kreismeisterschaften waren Laura Herter und Hanna Busiek noch als Duo an den Start gegangen, wurden aber jetzt spontan von Alysha Ates und Lena Harmann verstärkt. Die Turnerinnen konnten höhere Übungen unter Wettkampfbedingungen ausprobieren. Dies gelang Hanna Busiek besonders gut, sodass sie sich am Ende einen tollen 10. Platz in der Einzelwertung erturnte, während die Mannschaften den 8. Platz belegte.</p>\r\n<p>Auch die Turnerinnen der Wettkampfklasse 6 (Jahrgang 2014 und jünger) hatten sich für die Bezirksmeisterschaften qualifiziert. Die Mannschaft mit Laura Hempel, Katharina Andreae, Ella Winterfeldt, Tamara Lott und Lotta Willerscheidt konnte am Sprung (53,0 Punkte) gut mit der Konkurrenz mithalten. An den anderen Geräten zeigten sie jeodch noch einige Unsicherheiten und verloren damit einige Punkte. Am Ende belegten die Turnerinnen den 8. Platz in der Gesamtwertung.&nbsp;</p>\r\n<p>Für die qualifizierte Mannschaft heißt es nun den Übungen den nötigen Feinschliff zu verpassen für die finalen Gaumeisterschaften, die am 5. April wiederum vor heimischer Kulisse stattfinden.&nbsp;</p>', 1743687330, 0, '', '', 1, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 1, NULL, NULL, 0, 0, 'erfolgreiche-bezirksmeisterschaften-der-tsv-turnerinnen', '', '', '0.5', '', ''),
('', 9, 30, 1744092172, 1744092150, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 0, 'Bronzemedaille für TSV-Turnerinnen bei Münsterlandmeisterschaften', 'Am vergangenen Samstag fanden in Ladbergen die Münsterlandmeisterschaften im Geräteturnen statt – dem höchstmöglichen Wettkampf für Turnerinnen im P-Bereich. ', '<p>Bei diesem Wettkampf treffen die besten Mannschaften des Turngau Münsterlands, die sich über Wettkämpfe auf Kreis- und Bezirksebene qualifiziert haben, aufeinander. Darunter auch eine Mannschaft des TSV Ladbergen, die in der Wettkampfklasse 2 noch einmal vor heimischer Kulisse auftreten durfte.</p>\r\n<p>Für Lena Knüfer, Lucy Berghaus, Arina Matyusha, Melina Herte und Klara Vietmeier startete der Wettkampf am Boden. Hier zeigten alle Turnerinnen sehr gute Übungen, was der Mannschaft 59,35 Punkte und damit den 2. Platz in der Gerätewertung einbrachte. Wie schon beim letzten Wettkampf, lief es auch dieses Mal am Sprungtisch für die Mädchen besonders gut. Mit 60,2 Punkte belegten sie den 1. Platz an diesem Gerät. Am Stufenbarren bissen sich alle Turnerinnen durch, blieben mit insgesamt 56,4 Punkten (5. Platz in der Gerätewertung) jedoch insgesamt ein wenig unter ihren Möglichkeiten. Zum Abschluss ging es an den Schwebebalken. Hier zeigten sich die Mädchen sehr nervenstark, turnten saubere Übungen und konnten so mit 57,2 Punkte den 3. Platz an diesem Gerät erzielen.</p>\r\n<p>Großer Jubel brandete bei der Siegerehrung auf, als die TSV-Turnerinnen mit einer Gesamtpunktzahl von 233,15 Punkten das Treppchen besteigen und sich über die Bronzemedaille freuen durften. Dabei wurde der 2. Platz, den der TV Gescher belegte, um die Winzigkeit von 0,05 Punkten verfehlt. Dennoch waren Turnerinnen, Trainerinnen und die Fangemeinschaft zurecht stolz auf das erreichte Ergebnis.</p>\r\n<p>Mit diesem Erfolg im Rücken geht es nun an die Vorbereitung für die Bezirksliga, die nach den Osterferien startet.</p>', 1744091807, 0, '', '', 1, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 1, NULL, NULL, 0, 0, 'bronzemedaille-fuer-tsv-turnerinnen-bei-muensterlandmeisterschaften', '', '', '0.5', '', ''),
('', 10, 30, 1746090921, 1745339788, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 0, 'TSV Ladbergen belebt traditionelle Ostereierrallye wieder', 'Mit viel Spaß und Teamgeist fand in diesem Jahr die Osterrallye in Ladbergen statt. 53 Kinder traten in 12 Teams gegeneinander an und lieferten sich ein spannendes Kopf-an-Kopf-Rennen. Interessant: Es gab keinen 10., 11. oder 12. Platz – alle Teams waren nah beieinander!', '<p>Zwischen den Spielstationen mussten die Kinder knifflige Fragen lösen. Der richtige Weg zur nächsten Station wurde dabei durch kleine Hinweise auf ihren Fragebögen verraten – ein echtes Rätselabenteuer! An vier abwechslungsreichen Spielstationen konnten die Kinder ihr Können unter Beweis stellen. Bei Station 1 wartete ein Ball-Pong-Spiel, begleitet von Brezeln und Trinkpäckchen zur Stärkung. Station 2 forderte Fingerspitzengefühl: In einem Schuhkarton mussten Gegenstände wie eine Osterhasenfigur blind ertastet und erkannt werden. Station 3 verlangte echten Teamgeist – beim Langski-Lauf mussten die Kinder auf Skiern mit vier Schlaufen gemeinsam einen kleinen Parcours meistern.</p>\r\n<p>An der Zielstation in der Turnhalle wartete die finale Aufgabe: In einer großen Schale voller bunter Eier musste die Anzahl geschätzt werden – gar nicht so leicht!</p>\r\n<p>Zum Abschluss hielt das Orga-Team um Pia Hüsing und Sabine Haase für alle Kinder frische Waffeln, Getränke und Kekse bereit. Bei der Siegerehrung erhielt jedes Kind eine Urkunde und einen Schokohasen – der von den meisten mit Genuss direkt verputzt wurde.</p>\r\n<p>Ein gelungener Tag voller Freude und Bewegung!</p>', 1745339700, 0, '', '', 1, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 2, NULL, NULL, 0, 0, 'tsv-ladbergen-belebt-traditionelle-ostereierrallye-wieder', '', '', '0.5', '', ''),
('', 11, 30, 1745397624, 1745397456, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 0, 'Theo Schulz gewinnt beim Friese Masters', 'Nur wenige Kilometer von der Nordseeküste entfernt traten am Ostersamstag die Ladberger Judokas beim international besetzten Friese Masters in Stiens an.', '<p class=\"text-justify\">Für Aaron Schulz und Dennis Scheck verlief das Turnier herausfordernd. Beide jeweils im ersten Jahr ihrer Altersklasse, sahen sie sich einem sehr starken Teilnehmerfeld gegenüber. Aaron unterlag in beiden Begegnungen klar, zeigte sich jedoch kämpferisch: „Beim nächsten Mal knacke ich sie“, versprach er. Auch Dennis hatte es schwer. Während er im ersten Duell chancenlos blieb, entwickelte sich der zweite Kampf zunächst ausgeglichen. Doch nach mehreren Angriffen seines Gegners konnte er seine Verteidigung nicht mehr halten und schied aus.</p>\r\n<p class=\"text-justify\">Besser lief es für Theo Schulz, der nach längerer Wettkampfpause wieder auf die Matte zurückkehrte. Hochkonzentriert und in starker Form kämpfte er sich souverän bis ins Finale. Dort traf er auf einen deutlich größeren und schwereren Gegner. Dank seiner überlegenen Ausdauer und Kraft gelang ihm in der Verlängerung der entscheidende Punkt – Gold für Theo und damit der Titel „Friese Master“. Überschattet wurde der sportliche Erfolg allerdings durch die Disqualifikation von Maximilian Wollnik. Nach einer unübersichtlichen Situation wurde ihm ein <i>Hansoku-make</i> (Turnierdisqualifikation) ausgesprochen – eine Entscheidung, die sich nach Rücksprache mit den Kampfrichtern als falsch herausstellte. Dennoch wurde sie nicht revidiert. „Maximilian war heute sehr stark – da wäre definitiv etwas drin gewesen“, sagte Trainer Maximilian Greshake enttäuscht.</p>\r\n<p class=\"text-justify\">Für einen versöhnlichen Abschluss sorgte Lena Busiek. Sie musste eine Gewichtsklasse höher antreten und traf in ihrem Pool auf fünf Gegnerinnen. Zwei Kämpfe entschied sie souverän dank ihrer überlegenen Bodenarbeit. In zwei weiteren Duellen war sie körperlich unterlegen und musste sich geschlagen geben. Der fünfte Kampf wurde zum entscheidenden Duell um Bronze. Trotz einer starken Leistung und beinahe erfolgreicher Bodenaktion geriet Lena nach einer missglückten Standtechnik in Rückstand, den sie nicht mehr aufholen konnte. Am Ende reichte es dennoch für Platz drei und eine verdiente Bronzemedaille.</p>', 1745397277, 0, '', '', 1, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 1, NULL, NULL, 0, 0, 'theo-schulz-gewinnt-beim-friese-masters', '', '', '0.5', '', '');
INSERT INTO `tx_news_domain_model_news` (`notes`, `uid`, `pid`, `tstamp`, `crdate`, `deleted`, `hidden`, `starttime`, `endtime`, `fe_group`, `editlock`, `sys_language_uid`, `l10n_parent`, `l10n_source`, `l10n_state`, `t3_origuid`, `l10n_diffsource`, `t3ver_oid`, `t3ver_wsid`, `t3ver_state`, `t3ver_stage`, `sorting`, `title`, `teaser`, `bodytext`, `datetime`, `archive`, `author`, `author_email`, `categories`, `related`, `related_from`, `related_files`, `fal_related_files`, `related_links`, `type`, `keywords`, `description`, `tags`, `media`, `fal_media`, `internalurl`, `externalurl`, `istopnews`, `content_elements`, `path_segment`, `alternative_title`, `sitemap_changefreq`, `sitemap_priority`, `import_id`, `import_source`) VALUES
('', 12, 30, 1746955491, 1746951954, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 0, 'Ein sehr erfolgreiches Wettkampf-Wochenende liegt hinter unseren Turnerinnen', 'Am vergangenen Wochenende fanden in Gievenbeck die ersten Bezirksliga-Wettkämpfe der oberen Altersklassen statt. Am Samstag waren hier zwei Riegen aus Ladbergen am Start.', '<p>Im Wettkampf Nr. 3 – Turnerinnen 14 Jahre und jünger – hatten 12 Teams gemeldet. Für uns starteten Arina Matyusha, Lucy Berghaus, Lena Knüfer, Klara Vietmeier und Zoe Lautenschläger. Die Ausschreibund dieses Wettkampfes ist schon ambitioniert, kann man sogar Übungen bis zur P8 (zweit-höchster Schwierigkeitsgrad) turnen. Im Training hatten die Mädels fleißig trainiert und waren gut vorbereitet.</p>\r\n<p>Los ging es am Samstag am Sprung! Alle Turnerinnen zeigten schöne Handstandüberschläge über den Sprungtisch. Hier gelang es Lena die Tageshöchstwertung von 16,1 (von möglichen 17) Punkten zur erreichen. Der Start war also geglückt. Dann ging es zum Barren, an dem von den Ladberger Turnerinnen noch nicht die ganz hohen Übungen gezeigt werden konnten, aber die etwas „einfacheren“ Übungen wurden sehr präzise ausgeführt und wurden daher auch mit guten Wertungen belohnt. Im Mannschaftsergebnis an diesem Gerät konnte man vorne mithalten! Dann ging es an den gefürchteten Schwebebalken, der sich als echter Zitterbalken erwies…. Leider mussten unsere Mädels häufig ungeplant absteigen und büßten so viele Punkte ein. Hervorzuheben ist hier noch die Übung von Lucy, die mit 14,7 Punkten bewertet wurde. Mit diesem Rucksack ging es dann noch zum Boden. Lena und Lucy zeigten jeweils eine sehr sauber ausgeführte P8! Aber auch Arina, Klara und Zoe turnten ihre Übungen flüssig zur Musik durch. Nun ging das Warten auf die Siegerehrung los.</p>\r\n<p><br />Diese Riege schaffte einen phantastischen 2. Platz in der Hinrunde! Da war der Applaus der mitgereisten Fans riesengroß! Mit einem Mannschaftsergebnis von 183,10 Punkten musste sich nur der Riege aus Ibbenbüren (185,25 Punkte) geschlagen geben. Bis zur Rückrunde im September wird noch etwas an den Übungen gefeilt! Warten wir ab, was dann noch möglich ist.</p>\r\n<p><br />Als Sahnehäubchen wurde noch die beste Einzelturnerin aufgerufen. Dieses Sonderlob konnte Lena Knüfer mit nach Hause nehmen!</p>\r\n<p><br />Ebenso erfolgreich verlief der Wettkampf Nr. 4. Hier starteten alle Turnerinnen im offenen Jahrgang. Für den TSV gingen Laura Herter, Hanna Busiek, Melina Herte und Ella Kolzow ins Rennen. Diese neu formatierte Riege ist ohne große Erwartungen ins Rennen gegangen und war am Ende sehr happy über den 2. Platz in einem Teilnehmerfeld von insgesamt 9 Mannschaften! Auch einen herzlichen Glückwunsch an diese Mädels.</p>\r\n<p><br />Der Wettkampf startete hier ebenfalls am Sprung. Die Mädels legten einen guten Start hin und wechselten zum Barren. Auch hier konnten die Leistungen aus dem Training abgerufen werden! Die Wertungen der Kampfrichterinnen waren entsprechend gut! Dann wechselte die Riege zum Schwebebalken, an dem das Einturnen so gar nicht nach Maß lief. Hanna hatte einen schweren Sturz, konnte dann aber im Wettkampf tapfer die Übung durchziehen! Für die beste Wertung der TSV-Turnerinnen sorgte Melina, die fehlerfrei durch die Übung kam. Als letztes Gerät war dann noch der Boden dran. Mit viel Spannung und Ausstrahlung konnten Hanna und Laura ganz nach an die Tageshöchstwertung heranturnen.</p>\r\n<p><br />So ging ein schöner und überraschend erfolgreicher Wettkampftag zu Ende.</p>\r\n<p><br />Am Sonntag war dann unsere Kür-Riege im Einsatz. Leider mussten wir ersatzgeschwächt nach Münster anreisen und auch das Training in den letzten Wochen lief durch Verletzungen und Ausfällen nicht optimal. Dennoch gingen Sarah Maneke, Daria Eberhardt, Enie Schlichter und Svea Behling motiviert in den Wettkampf. Im Teilnehmerfeld traf man auf Absteiger aus der Münsterland-Liga und weitere stark eingeschätzte Konkurrenz aus dem ganzen Bezirk! Insgesamt hatten 13 Teams gemeldet!</p>\r\n<p><br />Die jungen Damen starteten am Boden! Hier gelang ein richtig guter Start in den Wettkampf und es wurden ordentlich Punkte mitgenommen. Motiviert ging es zum Sprung. Im Training wurde hier an schwierigeren Sprünge gearbeitet und diese konnten auch am Sonntag morgen gezeigt werden. Nach der Hälfte des Wettkampfes waren Turnerinnen und Trainerinnen sehr zufrieden. Doch dann kam der Barren! Nur Enie und Daria konnten hier konkurrenzfähige Übungen zeigen und auch am abschießenden Balken gab es leider zu viele Absteiger, sodass am Ende ein 11 Platz stand!</p>\r\n<p><br />Nun heißt es trainieren, trainieren, trainieren… doch erstmal steht das Highlight des Jahres an! Endlich wird wieder ein „Internationales Deutsches Turnfest“ stattfinden! Und wir sind in Leipzig dabei!</p>\r\n<p><br />Wir möchten uns noch ausdrücklich bei unseren Sponsoren für die super-schönen neuen Anzügen bedanken! Wir denken, dass auch das neue Outfit ihren Anteil an den Erfolgen des Wochenendes haben!</p>', 1746951600, 0, '', '', 1, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 2, NULL, NULL, 0, 0, 'ein-sehr-erfolgreiches-wettkampf-wochenende-liegt-hinter-unseren-turnerinnen', '', '', '0.5', '', ''),
('', 13, 30, 1751548890, 1751548890, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, '', 0, 0, 0, 0, 0, 'Demnächst auch Padel- Tennis im TSV', 'Der TSV vergrößert sich um eine weitere beliebte Sportart \"Padel- Tennis\". Direkt neben der Tennisanlage entsteht zur Zeit ein Padelcourt. Das Fundament ist gelegt. Der Aufbau des Courts erfolgt Ende Juli. Somit können dann im August die ersten Spiele gemacht werden.', '', 1751547843, 0, '', '', 2, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 0, NULL, NULL, 0, 0, 'demnaechst-auch-padel-tennis-im-tsv', '', '', '0.5', '', ''),
('', 14, 30, 1752555462, 1752555462, 0, 0, 0, 0, '', 0, 0, 0, 0, NULL, 0, '', 0, 0, 0, 0, 0, 'Ab August ist es soweit – wir eröffnen unseren eigenen Padel-Court!', 'Padel ist noch eine relativ junge Sportart, die in den 1960er Jahren in Mexiko entstand und sich seitdem weltweit verbreitet hat. Der neue Trendsport ist eine Mischung aus Tennis & Squash und begeistert nun ganz Europa. Mit der Einführung des neuen Padel Courts erweitert der TSV Ladbergen sein Sportangebot und eröffnet die Möglichkeit, eine innovative und aufregende Sportart zu entdecken.', '<p><span style=\"color:#408844;\"><strong>NEU beim TSV Ladbergen: Padel kommt</strong></span></p>\r\n<p><strong>Ladbergen, der 15.07.2025: </strong>Ab August ist es soweit – wir eröffnen unseren eigenen Padel-Court!&nbsp;</p>\r\n<p>Aber was ist genau Padel? Padel ist noch eine relativ junge Sportart, die in den 1960er Jahren in Mexiko entstand und sich seitdem weltweit verbreitet hat. Der neue Trendsport ist eine Mischung aus Tennis &amp; Squash und begeistert nun ganz Europa. Es wird auf einem geschlossenen Platz gespielt, der kleiner als ein Tennisplatz ist und von Wänden umgeben ist. Die Spieler verwenden spezielle Schläger ohne Saiten und einen drucklosen Ball. Padel ist bekannt für seine schnellen Ballwechsel und die Einbeziehung der Wände ins Spiel, was zusätzliche strategische Elemente einbringt.</p>\r\n<p>Padel wird im Doppel gespielt, das heißt, zwei Spieler treten gegen zwei andere Spieler an. Das Spiel beginnt mit einem Aufschlag, der unter Hüfthöhe erfolgen muss. Der Ball darf den Boden nur einmal berühren und kann danach von den Wänden abprallen. Punkte werden ähnlich wie beim Tennis gezählt: 15, 30, 40 und Vorteil. Wer den Ballwechsel gewinnt, erhält den Punkt.</p>\r\n<p>Padel ist sehr leicht zu erlernen und auch für Anfänger geeignet, die soziale Interaktion durch das Doppelspiel wird gefördert und bietet eine sehr spannende und mitreißende Spielweise bietet.&nbsp;</p>\r\n<p>Mit der Einführung des neuen Padel Courts erweitert der TSV Ladbergen sein Sportangebot und eröffnet die Möglichkeit, eine innovative und aufregende Sportart zu entdecken. Wir hoffen, dass viele Bewohner von Ladbergen und Umgebung diese Gelegenheit nutzen und die Freude am Padelsport erleben werden. Bleibt informiert über unsere Homepage und Social-Media-Kanäle, um die neuesten Updates und Veranstaltungshinweise zu erhalten.</p>', 1752554973, 0, '', '', 1, 0, 0, NULL, 0, 0, '0', '', '', 0, NULL, 1, NULL, NULL, 0, 0, 'ab-august-ist-es-soweit-wir-eroeffnen-unseren-eigenen-padel-court', '', '', '0.5', '', '');
